    "FAMOUSLY":
        "In a famous manner; in a distinguished degree; greatly;splendidly.Then this land was famously enriched With politic grave counsel.Shak.",
    "FAMOUSNESS": "The state of being famous.",
    "FAMULAR": "Domestic; familiar. [Obs.] Chaucer.",
    "FAMULATE": "To serve. [Obs.]",
    "FAMULIST":
        "A collegian of inferior rank or position, corresponding to thesizar at Cambridge. [Oxford Univ., Eng.]",
    "FAN PALM":
        "Any palm tree having fan-shaped or radiate leaves; as theChamærops humilis of Southern Europe; the species of Sabal andThrinax in the West Indies, Florida, etc.; and especially the greattalipot tree (Corypha umbraculifera) of Ceylon and Malaya. The leavesof the latter are often eighteen feet long and fourteen wide, and areused for umbrellas, tents, and roofs. When cut up, they are used forbooks and manuscripts.",
    "FAN-NERVED":
        "Having the nerves or veins arranged in a radiating manner; --said of certain leaves, and of the winfs of some insects.",
    "FAN-TAILED":
        "Having an expanded, or fan-shaped, tail; as, the fan-tailedpigeon.",
    "FANAL": "A lighthouse, or the apparatus placed in it for giving light.",
    "FANATIC":
        "Pertaining to, or indicating, fanaticism; extravagant inopinions; ultra; unreasonable; excessively enthusiastic, especiallyon religious subjects; as, fanatic zeal; fanatic notions.But Faith, fanatic Faith, once wedded fast To some dear falsehood,hugs it to the last. T. Moore.",
    "FANATICAL":
        "Characteristic of, or relating to, fanaticism; fanatic. -Fa*nat\"ic*al*ly, adv.-- Fa*nat\"ic*al*ness, n.",
    "FANATICISM":
        "Excessive enthusiasm, unreasoning zeal, or wild and extravagantnotions, on any subject, especially religion; religious frenzy.",
    "FANATICIZE": "To cause to become a fanatic.",
    "FANATISM": "Fanaticism. [R.] Gibbon.",
    "FANCIED": "Formed or conceived by the fancy; unreal; as, a fancied wrong.",
    "FANCILESS":
        "Having no fancy; without ideas or imagination. [R.]A pert or bluff important wight, Whose brain is fanciless, whoseblood is white. Armstrong.",
    "FANCY-FREE":
        "Free from the power of love. \"In maiden meditation, fancy-free.\" Shak.",
    "FANCY-SICK": "Love-sick. Shak.",
    "FANCYMONGER": "A lovemonger; a whimsical lover. [Obs.] Shak.",
    "FANCYWORK":
        "Ornamental work with a needle or hook, as embroidery,crocheting, netting, etc.",
    "FAND": "imp. of Find. Spenser.",
    "FANE":
        "A temple; a place consecrated to religion; a church. [Poet.]Such to this British Isle, her Christian fanes. Wordsworth.",
    "FANEGA":
        "A dry measure in Spain and Spanish America, varying from 1 DeColange.",
    "FANFARE":
        "A flourish of trumpets, as in coming into the lists, etc.;also, a short and lively air performed on hunting horns during thechase.The fanfare announcing the arrival of the various Christian princes.Sir W. Scott.",
    "FANFARON":
        "A bully; a hector; a swaggerer; an empty boaster. [R.] Dryden.",
    "FANFARONADE":
        "A swaggering; vain boasting; ostentation; a bluster. Swift.",
    "FANG":
        "The tusk of an animal, by which the prey is seized and held ortorn; a long pointed tooth; esp., one of the usually erectile,venomous teeth of serpents. Also, one of the falcers of a spider.Since I am a dog, beware my fangs. Shak.",
    "FANGED":
        "Having fangs or tusks; as, a fanged adder. Also usedfiguratively.",
    "FANGLE":
        "Something new-fashioned; a foolish innovation; a gewgaw; atrifling ornament.",
    "FANGLED":
        "New made; hence, gaudy; showy; vainly decorated. [Obs., exceptwith the prefix new.] See Newfangled. \"Our fangled world.\" Shak.",
    "FANGLENESS":
        "Quality of being fangled. [Obs.]He them in new fangleness did pass. Spenser.",
    "FANGLESS": "Destitute of fangs or tusks. \"A fangless lion.\" Shak.",
    "FANGOT": "A quantity of wares, as raw silk, etc., from one hundredweight.",
    "FANION":
        "A small flag sometimes carried at the head of the baggage of abrigade. [Obs.]",
    "FANLIKE":
        "Resembling a fan; -- specifically (Bot.), folded up like a fan,as certain leaves; plicate.",
    "FANNEL": "Same as Fanon.",
    "FANON":
        "A term applied to various articles, as: (a) A peculiar stripedscarf worn by the pope at mass, and by eastern bishops. (b) Amaniple. [Written also fannel, phanon, etc.]",
    "FANTASIA":
        "A continuous composition, not divided into what are calledmovements, or governed by the ordinary rules of musical design, butin which the author's fancy roves unrestricted by set form.",
    "FANTASIED": "Filled with fancies or imaginations. [Obs.] Shak.",
    "FANTASM": "Same as Phantasm.",
    "FANTAST": "One whose manners or ideas are fantastic. [R.] Coleridge.",
    "FANTASTIC":
        "A person given to fantastic dress, manners, etc.; an eccentricperson; a fop. Milton.Our fantastics, who, having a fine watch, take all ocasions to drowit out to be seen. Fuller.",
    "FANTASTIC-ALNESS": "The quality of being fantastic.",
    "FANTASTICAL": "Fanciful; unreal; whimsical; capricious; fantastic.",
    "FANTASTICALITY": "Fantastically. [Obs.]",
    "FANTASTICALLY":
        "In a fantastic manner.the letter A, in scarlet, fantastically embroidered with gold thread,upon her bosom. Hawthorne.",
    "FANTASTICISM":
        "The quality of being fantastical; fancifulness; whimsicality.Ruskin.",
    "FANTASTICLY": "Fantastically. [Obs.]",
    "FANTASTICNESS": "Fantasticalness. [Obs.]",
    "FANTASTICO": "A fantastic. [Obs.] Shak.",
    "FANTASY":
        "To have a fancy for; to be pleased with; to like; to fancy.[Obs.] Cavendish.Which he doth most fantasy. Robynson (More's Utopia).",
    "FANTOCCINI":
        "Puppets caused to perform evolutions or dramatic scenes bymeans of machinery; also, the representations in which they are used.",
    "FANTOM": "See Phantom. Fantom corn, phantom corn. Grose.",
    "FAP": "Fuddled. [Obs.] Shak.",
    "FAQUIR": "See Fakir.",
    "FAR": "A young pig, or a litter of pigs.",
    "FAR-ABOUT": "A going out of the way; a digression. [Obs.] Fuller.",
    "FAR-OFF": "Remote; as, the far-off distance. Cf. Far-off, under Far, adv.",
    "FAR-STRETCHED": "Stretched beyond ordinary limits.",
    "FARAD":
        "The standard unit of electrical capacity; the capacity of acondenser whose charge, having an electro-motive force of one volt,is equal to the amount of electricity which, with the sameelectromotive force, passes through one ohm in one second; thecapacity, which, charged with one coulomb, gives an electro-motiveforce of one volt.",
    "FARADIC":
        "Of or pertaining to Michael Faraday, the distinguishedelectrician; -- applied especially to induced currents ofelectricity, as produced by certain forms of inductive apparatus, onaccount of Faraday's investigations of their laws.",
    "FARADIZE":
        "To stimulate with, or subject to, faradic, or inducted,electric currents. --Far\"a*diz`er (#), n.",
    "FARAND": "See Farrand, n.",
    "FARANDAMS": "A fabrik made of silk and wool or hair. Simmonds.",
    "FARANDOLE":
        "A rapid dance in six-eight time in which a large number joinhands and dance in various figures, sometimes moving from room toroom. It originated in Provence.",
    "FARANTLY": "Orderly; comely; respectable. [Obs.] Halliwell.",
    "FARCE":
        "Stuffing, or mixture of viands, like that used on dressing afowl; forcemeat.",
    "FARCEMENT":
        "Stuffing; forcemeat. [Obs.]They spoil a good dish with . . . unsavory farcements. Feltham.",
    "FARCICAL":
        "Pertaining to farce; appropriated to farce; ludicrous;unnatural; unreal.They deny the characters to be farcical, because they are Gay.-- Far\"ci*cal*ly, adv. -Far\"ci*cal*ness, n.",
    "FARCILITE": "Pudding stone. [Obs.] Kirwan.",
    "FARCING": "Stuffing; forcemeat.",
    "FARCTATE":
        "Stuffed; filled solid; as, a farctate leaf, stem, or pericarp;-- opposed to tubular or hollow. [Obs.]",
    "FARCY":
        "A contagious disease of horses, associated with painfululcerating enlargements, esp. upon the head and limbs. It is of thesame nature as glanders, and is often fatal. Called also farcin, andfarcimen.",
    "FARD":
        "Paint used on the face. [Obs.] \"Painted with French fard.\" J.Whitaker.",
    "FARDAGE": "See Dunnage.",
    "FARDEL":
        "A bundle or little pack; hence, a burden. [Obs.] Shak.A fardel of never-ending misery and suspense. Marryat.",
    "FARDING-BAG":
        "The upper stomach of a cow, or other ruminant animal; therumen.",
    "FARDINGDALE": "A farthingale. [Obs.]",
    "FARDINGDEAL":
        "The fourth part of an acre of land. [Obs.] [Written alsofarding dale, fardingale, etc.]",
    "FAREN": "p. p. of Fare, v. i. Chaucer.",
    "FAREWELL":
        "Go well; good-by; adieu; -- originally applied to a persondeparting, but by custom now applied both to those who depart andthose who remain. It is often separated by the pronoun; as, fare youwell; and is sometimes used as an expression of separation only; as,farewell the year; farewell, ye sweet groves; that is, I bid youfarewell.So farewell hope, and with hope, farewell fear. Milton.Fare thee well! and if forever, Still forever fare thee well. Byron.",
    "FARFET": "Farfetched. [Obs.]York with his farfet policy. Shak.",
    "FARFETCH":
        "To bring from far; to seek out studiously. [Obs.]To farfetch the name of Tartar from a Hebrew word. Fuller.",
    "FARINA": "Pollen. [R.] Craig.",
    "FARINOSE":
        "Civered with a sort of white, mealy powder, as the leaves ofsome poplars, and the body of certain insects; mealy.",
    "FARL": "Same as Furl. [Obs.] Beau. & Fl.",
    "FARLIE":
        "An unusual or unexpected thing; a wonder. See Fearly. [Obs. orProv. Eng.] Drayton.",
    "FARM":
        "A lease of the imposts on particular goods; as, the sugar farm,the silk farm.Whereas G. H. held the farm of sugars upon a rent of 10,000 marks perannum. State Trials (1196).",
    "FARMABLE": "Capable of being farmed.",
    "FARMER":
        "One who farms; as:(a) One who hires and cultivates a farm; a cultivator of leasedground; a tenant. Smart.(b) One who is devoted to the tillage of the soil; one who cultivatesa farm; an agriculturist; a husbandman.(c) One who takes taxes, customs, excise, or other duties, tocollect, either paying a fixed annuual rent for the privilege; as, afarmer of the revenues.(d) (Mining) The lord of the field, or one who farms the lot and copeof the crown. Farmer-general Etym: [F. fermier-general], one to whomthe right of levying certain taxes, in a particular district, wasfarmed out, under the former French monarchy, for a given sum paiddown.-- Farmers' satin, a light material of cotton and worsted, used forcoat linings. McElrath.-- The king's farmer (O. Eng. Law), one to whom the collection of aroyal revenue was farmed out. Burrill.",
    "FARMERESS": "A woman who farms.",
    "FARMERSHIP": "Skill in farming.",
    "FARMERY":
        "The buildings and yards necessary for the business of a farm; ahomestead. [Eng.]",
    "FARMHOUSE": "A dwelling house on a farm; a farmer's residence.",
    "FARMING":
        "Pertaining to agriculture; devoted to, adapted to, or engagedin, farming; as, farming tools; farming land; a farming community.",
    "FARMOST":
        "Most distant; farthest.A spacious cave within its farmost part. Dryden.",
    "FARMSTEAD":
        "A farm with the building upon it; a homestead on a farm.Tennyson.With its pleasant groves and farmsteads. Carlyle.",
    "FARMSTEADING": "A farmstead. [Scot.] Black.",
    "FARMYARD":
        "The yard or inclosure attached to a barn, or the space inclosedby the farm buildings.",
    "FARNESS": "The state of being far off; distance; remoteness. [R.] Grew.",
    "FARO":
        "A gambling game at cardds, in whiich all the other players playagainst the dealer or banker, staking their money upon the order inwhich the cards will lie and be dealt from the pack. Faro bank, thecapital which the proprietor of a farotable ventures in the game;also, the place where a game of faro is played. Hoyle.",
    "FAROESE":
        "An inhabitant, or, collectively, inhabitants, of the Faroeislands.",
    "FARRAGINOUS":
        "Formed of various materials; mixed; as, a farraginous mountain.[R.] Kirwan.AA farraginous concurrence of all conditions, tempers, sexes, andages. Sir T. Browne.",
    "FARRAGO":
        "A mass ccomposed of various materials confusedly mixed; amedley; a mixture.A confounded farrago of doubts, fears, hopes, wishes, and all theflimsy furniture of a country miss's brain. Sheridan.",
    "FARRAND":
        "Manner; custom; fashion; humor. [Prov. Eng.] [Written alsofarand.] Grose.",
    "FARREATION": "Same as Confarreation.",
    "FARRIER": "Defn:",
    "FARROW": "A little of pigs. Shak.",
    "FARRY": "A farrow. [Obs.] Perry.",
    "FARSE":
        "An addition to, or a paraphrase of, some part of the Latinservice in the vernacular; -- common in English before theReformation.",
    "FARSIGHTED": "Hypermetropic.",
    "FARSIGHTEDNESS": "Hypermetropia.",
    "FARTHER": "To help onward. [R.] See Further.",
    "FARTHERANCE": "See Furtherence.",
    "FARTHERMORE": "See Furthermore.",
    "FARTHERMOST":
        "Most distant or remote; as, the farthest degree. See Furthest.",
    "FARTHEST":
        "Most distant or remote; as, the farthest degree.  See Furthest.",
    "FARTHINGALE":
        "A hoop skirt or hoop petticoat, or other light, elasticmaterial, used to extend the petticoat.We'll revel it as bravely as the best, . . . With ruffs and cuffs,and farthingales and things. Shak.",
    "FASCES":
        "A bundle of rods, having among them an ax with the bladeprojecting, borne before the Roman magistrates as a badge of theirauthority.",
    "FASCET":
        "A wire basket on the end of a rod to carry glass bottles, etc.,to the annealing furnace; also, an iron rod to be thrust into themouths of bottles, and used for the same purpose; -- calles alsopontee and punty.",
    "FASCIA":
        "A flat member of an order or building, like a flat band orbroad fillet; especially, one of the three bands which make up thearchitrave, in the Ionic order. See Illust. of Column.",
    "FASCIAL": "Relating to a fascia.",
    "FASCIATION":
        "The act or manner of binding up; bandage; also, the conditionof being fasciated.",
    "FASCICLE":
        "A small bundle or collection; a compact cluster; as, a fascicleof fibers; a fascicle of flowers or roots.",
    "FASCICLED":
        "Growing in a bundle, tuft, or close cluster; as, the fascicledleaves of the pine or larch; the fascicled roots of the dahlia;fascicled muscle fibers; fascicled tufts of hair.",
    "FASCICULAR": "Pertaining to a fascicle; fascicled; as, a fascicular root.",
    "FASCICULARLY": "In a fascicled manner. Kirwan.",
    "FASCICULE":
        "A small bunch or bundle; a fascicle; as, a fascicule of fibers,hairs, or spines.",
    "FASCINE":
        "A cylindrical bundle of small sticks of wood, bound together,used in raising batteries, filling ditches, strengthening ramparts,and making parapets; also in revetments for river banks, and in matsfor dams, jetties, etc.",
    "FASCINOUS":
        "Caused or acting by witchcraft. [Obs.] \"Fascinous diseases.\"Harvey.",
    "FASCIOLA":
        "A band of gray matter bordering the fimbria in the brain; thedentate convolution. Wilder.",
    "FASCIOLE":
        "A band of minute tubercles, bearing modified spines, on theshells of spatangoid sea urchins. See Spatangoidea.",
    "FASH": "To vex; to tease; to trouble. [Scot.]",
    "FASHION-MONGER": "One who studies the fashions; a fop; a dandy. Marston.",
    "FASHION-MONGERING": "Behaving like a fashion-monger. [R.] Shak.",
    "FASHIONABLE":
        "A person who conforms to the fashions; -- used chiefly in theplural.",
    "FASHIONABLENESS": "State of being fashionable.",
    "FASHIONABLY": "In a fashionable manner.",
    "FASHIONED":
        "Having a certain style or fashion; as old-fashioned; new-fashioned.",
    "FASHIONER":
        "One who fashions, forms, ar gives shape to anything. [R.]The fashioner had accomplished his task, and the dresses were broughthome. Sir W. Scott.",
    "FASHIONIST":
        "An obsequious follower of the modes and fashions. [R.] Fuller.",
    "FASHIONLESS": "Having no fashion.",
    "FASSAITE":
        "A variety of pyroxene, from the valley of Fassa, in the Tyrol.",
    "FAST":
        "That which fastens or holds; especially, (Naut.) a mooringrope, hawser, or chain; -- called, according to its position, a bow,head, quarter, breast, or stern fast; also, a post on a pier aroundwhich hawsers are passed in mooring.",
    "FAST-HANDED":
        "Close-handed; close-fisted; covetous; avaricious. [Obs.] Bacon.",
    "FASTEN":
        "To fix one's self; to take firm hold; to clinch; to cling.A horse leech will hardly fasten on a fish. Sir T. Browne.",
    "FASTENER": "One who, or that which, makes fast or firm.",
    "FASTENING":
        "Anything that binds and makes fast, as a lock, catch, bolt,bar, buckle, etc.",
    "FASTER": "One who abstains from food.",
    "FASTIDIOSITY": "Fastidiousness; squeamishness. [Obs.] Swift.",
    "FASTIDIOUS":
        "Difficult to please; delicate to fault; suited with difficulty;squeamish; as, a fastidious mind or ear; a fastidious appetite.Proud youth ! fastidious of the lower world. Young.",
    "FASTISH": "Rather fast; also, somewhat dissipated. [Colloq.] Thackeray.",
    "FASTLY": "Firmly; surely.",
    "FASTUOUS":
        "Proud; haughty; disdainful. [Obs.] Barrow. Fas\"tu*ous*ness, n.[Obs.] Jer. Taylor.",
    "FAT":
        "Of a character which enables the compositor to make largewages; -- said of matter containing blank, cuts, or many leads, etc.;as, a fat take; a fat page. Fat lute, a mixture of pipe clay and oilfor filling joints.",
    "FAT-BRAINED": "Dull of apprehension.",
    "FAT-KIDNEYED": "Gross; lubberly.Peace, ye fat-kidneyed rascal ! Shak.",
    "FAT-WITTED": "Dull; stupid. Shak.",
    "FATA MORGANA":
        "A kind of mirage by which distant objects appear inverted,distorted, displaced, or multiplied. It is noticed particularly atthe Straits of Messina, between Calabria and Sicily.",
    "FATALISM":
        "The doctrine that all things are subject to fate, or that theytake place by inevitable necessity.",
    "FATALIST":
        "One who maintains that all things happen by inevitablenecessity.",
    "FATALISTIC": "Implying, or partaking of the nature of, fatalism.",
    "FATALNESS": ", . Quality of being fatal. Johnson.",
    "FATBACK": "The menhaden.",
    "FATE":
        "The three goddesses, Clotho, Lachesis, and Atropos, sometimescalled the Destinies, or Parcæwho were supposed to determine thecourse of human life. They are represented, one as holding thedistaff, a second as spinning, and the third as cutting off thethread.",
    "FATEFUL":
        "Having the power of serving or accomplishing fate. \"The fatefulsteel.\" J. Barlow.",
    "FATHER LONGLEGS": "See Daddy longlegs, 2.",
    "FATHER-IN-LAW":
        "The father of one's husband or wife; -- correlative to son-in-law and daughter-in-law.",
    "FATHER-LASHER":
        "A European marine fish (Cottus bubalis), allied to the sculpin;-- called also lucky proach.",
    "FATHERHOOD":
        "The state of being a father; the character or authority of afather; paternity.",
    "FATHERLAND":
        "One's native land; the native land of one's fathers orancestors.",
    "FATHERLESSNESS": "The state of being without a father.",
    "FATHERLINESS": "The qualities of a father; parantal kindness, care, etc.",
    "FATHERSHIP": "The state of being a father; fatherhood; paternity.",
    "FATHOMABLE": "Capable of being fathomed.",
    "FATHOMER": "One who fathoms.",
    "FATIDICAL":
        "Having power to foretell future events; prophetic; fatiloquent;as, the fatidical oak. [R.] Howell.-- Fa*tid\"i*cal*ly, adv.",
    "FATIFEROUS": "Fate-bringing; deadly; mortal; destructive. [R.] Johnson.",
    "FATIGABLE": "Easily tired. [Obs.] Bailey.",
    "FATIGATE":
        "Wearied; tired; fatigued. [Obs.]Requickened what in flesh was fatigate. Shak.",
    "FATIGATION": "Weariness. [Obs.] W. Montaqu.",
    "FATIGUE":
        "To weary with labor or any bodily or mental exertion; to harasswith toil; to exhaust the strength or endurance of; to tire.",
    "FATILOQUENT": "Prophetic; fatidical. [Obs.] Blount.",
    "FATILOQUIST": "A fortune teller.",
    "FATISCENCE":
        "A gaping or opening; state of being chinky, or havingapertures. Kirwan.",
    "FATLING":
        "A calf, lamb, kid, or other young animal fattened forslaughter; a fat animal; -- said of such animals as are used forfood.He sacrificed oxen and fatlings. 2 Sam. vi. 13.",
    "FATLY": "Grossly; greasily.",
    "FATNER": "One who fattens. [R.] See Fattener. Arbuthnit.",
    "FATTEN":
        "To grow fat or corpulent; to grow plump, thick, or fleshy; tobe pampered.And villains fatten with the brave man's labor. Otway.",
    "FATTENER":
        "One who, or that which, fattens; that which gives fatness orfertility.",
    "FATTINESS": "State or quality of being fatty.",
    "FATTISH":
        "Somewhat fat; inclined to fatness.Coleridge, a puffy, anxious, obstructed-looking, fattish old man.Carlyle.",
    "FATTY":
        "Containing fat, or having the qualities of fat; greasy; gross;as, a fatty substance. Fatty acid (Chem.), any one of the paraffinseries of monocarbonic acids, as formic acid, acetic, etc.; -- socalled because the higher members, as stearic and palmitic acids,occur in the natural fats, and are themselves fatlike substances.-- Fatty clays. See under Clay.-- Fatty degeneration (Med.), a diseased condition, in which the oilglobules, naturally present in certain organs, are so multiplied asgradually to destroy and replace the efficient parts of these organs.-- Fatty heart, Fatty liver, etc. (Med.), a heart, liver, etc.,which have been the subjects of fatty degeneration or infiltration.-- Fatty infiltration (Med.), a condition in which there is anexcessive accumulation of fat in an organ, without destruction of anyessential parts of the latter.-- Fatty tumor (Med.), a tumor consisting of fatty or adiposetissue; lipoma.",
    "FATUITOUS": "Stupid; fatuous.",
    "FATUITY":
        "Weakness or imbecility of mind; stupidity.Those many forms of popular fatuity. I Taylor.",
    "FAUBOURG":
        "A suburb of French city; also, a district now within a city,but formerly without its walls.",
    "FAUCAL":
        "Pertaining to the fauces, or opening of the throat; faucial;esp., (Phon.) produced in the fauces, as certain deep guttural soundsfound in the Semitic and some other languages.Ayin is the most difficult of the faucals. I. Taylor (The Alphabet).",
    "FAUCES":
        "The narrow passage from the mouth to the pharynx, situatedbetween the soft palate and the base of the tongue; -- called alsothe isthmus of the fauces. On either side of the passage twomembranous folds, called the pillars of the fauces, inclose thetonsils.",
    "FAUCHION": "See Falchion. [Obs.]",
    "FAUCIAL": "Pertaining to the fauces; pharyngeal.",
    "FAUGH": "An exclamation of contempt, disgust, or abhorrence.",
    "FAULCHION": "See Falchion.",
    "FAULCON": "See Falcon.",
    "FAULD": "The arch over the dam of a blast furnace; the tymp arch.",
    "FAULE":
        "A fall or falling band. [Obs.]These laces, ribbons, and these faules. Herrick.",
    "FAULT":
        "A lost scent; act of losing the scent.Ceasing their clamorous cry till they have singled, With much ado,the cold fault cleary out. Shak.",
    "FAULT-FINDER":
        "One who makes a practice off discovering others' faults andcensuring them; a scold.",
    "FAULT-FINDING":
        "The act of finding fault or blaming; -- used derogatively. AlsoAdj.",
    "FAULTER":
        "One who commits a fault. [Obs.]Behold the faulter here in sight. Fairfax.",
    "FAULTFUL": "Full of faults or sins. Shak.",
    "FAULTILY": "In a faulty manner.",
    "FAULTINESS":
        "Quality or state of being faulty.Round, even to faultiness. Shak.",
    "FAULTING":
        "The state or condition of being faulted; the process by which afault is produced.",
    "FAULTLESS":
        "Without fault; not defective or imperfect; free from blemish;free from incorrectness, vice, or offense; perfect; as, a faultlesspoem.Whoever thinks a faultless piece to see, Thinks what ne'er was, noris, nor e'er shall be. Pope.",
    "FAUN":
        "A god of fields and shipherds, diddering little from the satyr.The fauns are usually represented as half goat and half man.Satyr or Faun, or Sylvan. Milton.",
    "FAUNA":
        "The animals of any given area or epoch; as, the fauna ofAmerica; fossil fauna; recent fauna.",
    "FAUNAL": "Relating to fauna.",
    "FAUNIST":
        "One who describes the fauna of country; a naturalist. GilbertWhite.",
    "FAUNUS": "See Faun.",
    "FAUSEN": "A young eel. [Prov. Eng.]",
    "FAUSSE-BRAYE":
        "A second raampart, exterior to, and parallel to, the mainrampart, and considerably below its level.",
    "FAUTOR":
