        "Pertaining to the femur or thigh; as, the femoral artery.\"Femoral habiliments.\" Sir W. Scott.",
    "FEN":
        "Low land overflowed, or covered wholly or partially with water,but producing sedge, coarse grasses, or other aquatic plants; boggyland; moor; marsh.'Mid reedy fens wide spread. Wordsworth.",
    "FEN CRICKET": "The mole cricket. [Prov. Eng.]",
    "FEN-SUCKED": "Sucked out of marches. \"Fen-sucked fogs.\" Shak.",
    "FENCE":
        "A projection on the bolt, which passes through the tumblergates in locking and unlocking.",
    "FENCE MONTH":
        "the month in which female deer are fawning, when hunting isprohibited. Bullokar.-- Fence roof, a covering for defense. \"They fitted their shieldsclose to one another in manner of a fence roof.\" Holland. Fence time,the breeding time of fish or game, when they should not be killed.-- Rail fence, a fence made of rails, sometimes supported by posts.-- Ring fence, a fence which encircles a large area, or a wholeestate, within one inclosure.-- Worm fence, a zigzag fence composed of rails crossing one anotherat their ends; -- called also snake fence, or Virginia rail fence.-- To be on the fence, to be undecided or uncommitted in respect totwo opposing parties or policies. [Colloq.]",
    "FENCEFUL": "Affording defense; defensive. [Obs.] Congreve.",
    "FENCELESS":
        "Without a fence; uninclosed; open; unguarded; defenseless.Milton.",
    "FENCER":
        "One who fences; one who teaches or practices the art of fencingwith sword or foil.As blunt as the fencer's foils. Shak.",
