    "FERRICYANIDE":
        "One of a complex series of double cyanides of ferric iron andsome other base. Potassium ferricyanide (Chem.), red prussiate ofpotash; a dark, red, crystalline salt, K6(CN)12Fe2, consisting of thedouble cyanide of potassium and ferric iron. From it is derived theferrous ferricyanate, Turnbull's blue.",
