    "FERTILIZATION":
        "The act of fecundating or impregnating animal or vegetablegerms; esp., the process by which in flowers the pollen renders theovule fertile, or an analogous process in flowerless plants;fecundation; impregnation. Close fertilization (Bot.), thefertilization of pistils by pollen derived from the stamens of thesame blossom.-- Cross fertilization, fertilization by pollen from some otherblossom. See under Cross, a.",
