        "A diseased state of the system, marked by increased heat,acceleration of the pulse, and a general derangement of thefunctions, including usually, thirst and loss of appetite. Manydiseases, of which fever is the most prominent symptom, aredenominated fevers; as, typhoid fever; yellow fever.",
