    "FICKLE":
        "Not fixed or firm; liable to change; unstable; of a changeablemind; not firm in opinion or purpose; inconstant; capricious; as,Fortune's fickle wheel. Shak.They know how fickle common lovers are. Dryden.",
    "FICKLENESS":
        "The quality of being fickle; instability; inconsonancy. Shak.",
    "FICKLY": "In a fickle manner. [Obs.] Pepys.",
    "FICO":
        "A fig; an insignificant trifle, no more than the snap of one'sthumb; a sign of contempt made by the fingers, expressing. A fig foryou.Steal! foh, a fico for the phrase. Shak.",
    "FICTILE":
        "Molded, or capable of being molded, into form by art; relatingto pottery or to molding in any soft material.Fictile earth is more fragile than crude earth. Bacon.The earliest specimens of Italian fictile art. C. Wordsworth.Fictile ware, ware made of any material which is molded or shapedwhile soft; hence, pottery of any sort.-- Fic\"tile*ness, n.-- Fic*til\"i*ty, n.",
    "FICTION":
        "An assumption of a possible thing as a fact, irrespective ofthe question of its truth. Wharton.",
    "FICTIONAL":
        "Pertaining to, or characterized by, fiction; fictitious;romantic.\"Fictional rather than historical.\" Latham.",
    "FICTIONIST": "A writer of fiction. [R.] Lamb.",
    "FICTIOUS": "Fictitious. [R.] Prior.",
    "FICTITIOUS":
        "Feigned; imaginary; not real; fabulous; counterfeit; false; notgenuine; as, fictitious fame.The human persons are as fictitious as the airy ones. Pope.-- Fic*ti\"tious*ly, adv.-- Fic*ti\"tious*ness, n.",
    "FICTIVE":
        "Feigned; counterfeit. \"The fount of fictive tears.\" Tennyson.",
    "FICTOR":
        "An artist who models or forms statues and reliefs in anyplastic material. [R.] Elmes.",
    "FICUS":
        "A genus of trees or shrubs, one species of which (F. Carica)produces the figs of commerce; the fig tree.",
    "FID":
        "A square bar of wood or iron, used to support the topmast,being passed through a hole or mortise at its heel, and resting onthe trestle trees.",
    "FIDALGO":
        "The lowest title of nobility in Portugal, corresponding to thatof Hidalgo in Spain.",
    "FIDDLE":
        "A stringed instrument of music played with a bow; a violin; akit.",
    "FIDDLE-FADDLE": "A trifle; trifling talk; nonsense. [Colloq.] Spectator.",
    "FIDDLE-SHAPED": "Inversely ovate, with a deep hollow on each side. Gray.",
    "FIDDLEDEEDEE":
        "An exclamatory word or phrase, equivalent to nonsense![Colloq.]",
    "FIDDLER":
        "A burrowing crab of the genus Gelasimus, of many species. Themale has one claw very much enlarged, and often holds it in aposition similar to that in which a musician holds a fiddle, hencethe name; -- called also calling crab, soldier crab, and fightingcrab.",
    "FIDDLESTICK":
        "The bow, strung with horsehair, used in playing the fiddle; afiddle bow.",
    "FIDDLESTRING": "One of the catgut strings of a fiddle.",
    "FIDDLEWOOD":
        "The wood of several West Indian trees, mostly of the genusCitharexylum.",
    "FIDEJUSSION":
        "The act or state of being bound as surety for another;suretyship.",
    "FIDEJUSSOR":
        "A surety; one bound for another, conjointly with him; aguarantor. Blackstone.",
    "FIDELITY":
        "Faithfulness; adherence to right; careful and exact observanceof duty, or discharge of obligations. Especially:(a) Adherence to a person or party to which one is bound; loyalty.Whose courageous fidelity was proof to all danger. Macaulay.The best security for the fidelity of men is to make interestcoincide with duty. A. Hamilton.",
    "FIDES": "Faith personified as a goddess; the goddess of faith.",
    "FIDGE": "See Fidget. [R.] Swift.",
    "FIDGET":
        "To move uneasily one way and the other; to move irregularly, orby fits and starts. Moore.",
    "FIDGETINESS": "Quality of being fidgety.",
    "FIDGETY": "Restless; uneasy. Lowell.",
    "FIDIA":
        "A genus of small beetles, of which one species (the grapevineFidia, F. longipes) is very injurious to vines in America.",
    "FIDICINAL": "Of or pertaining to a stringed instrument.",
    "FIDUCIALLY": "With confidence. South.",
    "FIDUCIARY":
        "One who depends for salvation on faith, without works; anAntinomian. Hammond.",
    "FIE": "An exclamation denoting contempt or dislike. See Fy. Fuller.",
    "FIEF":
        "An estate held of a superior on condition of military service;a fee; a feud. See under Benefice, n., 2.",
    "FIELD":
        "The whole surface of an escutcheon; also, so much of it isshown unconcealed by the different bearings upon it. See Illust. ofFess, where the field is represented as gules (red), while the fessis argent (silver).",
    "FIELDED":
        "Engaged in the field; encamped. [Obs.]To help fielded friends. Shak.",
    "FIELDEN":
        "Consisting of fields. [Obs.]The fielden country also and plains. Holland.",
    "FIELDER":
        "A ball payer who stands out in the field to catch or stopballs.",
    "FIELDFARE":
        "a small thrush (Turdus pilaris) which breeds in northern Europeand winters in Great Britain. The head, nape, and lower part of theback are ash-colored; the upper part of the back and wing coverts,chestnut; -- called also fellfare.",
    "FIELDING": "The act of playing as a fielder.",
    "FIELDPIECE":
        "A cannon mounted on wheels, for the use of a marching army; apiece of field artillery; -- called also field gun.",
    "FIELDWORK":
        "Any temporary fortification thrown up by an army in the field;-- commonly in the plural.All works which do not come under the head of permanent fortificationare called fieldworks. Wilhelm.",
    "FIELDY": "Open, like a field. [Obs.] Wyclif.",
    "FIEND":
        "An implacable or malicious foe; one who is diabolically wickedor cruel; an infernal being; -- applied specifically to the devil ora demon.Into this wild abyss the wary fiend Stood on the brink of Hell andlooked a while. Milton.O woman! woman! when to ill thy mind Is bent, all hell contains nofouler fiend. Pope.",
    "FIENDFUL":
        "Full of fiendish spirit or arts. Marlowe.-- Fiend\"ful*ly, adv.",
    "FIENDISH":
        "Like a fiend; diabolically wicked or cruel; infernal;malignant; devilish; hellish.-- Fiend\"ish*ly, adv.-- Fiend\"ish*ness, n.",
    "FIENDLIKE": "Fiendish; diabolical. Longfellow.",
    "FIENDLY": "Fiendlike; monstrous; devilish. [Obs.] Chaucer.",
    "FIERASFER":
        "A genus of small, slender fishes, remarkable for their habit ofliving as commensals in other animals. One species inhabits the gillcavity of the pearl oyster near Panama; another lives within an EastIndian holothurian.",
    "FIERI FACIAS":
        "A judicial writ that lies for one who has recovered in debt ordamages, commanding the sheriff that he cause to be made of thegoods, chattels, or real estate of the defendant, the sum claimed.Blackstone. Cowell.",
    "FIERINESS":
        "The quality of being fiery; heat; acrimony; irritability; as, afieriness of temper. Addison.",
    "FIESTA":
        "Among Spanish, a religious festival; a saint's day or holiday;also, a holiday or festivity.",
    "FIFE":
        "A small shrill pipe, resembling the piccolo flute, used chieflyto accompany the drum in military music. Fife major (Mil.), anoncommissioned officer who superintends the fifers of a regiment.-- Fife rail. (Naut.) (a) A rail about the mast, at the deck, tohold belaying pins, etc. (b) A railing around the break of a poopdeck.",
    "FIFER": "One who plays on a fife.",
    "FIFTEEN": "Five and ten; one more than fourteen.",
    "FIFTH":
        "The interval of three tones and a semitone, embracing fivediatonic degrees of the scale; the dominant of any key.",
    "FIFTHLY": "In the fifth place; as the fifth in order.",
    "FIFTIETH":
        "One of fifty equal parts; the quotient of a unit divided byfifty.",
    "FIFTY": "Five times ten; as, fifty men.",
    "FIG":
        "A small fruit tree (Ficus Carica) with large leaves, known fromthe remotest antiquity. It was probably native from Syria westward tothe Canary Islands.",
    "FIG-SHELL":
        "A marine univalve shell of the genus Pyrula, or Ficula,resembling a fig in form.",
    "FIGARO": "An adroi",
    "FIGARY": "A frolic; a vagary; a whim. [Obs.] Beau. & Fl.",
    "FIGENT":
        "Fidgety; restless. [Obs.]Such a little figent thing. Beau. & Fl.",
    "FIGGUM":
        "A juggler's trick; conjuring. [Obs.]The devil is the author of wicked figgum. B. Jonson.",
    "FIGHTER": "One who fights; a combatant; a warrior. Shak.",
    "FIGHTINGLY": "Pugnaciously.",
    "FIGHTWITE":
        "A mulct or fine imposed on a person for making a fight orquarrel to the disturbance of the peace.",
    "FIGMENT":
        "An invention; a fiction; something feigned or imagined.Social figments, feints, and formalism. Mrs. Browning.It carried rather an appearance of figment and invention . . . thanof truth and reality. Woodward.",
    "FIGPECKER":
        "The European garden warbler (Sylvia, or Currica, hortensis); --called also beccafico and greater pettychaps.",
    "FIGULINE":
        "A piece of pottery ornamented with representations of naturalobjects.Whose figulines and rustic wares Scarce find him bread from day today. Longfellow.",
    "FIGURABILITY": "The quality of being figurable. Johnson.",
    "FIGURABLE":
        "Capable of being brought to a fixed form or shape.Lead is figurable, but water is not. Johnson.",
    "FIGURAL":
        "Figurate. See Figurate. Figural numbers. See Figurate numbers,under Figurate.",
    "FIGURANT":
        "One who dances at the opera, not singly, but in groups orfigures; an accessory character on the stage, who figures in itsscenes, but has nothing to say; hence, one who figures in any scene,without taking a prominent part.",
    "FIGURANTE": "A female figurant; esp., a ballet girl.",
    "FIGURATE":
        "Florid; figurative; involving passing discords by the freermelodic movement of one or more parts or voices in the harmony; as,figurate counterpoint or descant. Figurate counterpoint or descant(Mus.), that which is not simple, or in which the parts do not movetogether tone for tone, but in which freer movement of one or moreparts mingles passing discords with the harmony; -- called alsofigural, figurative, and figured counterpoint or descant (althoughthe term figured is more commonly applied to a bass with numeralswritten above or below to indicate the other notes of the harmony).-- Figurate numbers (Math.), numbers, or series of numbers, formedfrom any arithmetical progression in which the first term is a unit,and the difference a whole number, by taking the first term, and thesums of the first two, first three, first four, etc., as thesuccessive terms of a new series, from which another may be formed inthe same manner, and so on, the numbers in the resulting series beingsuch that points representing them are capable of symmetricalarrangement in different geometrical figures, as triangles, squares,pentagons, etc.",
    "FIGURATED": "Having a determinate form.",
    "FIGURATELY": "In a figurate manner.",
    "FIGURATION": "Mixture of concords and discords.",
    "FIGURE":
        "A diagram or drawing; made to represent a magnitude or therelation of two or more magnitudes; a surface or space inclosed onall sides; -- called superficial when inclosed by lines, and solidwhen inclosed by surface; any arrangement made up of points, lines,angles, surfaces, etc.",
    "FIGUREHEAD": "The figure, statue, or bust, on the prow of a ship.",
    "FIGURIAL": "Represented by figure or delineation. [R.] Craig.",
    "FIGURINE":
        "A very small figure, whether human or of an animal; especially,one in terra cotta or the like; -- distinguished from statuette,which is applied to small figures in bronze, marble, etc.",
    "FIGURIST": "One who uses or interprets figurative expressions. Waterland.",
    "FIGWORT":
        "A genus of herbaceous plants (Scrophularia), mostly found inthe north temperate zones. See Brownwort.",
    "FIJIAN": "Of or pertaining to the Fiji islands or their inhabitants.-- n.",
    "FIKE": "See Fyke.",
    "FIL": "imp. of Fall, v. i. Fell. Chaucer.",
    "FILACEOUS": "Composed of threads. Bacon.",
    "FILACER":
        "A former officer in the English Court of Common Pleas; -- socalled because he filed the writs on which he made out process.[Obs.] Burrill.",
    "FILAMENT":
        "A thread or threadlike object or appendage; a fiber; esp.(Bot.), the threadlike part of the stamen supporting the anther.",
    "FILAMENTARY": "Having the character of, or formed by, a filament.",
    "FILAMENTOID": "Like a filament.",
    "FILAMENTOUS": "Like a thread; consisting of threads or filaments. Gray.",
    "FILANDER":
        "A species of kangaroo (Macropus Brunii), inhabiting New Guinea.",
    "FILANDERS":
        "A disease in hawks, characterized by the presence of smallthreadlike worms, also of filaments of coagulated blood, from therupture of a vein; -- called also backworm. Sir T. Browne.",
    "FILAR":
        "Of or pertaining to a thread or line; characterized by threadsstretched across the field of view; as, a filar microscope; a filarmicrometer.",
    "FILARIA":
        "A genus of slender, nematode worms of many species, parasiticin various animals. See Guinea worm.",
    "FILARIAL":
        "Of, pertaining to, or caused by, filariæ and allied parasiticworms.",
    "FILARIASIS":
        "The presence of filariæ in the blood; infection with filariæ.",
    "FILASSE": "Vegetable fiber, as jute or ramie, prepared for manufacture.",
    "FILATORY": "A machine for forming threads. [Obs.] W. Tooke.",
    "FILBERT":
        "The fruit of the Corylus Avellana or hazel. It is an oval nut,containing a kernel that has a mild, farinaceous, oily taste,agreeable to the palate.",
    "FILCH":
        "To steal or take privily (commonly, that which is of littlevalue); to pilfer.Fain would they filch that little food away. Dryden.But he that filches from me my good name, Robs me of that which notenriches him, And makes me poor indeed. Shak.",
    "FILCHER": "One who filches; a thief.",
    "FILCHINGLY": "By pilfering or petty stealing.",
    "FILE":
        "To put upon the files or among the records of a court; to noteon (a paper) the fact date of its reception in court.To file a paper, on the part of a party, is to place it in theofficial custody of the clerk. To file, on the part of the clerk, isto indorse upon the paper the date of its reception, and retain it inhis office, subject to inspection by whomsoever it may concern.Burrill.",
    "FILE CLOSER":
        "A commissioned or noncommissioned officer posted in the rear ofa line, or on the flank of a column, of soldiers, to rectify mistakesand insure steadiness and promptness in the ranks.",
    "FILEFISH":
        "Any plectognath fish of the genera Monacanthus, Alutera,balistes, and allied genera; -- so called on account of the roughlygranulated skin, which is sometimes used in place of sandpaper.",
    "FILEMOT": "See Feullemort. Swift.",
    "FILER": "One who works with a file.",
    "FILIALLY": "In a filial manner.",
    "FILIATE":
        "To adopt as son or daughter; to establish filiation between.[R.] Southey.",
    "FILIATION":
        "The assignment of a bastard child to some one as its ather;affiliation. Smart.",
    "FILIBEG": "Same as Kilt. [Written also philibeg.]",
    "FILIBUSTER":
        "A lawless military adventurer, especially one in quest ofplunder; a freebooter; -- originally applied to buccaneers infestingthe Spanish American coasts, but introduced into common English todesignate the followers of Lopez in his expedition to Cuba in 1851,and those of Walker in his expedition to Nicaragua, in 1855.",
    "FILIBUSTERISM":
        "The characteristics or practices of a filibuster. Bartlett.",
    "FILICAL": "Belonging to the Filices, r ferns.",
    "FILICIC": "Pertaining to, or derived from, ferns; as, filicic acid.",
    "FILICIDE":
        "The act of murdering a son or a daughter; also, parent whocommits such a murder.",
    "FILICIFORM": "Shaped like a fern or like the parts of a fern leaf. Smart.",
    "FILICOID":
        "Fernlike, either in form or in the nature of the method ofreproduction.",
    "FILIETY":
        "The relation of a son to a father; sonship; -- the correlativeof paternity. J. S. Mill.",
    "FILIFEROUS": "Producing threads. Carpenter.",
    "FILIFORM":
        "Having the shape of a thread or filament; as, the filiformpapillæ of the tongue; a filiform style or peduncle. See Illust. ofAntennÆ.",
    "FILIGRANED": "See Filigreed. [Archaic]",
    "FILIGREE":
        "Ornamental work, formerly with grains or breads, but nowcomposed of fine wire and used chiefly in decorating gold and silverto which the wire is soldered, being arranged in designs frequentlyof a delicate and intricate arabesque pattern.",
    "FILIGREED": "Adorned with filigree. Tatler.",
    "FILING":
        "A fragment or particle rubbed off by the act of filing; as,iron filings.",
    "FILIOQUE":
        "The Latin for, \"and from the Son,\" equivalent to et filio,inserted by the third council of Toledo (a. d. 589) in the clause quiex Patre procedit (who proceedeth from the Father) of the Niceno-Constantinopolitan Creed (a. d. 381), which makes a creed state thatthe Holy Ghost proceeds from the Son as well as from the Father.Hence, the doctrine itself (not admitted by the Eastern Church).",
    "FILIPENDULOUS":
        "Suspended by, or strung upon, a thread; -- said of tuberousswellings in the middle or at the extremities of slender, threadlikerootlets.",
    "FILIPINO":
        "A native of the Philippine Islands, specif. one of Spanishdescent or of mixed blood.",
    "FILL":
        "One of the thills or shafts of a carriage. Mortimer. Fillhorse, a thill horse. Shak.",
    "FILLED CHEESE":
        "An inferior kind of cheese made from skim milk with a fatty\"filling,\" such as oleomargarine or lard, to replace the fat removedin the cream.",
    "FILLER":
        "One who, or that which, fills; something used for filling.'T is mere filer, to stop a vacancy in the hexameter. Dryden.They have six diggers to four fillers, so as to keep the fillersalways at work. Mortimer.",
    "FILLET":
        "A piece of lean meat without bone; sometimes, a long striprolled together and tied.",
    "FILLETING":
        "The protecting of a joint, as between roof and parapet wall,with mortar, or cement, where flashing is employed in better work.",
    "FILLIBEG": "A kilt. See Filibeg.",
    "FILLIBUSTER": "See Filibuster.",
    "FILLING":
        "Prepared wort added to ale to cleanse it. Back filling. (Arch.)See under Back, a.",
    "FILLIPEEN": "See Philopena.",
    "FILLY":
        "A female foal or colt; a young mare. Cf. Colt, Foal.Neighing in likeness of a filly foal. Shak.",
    "FILM":
        "To cover with a thin skin or pellicle.It will but skin and film the ulcerous place. Shak.",
    "FILMINESS": "State of being filmy.",
    "FILMY":
        "Composed of film or films.Whose filmy cord should bind the struggling fly. Dryden.",
    "FILOPLUMACEOUS": "Having the structure of a filoplume.",
    "FILOPLUME":
        "A hairlike feather; a father with a slender scape and without aweb in most or all of its length.",
    "FILOSE": "Terminating in a threadlike process.",
    "FILOSELLE":
        "A kind of silk thread less glossy than floss, and spun fromcoarser material. It is much used in embroidery instead of floss.",
    "FILS":
        "Son; -- sometimes used after a French proper name todistinguish a son from his father, as, Alexandre Dumas, fils.",
    "FILTER":
        "Any porous substance, as cloth, paper, sand, or charcoal,through which water or other liquid may passed to cleanse it from thesolid or impure matter held in suspension; a chamber or devicecontaining such substance; a strainer; also, a similar device forpurifying air. Filter bed, a pond, the bottom of which is a filtercomposed of sand gravel.-- Filter gallery, an underground gallery or tunnel, alongside of astream, to collect the water that filters through the interveningsand and gravel; -- called also infiltration gallery.",
    "FILTHILY": "In a filthy manner; foully.",
    "FILTHY":
        "Defiled with filth, whether material or moral; nasty; dirty;polluted; foul; impure; obscene. \"In the filthy-mantled pool.\" Shak.He which is filthy let him be filthy still. Rev. xxii. 11.",
    "FILTRATE":
        "To filter; to defecate; as liquid, by straining or percolation.Arbuthnot.",
    "FILTRATION":
        "The act or process of filtering; the mechanical separation of aliquid from the undissolved particles floating in it.",
    "FIMBRIA":
        "A fringe, or fringed border.(b) A band of white matter bordering the hippocampus in the brain.-- Fim\"bri*al, a.",
    "FIMBRIATE":
        "Having the edge or extremity bordered by filiform processesthicker than hairs; fringed; as, the fimbriate petals of the pink;the fimbriate end of the Fallopian tube.",
    "FIMBRIATED":
        "Having a very narrow border of another tincture; -- said esp.of an ordinary or subordinary.",
    "FIMBRICATE":
        "fringed, on one side only, by long, straight hairs, as theantennæ of certain insects.",
    "FIN": "To carve or cut up, as a chub.",
    "FIN DE SIECLE":
        "Lit., end of the century; -- mostly used adjectively in Englishto signify: belonging to, or characteristic of, the close of the 19thcentury; modern; \"up-to-date;\" as, fin-de-siècle ideas.",
    "FIN KEEL":
        "A projection downward from the keel of a yacht, resembling inshape the fin of a fish, though often with a cigar-shaped bulb oflead at the bottom, and generally made of metal. Its use is toballast the boat and also to enable her to sail close to the wind andto make the least possible leeway by offering great resistance tolateral motion through the water.",
    "FIN-TOED":
        "Having toes connected by a membrane; palmiped; palmated; also,lobate.",
    "FINABLE":
        "Liable or subject to a fine; as, a finable person or offense.Bacon.",
    "FINALE":
        "Close; termination; as:(a) (Mus.) The last movement of a symphony, sonata, concerto, or anyinstrumental composition.(b) The last composition performed in any act of an opera.(c) The closing part, piece, or scene in any public performance orexhibition.",
    "FINALIST":
        "Any of the players who meet in the final round of a tournamentin which the losers in any round do not play again.",
    "FINANCIAL":
        "Pertaining to finance. \"Our financial and commercial system.\"Macaulay.",
    "FINANCIALIST": "A financier.",
    "FINANCIALLY": "In a dfinancial manner. Burke.",
    "FINANCIER": "To conduct financial operations.",
    "FINARY": "See Finery.",
    "FINATIVE":
        "Conclusive; decisive; definitive; final. [Obs.] Greene (1593).",
    "FINBACK":
        "Any whale of the genera Sibbaldius, Balænoptera, and alliedgenera, of the family Balænopteridæ, characterized by a prominent finon the back. The common finbacks of the New England coast areSibbaldius tectirostris and S. tuberosus.",
    "FINBAT KITE": "= Eddy kite. [Eng.]",
    "FINCH":
        "A small singing bird of many genera and species, belonging tothe family Fringillidæ.",
    "FINCHBACKED": "Streaked or spotted on the back; -- said of cattle.",
    "FINCHED": "Same as Finchbacked.",
    "FIND":
        "To determine an issue of fact, and to declare such adetermination to a court; as, the jury find for the plaintiff.Burrill.",
    "FINDABLE": "Capable of beong found; discoverable. Fuller.",
    "FINDER":
        "One who, or that which, finds; specifically (Astron.), a smalltelescope of low power and large field of view, attached to a largertelescope, for the purpose of finding an object more readily.",
    "FINDFAULT": "A censurer or caviler. [Obs.]",
    "FINDFAULTING":
        "Apt to censure or cavil; faultfinding; captious. [Obs.]Whitlock.",
    "FINDING":
        "The result of a judicial examination or inquiry, especiallyinto some matter of fact; a verdict; as, the finding of a jury.Burrill.After his friends finding and his rent. Chaucer.",
    "FINDY":
        "Full; heavy; firm; solid; substemtial. [Obs.]A cold May and a windy Makes the barn fat amd findy. Old Prover",
    "FINE":
        "To impose a pecuniary penalty upon for an offense or breach oflaw; to set a fine on by judgment of a court; to punish by fine; tomulct; as, the trespassers were fined ten dollars.",
    "FINEDRAW":
        "To sew up, so nicely that the seam is not perceived; to renter.Marryat.",
    "FINEDRAWER": "One who finedraws.",
    "FINEDRAWN":
        "Drawn out with too much subtilty; overnice; as, finedrawnspeculations.",
    "FINEER":
        "To run in dept by getting goods made up in a way unsuitable forthe use of others, and then threatening not to take them except oncredit. [R.] Goldsmith.",
    "FINELESS": "Endless; boundless. [Obs.] Shak.",
    "FINELY": "In a fine or finished manner.",
    "FINER": "One who fines or purifies.",
    "FINERY":
        "A charcoal hearth or furnace for the conversion of cast ironinto wrought iron, or into iron suitable for puddling.",
    "FINESPUN":
        "Spun so as to be fine; drawn to a fine thread; attenuated;hence, unsubstantial; visionary; as, finespun theories.",
    "FINESSE": "The act of finessing. See Finesse, v. i., 2.",
    "FINESTILL":
        "To distill, as spirit from molasses or some saccharinepreparation.",
    "FINESTILLER": "One who finestills.",
    "FINEW": "Moldiness. [R.]",
    "FINFOOT":
        "A South American bird (heliornis fulica) allied to the grebes.The name is also applied to several related species of the genusPodica.",
    "FINGER": "To use the fingers in playing on an instrument. Busby.",
    "FINGERED": "Having leaflets like fingers; digitate.",
    "FINGERER": "One who fingers; a pilferer.",
    "FINGERLING": "A young salmon. See Parr.",
    "FINGLE-FANGLE": "A trifle. [Low] Hudibras.",
    "FINGRIGO":
        "A prickly, climbing shrub of the genus Pisonia. The fruit is akind of berry.",
    "FINIAL":
        "The knot or bunch of foliage, or foliated ornament, that formsthe upper extremity of a pinnacle in Gothic architecture; sometimes,the pinnacle itself.",
    "FINICAL":
        "Affectedly fine; overnice; unduly particular; fastidious.\"Finical taste.\" Wordsworth.The gross style consists in giving no detail, the finical in givingnothing else. Hazlitt.",
    "FINICALITY": "The quality of being finical; finicalness.",
    "FINIFIC":
        "A limiting element or quality. [R.]The essential finific in the form of the finite. Coleridge.",
    "FINIFY":
        "To make fine; to dress finically. [Obs.]Hath so pared and finified them [his feet.] B. Jonson.",
    "FINIKIN": "Precise in trifles; idly busy. [Colloq.] Smart.",
    "FINIS": "An end; conclusion. It is often placed at the end of a book.",
    "FINISH":
        "The joiner work and other finer work required for thecompletion of a building, especially of the interior. See Insidefinish, and Outside finish.",
    "FINISHED":
        "Polished to the highest degree of excellence; complete;perfect; as, a finished poem; a finished education. Finished work(Mach.), work that is made smooth or polished, though not necessarilycompleted.",
    "FINISHING":
        "The act or process of completing or perfecting; the final workupon or ornamentation of a thing.",
    "FINITE":
        "Having a limit; limited in quantity, degree, or capacity;bounded; -- opposed to infinite; as, finite number; finite existence;a finite being; a finite mind; finite duration.",
    "FINITELESS": "Infinite. [Obs.] Sir T. browne.",
    "FINITELY": "In a finite manner or degree.",
    "FINITENESS": "The state of being finite.",
    "FINITUDE": "Limitation. Cheyne.",
    "FINJAN":
        "In the Levant, a small coffee cup without a handle, such as isheld in a cup or stand called a zarf.",
    "FINLANDER": "A native or inhabitant of Finland.",
    "FINLESS": "destitute of fins.",
    "FINLET": "A little fin; one of the parts of a divided fin.",
    "FINLIKE": "Resembling a fin.",
    "FINN": "A native of Finland; one of the FinnFinns.",
    "FINNAN HADDIE":
        "Haddock cured in peat smoke, originally at Findon (pron.fìn\"an), Scotland. the name is also applied to other kinds of smokedhaddock. [Written also finnan haddock.]",
    "FINNED": "Having a fin, or fins, or anything resembling a fin. Mortimer.",
    "FINNER": "A finback whale.",
    "FINNIC": "Of or pertaining to the Finns.",
    "FINNIKIN":
        "A variety of pigeon, with a crest somewhat resembling the maneof a horse. [Written also finikin.]",
    "FINNISH":
        "Of or pertaining to Finland, to the Finns, or to theirlanguage.-- n.",
    "FINNY": "Having, or abounding in, fins, as fishes; pertaining to fishes.",
    "FINOCHIO":
        "An umbelliferous plant (Foeniculum dulce) having a somewhattuberous stem; sweet fennel. The blanched stems are used in Franceand Italy as a culinary vegetable.",
    "FINOS": "Second best wool from Merino sheep. Gardner.",
    "FINPIKE": "The bichir. See Crossopterygii.",
    "FINSEN LIGHT":
        "Highly actinic light, derived from sunlight or from some formof electric lamp, used in the treatment of lupus and other cutaneousaffections.",
    "FINT": "3d pers. sing. pr. of Find, for findeth. [Obs.] Chaucer.",
    "FIORD":
        "A narrow inlet of the sea, penetrating between high banks orrocks, as on the coasts of Norway and Alaska. [Written also fjord.]",
    "FIORIN":
        "A species of creeping bent grass (Agrostis alba); -- calledalso fiorin grass.",
    "FIORITE":
        "A variety of opal occuring in the cavities of volcanic tufa, insmooth and shining globular and botryoidal masses, having a pearlyluster; -- so called from Fiora, in Ischia.",
    "FIORITURE":
        "Little flowers of ornament introduced into a melody by a singeror player.",
    "FIPPENNY BIT":
        "The Spanish half real, or one sixteenth of a dollar, -- socalled in Pennsylvania and the adjacent States. [Obs.]",
    "FIPPLE": "A stopper, as in a wind instrument of music. [Obs.] Bacon.",
    "FIR":
        "A genus (Abies) of coniferous trees, often of large size andelegant shape, some of them valued for their timber and others fortheir resin. The species are distinguished as the balsam fir, thesilver fir, the red fir, etc. The Scoth fir is a Pinus.",
    "FIR TREE": ". See Fir.",
    "FIRE":
        "To cauterize. To fire up, to light up the fires of, as of anengine.",
    "FIRE BEETLE":
        "A very brilliantly luminous beetle (Pyrophorus noctilucus), oneof the elaters, found in Central and South America; -- called alsocucujo. The name is also applied to other species. See Firefly.",
    "FIRE-FANGED":
        "Injured as by fire; burned; -- said of manure which has lostits goodness and acquired an ashy hue in consequence of heatgenerated by decomposition.",
    "FIRE-NEW":
        "Fresh from the forge; bright; quite new; brand-new. Charlesreade.Your fire-new stamp of honor is scarce current. Shak.",
    "FIRE-SET":
        "A set of fire irons, including, commonly, tongs, shovel, andpoker.",
    "FIREARM":
        "A gun, pistol, or any weapon from a shot is discharged by theforce of an explosive substance, as gunpowder.",
    "FIREBACK":
        "One of several species of pheasants of the genus Euplocamus,having the lower back a bright, fiery red. They inhabit Southern Asiaand the East Indies.",
    "FIREBARE": "A beacon. [Obs.] Burrill.",
    "FIREBIRD": "The Baltimore oriole.",
    "FIREBOARD":
        "A chimney board or screen to close a fireplace when not in use.",
    "FIREBOTE": "An allowance of fuel. See Bote.",
    "FIRECRACKER": "See Cracker., n., 3.",
    "FIRECREST":
        "A small European kinglet (Regulus ignicapillus), having abright red crest; -- called also fire-crested wren.",
    "FIREDOG": "A support for wood in a fireplace; an andiron.",
    "FIREFISH":
        "A singular marine fish of the genus Pterois, family Scorpænidæ,of several species, inhabiting the Indo-Pacific region. They areusually red, and have very large spinose pectoral and dorsal fins.",
    "FIREFLAIRE":
        "A European sting ray of the genus Trygon (T. pastinaca); --called also fireflare and fiery flaw.",
    "FIREFLAME": "The European band fish (Cepola rubescens).",
    "FIREFLY":
        "Any luminous winged insect, esp. luminous beetles of the familyLampyridæ.",
    "FIRELESS": "Destitute of fire.",
    "FIRELOCK":
        "An old form of gunlock, as the flintlock, which ignites thepriming by a spark; perhaps originally, a matchlock. Hence, a gunhaving such a lock.",
    "FIREPLACE":
        "The part a chimney appropriated to the fire; a hearth; --usually an open recess in a wall, in which a fire may be built.",
    "FIREPROOF": "Proof against fire; incombustible.",
    "FIREPROOFING":
        "The act or process of rendering anything incombustible; also,the materials used in the process.",
    "FIRER":
        "One who fires or sets fire to anything; an incendiary. [R.] R.Carew.",
    "FIREROOM": "Same as Stokehold, below.",
    "FIRESIDE":
        "A place near the fire or hearth; home; domestic life orretirement.",
    "FIRETAIL": "The European redstart; -- called also fireflirt. [prov. Eng.]",
    "FIREWARDEN":
        "An officer who has authority to direct in the extinguishing offires, or to order what precautions shall be taken against fires; --called also fireward.",
    "FIREWOOD": "Wood for fuel.",
    "FIREWORK":
        "A pyrotechnic exhibition. [Obs. in the sing.]Night before last, the Duke of Richmond gave a firework. Walpole.",
    "FIREWORM":
        "The larva of a small tortricid moth which eats the leaves ofthe cranberry, so that the vines look as if burned; -- called alsocranberry worm.",
    "FIRING PIN":
        "In the breech mechanism of a firearm, the pin which strikes thehead of the cartridge and explodes it.",
    "FIRK":
        "To beat; to strike; to chastise. [Obs.]I'll fer him, and firk him, and ferret him. Shak.",
    "FIRLOT":
        "A dry measure formerly used in Scotland; the fourth part of aboll of grain or meal. The Linlithgow wheat firlot was to theimperial bushel as 998 to 1000; the barley firlot as 1456 to 1000.Brande & C.",
    "FIRM":
        "The name, title, or style, under which a company transactsbusiness; a partnership of two or more persons; a commercial house;as, the firm of Hope & Co.",
    "FIRMAMENT":
        "The orb of the fixed stars; the most rmote of the celestialspheres.",
    "FIRMAMENTAL":
        "Pertaining to the firmament; celestial; being of the upperregions. Dryden.",
    "FIRMAN":
        "In Turkey and some other Oriental countries, a decree ormandate issued by the sovereign; a royal order or grant; -- generallygiven for special objects, as to a traveler to insure him protectionand assistance. [Written also firmaun.]",
    "FIRMER-CHISEL":
        "A chisel, thin in proportion to its width. It has a tang toenter the handle instead of a socket for receiving it. Knight.",
    "FIRMITUDE": "Strength; stability. [Obs.] Bp. Hall.",
    "FIRMITY": "Strength; firmness; stability. [Obs.] Chillingworth.",
    "FIRMLY": "In a firm manner.",
    "FIRMNESS": "The state or quality of being firm.",
    "FIRMS":
        "The principal rafters of a roof, especially a pair of rafterstaken together. [Obs.]",
    "FIRRING": "See Furring.",
    "FIRRY":
        "Made of fir; abounding in firs.In firry woodlands making moan. Tennyson.",
    "FIRST":
        "Before any other person or thing in time, space, rank, etc.; --much used in composition with adjectives and participles.Adam was first formed, then Eve. 1 Tim. ii. 13.At first, At the first, at the beginning or origin.-- First or last, at one time or another; at the beginning or end.And all are fools and lovers first or last. Dryden.",
    "FIRST-CLASS":
        "Of the best class; of the highest rank; in the first division;of the best quality; first-rate; as, a first-class telescope. First-class car or First-class railway carriage, any passenger car of thehighest regular class, and intended for passengers who pay thehighest regular rate; -- distinguished from a second-class car.",
    "FIRST-HAND":
        "Obtained directly from the first or original source; hence,without the intervention of an agent.One sphere there is . . . where the apprehension of him is first-handand direct; and that is the sphere of our own mind. J. Martineau.",
    "FIRST-RATE":
        "Of the highest excellence; preëminent in quality, size, orestimation.Our only first-rate body of contemporary poetry is the German. M.Arnold.Hermocrates . . . a man of first-rate ability. Jowett (Thucyd).",
    "FIRSTBORN":
        "First brought forth; first in the order of nativity; eldest;hence, most excellent; most distinguished or exalted.",
    "FIRSTLING": "Firstborn.All the firstling males. Deut. xv. 19.",
    "FIRSTLY":
        "In the first place; before anything else; -- sometimesimproperly used for first.",
    "FIRTH": "An arm of the sea; a frith.",
    "FISC": "A public or state treasury. Burke.",
    "FISCAL":
        "Pertaining to the public treasury or revenue.The fiscal arreangements of government. A. Hamilton.",
    "FISETIC": "Pertaining to fustet or fisetin.",
    "FISETIN":
        "A yellow crystalline substance extracted from fustet, andregarded as its essential coloring principle; -- called also fiseticacid.",
    "FISH": "A counter, used in various games.",
    "FISH-BELLIED":
        "Bellying or swelling out on the under side; as, a fish-belliedrail. Knight.",
    "FISH-BLOCK": "See Fish-tackle.",
    "FISH-TACKLE":
        "A tackle or purchase used to raise the flukes of the anchor upto the gunwale. The block used is called the fish-block.",
    "FISH-TAIL":
        "Like the of a fish; acting, or producing something, like thetail of a fish. Fish-tail burner, a gas burner that gives a spreadingflame shaped somewhat like the tail of a fish.-- Fish-tail propeller (Steamship), a propeller with a single bladethat oscillates like the tail of a fish when swimming.",
    "FISHER":
        "A carnivorous animal of the Weasel family (Mustela Canadensis);the pekan; the \"black cat.\"",
    "FISHERMAN":
        "A ship or vessel employed in the business of taking fish, as inthe cod fishery.",
    "FISHERY":
        "The right to take fish at a certain place, or in particularwaters. Abbott.",
    "FISHFUL": "Abounding with fish. [R.] \"My fishful pond.\" R. Carew.",
    "FISHGIG": "A spear with barbed prongs used for harpooning fish. Knight.",
    "FISHHAWK":
        "The osprey (Pandion haliaëtus), found both in Europe andAmerica; -- so called because it plunges into the water and seizesfishes in its talons. Called also fishing eagle, and bald buzzard.",
    "FISHHOOK":
        "A hook with a pendant, to the end of which the fish-tackle ishooked. Dana.",
    "FISHIFY": "To change to fish. [R.] Shak.",
    "FISHINESS": "The state or quality of being fishy or fishlike. Pennant.",
    "FISHING":
        "Pertaining to fishing; used in fishery; engaged in fishing; as,fishing boat; fishing tackle; fishing village. Fishing fly, anartificial fly for fishing.-- Fishing line, a line used in catching fish.-- Fishing net, a net of various kinds for catching fish; includingthe bag net, casting net, drag net, landing net, seine, shrimpingnet, trawl, etc.-- Fishing rod, a long slender rod, to which is attached the linefor angling.-- Fishing smack, a sloop or other small vessel used in sea fishing.-- Fishing tackle, apparatus used in fishing, as hook, line, rod,etc.-- Fishing tube (Micros.), a glass tube for selecting a microscopicobject in a fluid.",
    "FISHLIKE":
        "Like fish; suggestive of fish; having some of the qualities offish.A very ancient and fishlike smell. Shak.",
    "FISHMONGER": "A dealer in fish.",
    "FISHSKIN": "See Ichthyosis.",
    "FISHWIFE": "A fishwoman.",
    "FISHWOMAN": "A woman who retails fish.",
    "FISK":
        "To run about; to frisk; to whisk. [Obs.]He fisks abroad, and stirreth up erroneous opinions. Latimer.",
    "FISSIGEMMATION":
        "A process of reproduction intermediate between fission andgemmation.",
    "FISSILE":
        "Capable of being split, cleft, or divided in the direction ofthe grain, like wood, or along natural planes of cleavage, likecrystals.This crystal is a pellucid, fissile stone. Sir I. Newton.",
    "FISSILINGUAL": "Having the tongue forked.",
    "FISSILINGUIA":
        "A group of Lacertilia having the tongue forked, including thecommon lizards. [Written also Fissilingues.]",
    "FISSILITY": "Quality of being fissile.",
    "FISSION":
        "A method of asexual reproduction among the lowest (unicellular)organisms by means of a process of self-division, consisting ofgradual division or cleavage of the into two parts, each of whichthen becomes a separate and independent organisms; as when a cell inan animal or plant, or its germ, undergoes a spontaneous division,and the parts again subdivide. See Segmentation, and Cell division,under Division.",
    "FISSIPALMATE":
        "Semipalmate and loboped, as a grebe's foot. See Illust. underAves.",
    "FISSIPARA": "Animals which reproduce by fission.",
    "FISSIPARISM": "Reproduction by spontaneous fission.",
    "FISSIPARITY": "Quality of being fissiparous; fissiparism.",
    "FISSIPAROUS":
        "Reproducing by spontaneous fission. See Fission.-- Fis*sip\"a*rous*ly, adv.",
    "FISSIPATION": "Reproduction by fission; fissiparism.",
    "FISSIPED": "One of the Fissipedia.",
    "FISSIPEDIA":
        "A division of the Carnivora, including the dogs, cats, andbears, in which the feet are not webbed; -- opposed to Pinnipedia.",
    "FISSIROSTRAL":
        "Having the bill cleft beyond the horny part, as in the case ofswallows and goatsuckers.",
    "FISSIROSTRES": "A group of birds having the bill deeply cleft.",
    "FISSURAL":
        "Pertaining to a fissure or fissures; as, the fissural patternof a brain.",
    "FISSURATION":
        "The act of dividing or opening; the state of being fissured.",
    "FISSURE":
        "A narrow opening, made by the parting of any substance; acleft; as, the fissure of a rock. Cerebral fissures (Anat.), thefurrows or clefts by which the surface of the cerebrum is divided;esp., the furrows first formed by the infolding of the whole wall ofthe cerebrum.-- Fissure needle (Surg.), a spiral needle for catching together thegaping lips of wounds. Knight.-- Fissure of rolando (Anat.), the furrow separating the frontalfrom the parietal lobe in the cerebrum.-- Fissure of Sylvius (Anat.), a deep cerebral fissure separatingthe frontal from the temporal lobe. See Illust. under Brain.-- Fissure vein (Mining), a crack in the earth's surface filled withmineral matter. Raymond.",
    "FISSURELLA":
        "A genus of marine gastropod mollusks, having a conical orlimpetlike shell, with an opening at the apex; -- called also keyholelimpet.",
    "FIST":
        "the index mark [], used to direct special attention to thepassage which follows. Hand over fist (Naut.), rapidly; hand overhand.",
    "FISTIC":
        "Pertaining to boxing, or to encounters with the fists;puglistic; as, fistic exploits; fistic heroes. [Colloq.]",
    "FISTICUFF": "A cuff or blow with the fist or hand; (pl.)",
    "FISTINUT": "A pistachio nut. [Obs.] Johnson.",
    "FISTUCA": "An instrument used by the ancients in driving piles.",
    "FISTULA":
        "A permanent abnormal opening into the soft parts with aconstant discharge; a deep, narrow, chronic abscess; an abnormalopening between an internal cavity and another cavity or the surface;as, a salivary fistula; an anal fistula; a recto-vaginal fistula.Incomplete fistula (Med.), a fistula open at one end only.",
    "FISTULAR": "Hollow and cylindrical, like a pipe or reed. Johnson.",
    "FISTULARIA":
        "A genus of fishes, having the head prolonged into a tube, withthe mouth at the extremity.",
    "FISTULARIOID": "Like or pertaining to the genus Fistularia.",
    "FISTULATE":
        "To make hollow or become hollow like a fistula, or pipe. [Obs.]\"A fistulated ulcer.\" Fuller.",
    "FISTULE": "A fistula.",
    "FISTULIFORM":
        "Of a fistular form; tubular; pipe-shaped.Stalactite often occurs fistuliform. W. Philips.",
    "FISTULOSE": "Formed like a fistula; hollow; reedlike. Craig.",
    "FIT": "imp. & p. p. of Fight. [Obs. or Colloq.]",
    "FITCH": "A vetch. [Obs.]",
    "FITCHE":
        "Sharpened to a point; pointed. Cross fitché, a cross having thelower arm pointed.",
    "FITCHED": "Fitché. [Also fiched.]",
    "FITCHY": "Having fitches or vetches.",
    "FITFUL":
        "Full of fits; irregularly variable; impulsive and unstable.After life's fitful fever, he sleeps well. Shak.-- Fit\"ful*ly, adv.-- Fit\"ful*ness, n.The victorius trumpet peal Dies fitfully away. Macaulay.",
    "FITLY":
        "In a fit manner; suitably; properly; conveniently; as, a maximfitly applied.",
    "FITMENT":
        "The act of fitting; that which is proper or becoming;equipment. [Obs.] Shak.",
    "FITNESS":
        "The state or quality of being fit; as, the fitness of measuresor laws; a person's fitness for office.",
    "FITT": "See 2d Fit.",
    "FITTABLE": "Suitable; fit. [Obs.] Sherwood.",
    "FITTEDNESS":
        "The state or quality of being fitted; adaptation. [Obs.] Dr. H.More.",
    "FITTER":
        "A little piece; a flitter; a flinder. [Obs.]Where's the Frenchman Alas, he's all fitters. Beau. & Fl.",
    "FITTING": "Anything used in fitting up; especially (pl.),",
    "FITWEED": "A plant (Eryngium foetidum) supposed to be a remedy for fits.",
    "FITZ":
        "A son; -- used in compound names, to indicate paternity, esp.of the illegitimate sons of kings and princes of the blood; as,Fitzroy, the son of the king; Fitzclarence, the son of the duke ofClarence.",
    "FIVE": "Four and one added; one more than four.",
    "FIVE-FINGER": "See Cinquefoil.",
    "FIVE-LEAF": "Cinquefoil; five-finger.",
    "FIVE-TWENTIES":
        "Five-twenty bonds of the United States (bearing six per centinterest), issued in 1862, '64, and '65, redeemable after five andpayable in twenty years.",
    "FIVEFOLD":
        "In fives; consisting of five in one; five repeated; quintuple.",
    "FIVELING": "A compound or twin crystal consisting of five individuals.",
    "FIVES":
        "A kind of play with a ball against a wall, resembling tennis; -- so named because three fives, or fifteen, are counted to the game.Smart. Fives court, a place for playing fives.",
    "FIX": "Fixed; solidified. [Obs.] Chaucer.",
    "FIXABLE": "Capable of being fixed.",
    "FIXATIVE":
        "That which serves to set or fix colors or drawings, as amordant.",
    "FIXED":
        "Stable; non-volatile. Fixed air (Old Chem.), carbonic acid orcarbon dioxide; -- so called by Dr. Black because it can be absorbedor fixed by strong bases. See Carbonic acid, under Carbonic.-- Fixed alkali (Old Chem.), a non-volatile base, as soda, orpotash, in distinction from the volatile alkali ammonia.-- Fixed ammunition (Mil.), a projectile and powder inclosedtogether in a case ready for loading.-- Fixed battery (Mil.), a battery which contains heavy guns andmortars intended to remain stationary; -- distinguished from movablebattery.-- Fixed bodies, those which can not be volatilized or separated bya common menstruum, without great difficulty, as gold, platinum,lime, etc.-- Fixed capital. See the Note under Capital, n., 4.-- Fixed fact, a well established fact. [Colloq.] -- Fixed light,one which emits constant beams; -- distinguished from a flashing,revolving, or intermittent light.-- Fixed oils (Chem.), non-volatile, oily substances, as stearineand olein, which leave a permanent greasy stain, and which can not bedistilled unchanged; -- distinguished from volatile or essentialoils.-- Fixed pivot (Mil.), the fixed point about which any line oftroops wheels.-- Fixed stars (Astron.), such stars as always retain nearly thesame apparent position and distance with respect to each other, thusdistinguished from planets and comets.",
    "FIXEDLY": "In a fixed, stable, or constant manner.",
    "FIXIDITY": "Fixedness. [Obs.] Boyle.",
    "FIXING":
        "Arrangements; embellishments; trimmings; accompaniments.[Colloq. U.S.]",
    "FIXTURE":
        "Anything of an accessory character annexed to houses and lands,so as to constitute a part of them. This term is, however, quitefrequently used in the peculiar sense of personal chattels annexed tolands and tenements, but removable by the person annexing them, orhis personal representatives. In this latter sense, the same thingsmay be fixtures under some circumstances, and not fixtures underothers. Wharton (Law Dict. ). Bouvier.",
    "FIXURE": "Fixed position; stable condition; firmness. [Obs.] Shak.",
    "FIZGIG": "A fishing spear. [Obs.] Sandys.",
    "FIZZ": "To make a hissing sound, as a burning fuse.",
    "FIZZLE": "A failure or abortive effort. [Colloq.]",
    "FJORD": "See Fiord.",
    "FLABBERGAST":
        "To astonish; to strike with wonder, esp. by extraordinarystatements. [Jocular] Beaconsfield.",
    "FLABBERGASTATION":
        "The state of being flabbergasted. [Jocular] London Punch.",
    "FLABBILY": "In a flabby manner.",
    "FLABBINESS": "Quality or state of being flabby.",
    "FLABBY":
        "Yielding to the touch, and easily moved or shaken; hangingloose by its own weight; wanting firmness; flaccid; as, flabby flesh.",
    "FLABEL": "A fan. [Obs.] Huloet.",
    "FLABELLATE": "Flabelliform.",
    "FLABELLATION":
        "The act of keeping fractured limbs cool by the use of a fan orsome other contrivance. Dunglison.",
    "FLABELLIFORM": "Having the form of a fan; fan-shaped; flabellate.",
    "FLABELLINERVED":
        "Having many nerves diverging radiately from the base; -- saidof a leaf.",
    "FLABELLUM":
        "A fan; especially, the fan carried before the pope on stateoccasions, made in ostrich and peacock feathers. Shipley.",
    "FLABILE": "Liable to be blown about. Bailey.",
    "FLACCID":
        "Yielding to pressure for want of firmness and stiffness; softand weak; limber; lax; drooping; flabby; as, a flaccid muscle;flaccid flesh.Religious profession . . . has become flacced. I. Taylor.-- Flac\"cid*ly, adv.-- Flac\"cid*ness, n.",
    "FLACCIDITY": "The state of being flaccid.",
    "FLACHERIE":
        "A bacterial disease of silkworms, supposed to be due to eatingcontaminated mulberry leaves.",
    "FLACKER": "To flutter, as a bird. [Prov. Eng.] Grose.",
    "FLACKET": "A barrel-shaped bottle; a flagon.",
    "FLACON":
        "A small glass bottle; as, a flacon for perfume. \"Two glassflacons for the ink.\" Longfellow.",
    "FLAG":
        "An aquatic plant, with long, ensiform leaves, belonging toeither of the genera Iris and Acorus. Cooper's flag, the cat-tail(Typha latifolia), the long leaves of which are placed between thestaves of barrels to make the latter water-tight.-- Corn flag. See under 2d Corn.-- Flag broom, a coarse of broom, originally made of flags orrushes.-- Flag root, the root of the sweet flag.-- Sweet flag. See Calamus, n., 2.",
    "FLAGELLANT":
        "One of a fanatical sect which flourished in Europe in the 13thand 14th centuries, and maintained that flagellation was of equalvirtue with baptism and the sacrament; -- called also disciplinant.",
    "FLAGELLATA":
        "An order of Infusoria, having one or two long, whiplike cilia,at the anterior end. It includes monads. See Infusoria, and Monad.",
    "FLAGELLATE": "To whip; to scourge; to flog.",
    "FLAGELLATION": "A beating or flogging; a whipping; a scourging. Garth.",
    "FLAGELLATOR": "One who practices flagellation; one who whips or scourges.",
    "FLAGELLIFORM":
        "Shaped like a whiplash; long, slender, round, flexible, and(comming) tapering.",
    "FLAGELLUM":
        "A young, flexible shoot of a plant; esp., the long trailingbranch of a vine, or a slender branch in certain mosses.",
    "FLAGEOLET":
        "A small wooden pipe, having six or more holes, and a mouthpieceinserted at one end. It produces a shrill sound, softer than of thepiccolo flute, and is said to have superseded the old recorder.Flageolet tones (Mus.), the naturel harmonics or overtones ofstringed instruments.",
    "FLAGGINESS": "The condition of being flaggy; laxity; limberness. Johnson.",
    "FLAGGING":
        "A pavement or sidewalk of flagstones; flagstones, collectively.",
    "FLAGGY": "Abounding with the plant called flag; as, a flaggy marsh.",
    "FLAGITATE":
        "To importune; to demand fiercely or with passion. [Archaic]Carcyle.",
    "FLAGITATION": "Importunity; urgent demand. [Archaic] Carlyle.",
    "FLAGMAN": "One who makes signals with a flag.",
    "FLAGON":
        "A vessel with a narrow mouth, used for holding and conveyingliquors. It is generally larger than a bottle, and of leather orstoneware rather than of glass.A trencher of mutton chops, and a flagon of ale. Macaulay.",
    "FLAGRANCE": "Flagrancy. Bp. Hall.",
    "FLAGRANTLY": "In a flagrant manner.",
    "FLAGRATE": "To burn. [Obs.] Greenhill.",
    "FLAGRATION": "A conflagration. [Obs.]",
    "FLAGSHIP":
        "The vessel which carries the commanding officer of a fleet orsquadron and flies his distinctive flag or pennant.",
    "FLAGSTAFF": "A staff on which a flag is hoisted.",
    "FLAGSTONE":
        "A flat stone used in paving, or any rock which will split intosuch stones. See Flag, a stone.",
    "FLAGWORM": "A worm or grub found among flags and sedge.",
    "FLAILY": "Acting like a flail. [Obs.] Vicars.",
    "FLAIN": "p. p. of Flay. Chaucer.",
    "FLAKE":
        "A small stage hung over a vessel's side, for workmen to standon in calking, etc.",
    "FLAKINESS": "The state of being flaky.",
    "FLAKY":
        "Consisting of flakes or of small, loose masses; lying, orcleaving off, in flakes or layers; flakelike.What showers of mortal hail, what flaky fires! Watts.A flaky weight of winter's purest snows. Wordsworth.",
    "FLAM":
        "A freak or whim; also, a falsehood; a lie; an illusory pretext;deception; delusion. [Obs.]A perpetual abuse and flam upon posterity. South.",
    "FLAMBE":
        "Decorated by glaze splashed or irregularly spread upon thesurface, or apparently applied at the top and allowed to run down thesides; -- said of pieces of Chinese porcelain.",
    "FLAMBEAU":
        "A flaming torch, esp. one made by combining together a numberof thick wicks invested with a quick-burning substance (anciently,perhaps, wax; in modern times, pitch or the like); hence, any torch.",
    "FLAMBOYANT":
        "Characterized by waving or flamelike curves, as in the traceryof windows, etc.; -- said of the later (15th century) French Gothicstyle.",
    "FLAMBOYER":
        "A name given in the East and West Indies to certain trees withbrilliant blossoms, probably species of Cæsalpinia.",
    "FLAME":
        "To kindle; to inflame; to excite.And flamed with zeal of vengeance inwardly. Spenser.",
    "FLAME-COLORED":
        "Of the color of flame; of a bright orange yellow color. Shak.",
    "FLAMELESS": "Destitute of flame. Sandys.",
    "FLAMELET":
        "A small flame.The flamelets gleamed and flickered. Longfellow.",
    "FLAMEN":
        "A priest devoted to the service of a particular god, from whomhe received a distinguishing epithet. The most honored were those ofJupiter, Mars, and Quirinus, called respectively Flamen Dialis,Flamen Martialis, and Flamen Quirinalis.Affrights the flamens at their service quaint. Milton.",
    "FLAMINEOUS": "Pertaining to a flamen; flaminical.",
    "FLAMINGLY": "In a flaming manner.",
    "FLAMINGO":
        "Any bird of the genus Phoenicopterus. The flamingoes havewebbed feet, very long legs, and a beak bent down as if broken. Theircolor is usually red or pink. The American flamingo is P. ruber; theEuropean is P. antiquorum.",
    "FLAMINICAL": "Pertaining to a flamen. Milton.",
    "FLAMMABILITY":
        "The quality of being flammable; inflammability. [Obs.] Sir T.Browne.",
    "FLAMMABLE": "Inflammable. [Obs.]",
    "FLAMMATION":
        "The act of setting in a flame or blaze. [Obs.] Sir. T. Browne.",
    "FLAMMEOUS":
        "Pertaining to, consisting of, or resembling, flame. [Obs.] SirT. Browne.",
    "FLAMMIFEROUS": "Producing flame.",
    "FLAMMIVOMOUS": "Vomiting flames, as a volcano. W. Thompson. (1745).",
    "FLAMMULATED": "Of a reddish color.",
    "FLAMY":
        "Flaming; blazing; flamelike; flame-colored; composed of flame.Pope.",
    "FLANCH":
        "A bearing consisting of a segment of a circle encroaching onthe field from the side.",
    "FLANCHED":
        "Having flanches; -- said of an escutcheon with those bearings.",
    "FLANCONADE": "A thrust in the side.",
    "FLANERIE":
        "Lit., strolling; sauntering; hence, aimless; idleness; as,intellectual flânerie.",
    "FLANEUR": "One who strolls about aimlessly; a lounger; a loafer.",
    "FLANG": "A miner's two-pointed pick.",
    "FLANGE": "To make a flange on; to furnish with a flange.",
    "FLANGED": "Having a flange or flanges; as, a flanged wheel.",
    "FLANK":
        "That part of a bastion which reaches from the curtain to theface, and defends the curtain, the flank and face of the oppositebastion; any part of a work defending another by a fire along theoutside of its parapet. See Illust. of Bastion.",
    "FLANKER":
        "One who, or that which, flanks, as a skirmisher or a body oftroops sent out upon the flanks of an army toguard a line of march,or a fort projecting so as to command the side of an assailing body.They threw out flankers, and endeavored to dislodge their assailants.W. Irwing.",
    "FLANNEL":
        "A soft, nappy, woolen cloth, of loose texture. Shak. Adam'sflannel. (Bot.) See under Adam.-- Canton flannel, Cotton flannel. See Cotton flannel, under Cotton.",
    "FLANNELED": "Covered or wrapped in flannel.",
    "FLANNEN":
        "Made or consisting of flannel. [Obs.] \"Flannen robes.\" Dryden.",
    "FLAP":
        "Anything broad and limber that hangs loose, or that is attachedby one side or end and is easily moved; as, the flap of a garment.A cartilaginous flap upon the opening of the larynx. Sir T. Browne.",
    "FLAP-EARED": "Having broad, loose, dependent ears. Shak.",
    "FLAP-MOUTHED": "Having broad, hangling lips. [R.] Shak.",
    "FLAPDRAGON":
        "To swallow whole, as a flapdragon; to devour. [Obs.]See how the sea flapdragoned it. Shak.",
    "FLARE": "Leaf of lard. \"Pig's flare.\" Dunglison.",
    "FLARE-UP":
        "A sudden burst of anger or passion; an angry dispute. [Colloq.]",
    "FLARINGLY": "In a flaring manner.",
    "FLASH":
        "To cover with a thin layer, as objects of glass with glass of adifferent color. See Flashing, n., 3 (b).",
    "FLASH BOILER":
        "A variety of water-tube boiler, used chiefly in steamautomobiles, consisting of a nest of strong tubes with very littlewater space, kept nearly red hot so that the water as it tricklesdrop by drop into the tubes is immediately flashed into steam andsuperheated.",
    "FLASH BURNER":
        "A gas burner with a device for lighting by an electric spark.",
    "FLASHBOARD":
        "A board placed temporarily upon a milldam, to raise the waterin the pond above its usual level; a flushboard. [U.S.]",
    "FLASHILY": "In a flashy manner; with empty show.",
    "FLASHINESS": "The quality of being flashy.",
    "FLASHING":
        "The creation of an artifical flood by the sudden letting in ofa body of water; -- called also flushing.",
    "FLASK":
        "The wooden or iron frame which holds the sand, etc., formingthe mold used in a foundry; it consists of two or more parts; viz.,the cope or top; sometimes, the cheeks, or middle part; and the drag,or bottom part. When there are one or more cheeks, the flask iscalled a three part flask, four part flask, etc. Erlenmeyer flask, athin glass flask, flat-bottomed and cone-shaped to allow of safelyshaking its contents laterally without danger of spilling; -- socalled from Erlenmeyer, a German chemist who invented it.-- Florence flask. Etym: [From Florence in Italy.] (a) Same asBetty, n., 3. (b) A glass flask, round or pear-shaped, with round orflat bottom, and usually very thin to allow of heating solutions.-- Pocket flask, a kind of pocket dram bottle, often covered withmetal or leather to protect it from breaking.",
    "FLAT":
        "Wanting relief; destitute of variety; without points ofprominence and striking interest.A large part of the work is, to me, very flat. Coleridge.",
    "FLAT FOOT":
        "A foot in which the arch of the instep is flattened so that theentire sole of the foot rests upon the ground; also, the deformity,usually congential, exhibited by such a foot; splayfoot.",
    "FLAT-BOTTOMED":
        "Having an even lower surface or bottom; as, a flat-bottomedboat.",
    "FLAT-CAP":
        "A kind of low-crowned cap formerly worn by all classes inEngland, and continued in London after disuse elsewhere; -- hence, acitizen of London. Marston.",
    "FLAT-HEADED":
        "Having a head with a flattened top; as, a flat-headed nail.",
    "FLATBILL":
        "Any bird of the genus Flatyrynchus. They belong to the familyof flycatchers.",
    "FLATBOAT":
        "A boat with a flat bottom and square ends; -- used for thetransportation of bulky freight, especially in shallow waters.",
    "FLATFISH":
        "Any fish of the family Pleuronectidæ; esp., the winter flounder(Pleuronectes Americanus). The flatfishes have the body flattened,swim on the side, and have eyes on one side, as the flounder, turbot,and halibut. See Flounder.",
    "FLATHEAD":
        "Characterized by flatness of head, especially that produced byartificial means, as a certain tribe of American Indians.",
    "FLATIRON": "An iron with a flat, smooth surface for ironing clothes.",
    "FLATIVE": "Producing wind; flatulent. [Obs.] A. Brewer.",
    "FLATLING":
        "With the flat side, as of a sword; flatlong; in a prostrateposition. [Obs.] Spenser.",
    "FLATLONG": "; 115), adv. With the flat side downward; not edgewise. Shak.",
    "FLATLY":
        "In a flat manner; evenly; horizontally; without spirit; dully;frigidly; peremptori;y; positively, plainly. \"He flatly refused hisaid.\" Sir P. Sidney.He that does the works of religion slowly, flatly, and withoutappetite. Jer. Taylor.",
    "FLATOUR": "A flatterer. [Obs.] Chaucer.",
    "FLATTEN":
        "To lower the pitch of; to cause to sound less sharp; to letfall from the pitch. To flatten a sail (Naut.), to set it more nearlyfore-and-aft of the vessel.-- Flattening oven, in glass making, a heated chamber in which splitglass cylinders are flattened for window glass.",
    "FLATTER":
        "To use flattery or insincere praise.If it may stand him more in stead to lie, Say and unsay, feign,flatter, or adjure. Milton.",
    "FLATTERER":
        "One who flatters.The most abject flaterers degenerate into the greatest tyrants.Addison.",
    "FLATTERING":
        "That flatters (in the various senses of the verb); as, aflattering speech.Lay not that flattering unction to your soul. Shak.A flattering painter, who made it his care, To draw men as they oughtbe, not as they are. Goldsmith.",
    "FLATTERINGLY": "With flattery.",
    "FLATTERY":
        "The act or practice of flattering; the act of pleasing byartiful commendation or compliments; adulation; false, insincere, orexcessive praise.Just praise is only a debt, but flattery is a present. Rambler.Flattery corrupts both the receiver and the giver. Burke.",
    "FLATTISH": "Somewhat flat. Woodward.",
    "FLATULENTLY": "In a flatulent manner; with flatulence.",
    "FLATUOSITY": "Flatulence. [Obs.] Bacon.",
    "FLATUOUS": "Windy; generating wind. [Obs.] Bacon.",
    "FLATWARE":
        "Articles for the table, as china or silverware, that are moreor less flat, as distinguished from hollow ware.",
    "FLATWISE":
        "With the flat side downward, or next to another object; notedgewise.",
    "FLATWORM":
        "Any worm belonging to the Plathelminthes; also, sometimesapplied to the planarians.",
    "FLAUNDRISH": "Flemish. [Obs.]",
    "FLAUNT":
        "To throw or spread out; to flutter; to move ostentatiously; as,a flaunting show.You flaunt about the streets in your new gilt chariot. Arbuthnot.One flaunts in rags, one flutters in brocade. Pope.",
    "FLAUNTINGLY": "In a flaunting way.",
    "FLAUTIST": "A player on the flute; a flutist.",
    "FLAUTO":
        "A flute. Flaute piccolo ( Etym: [It., little flute], an octaveflute.-- Flauto traverso ( Etym: [It., transverse flute], the Germanflute, held laterally, instead of being played, like the old flûte abec, with a mouth piece at the end.",
    "FLAVANILINE":
        "A yellow, crystalline, organic dyestuff, C16H14N2, of artificalproduction. It is a strong base, and is a complex derivative ofaniline and quinoline.",
    "FLAVESCENT": "Turning yellow; yellowish.",
    "FLAVICOMOUS": "Having yellow hair. [R.]",
    "FLAVIN": "A yellow, vegetable dyestuff, resembling quercitron.",
    "FLAVINE":
        "A yellow, crystalline, organic base, C13H12N2O, obtainedartificially.",
    "FLAVOL":
        "A yellow, crystalline substance, obtained from anthraquinone,and regarded as a hydroxyl derivative of it.",
    "FLAVOR":
        "To give flavor to; to add something (as salt or a spice) to, togive character or zest.",
    "FLAVORED": "Having a distinct flavor; as, high-flavored wine.",
    "FLAVORLESS": "Without flavor; tasteless.",
    "FLAVOROUS":
        "Imparting flavor; pleasant to the taste or smell; sapid.Dryden.",
    "FLAVOUS": "Yellow. [Obs.]",
    "FLAWLESS": "Free from flaws. Boyle.",
    "FLAWN": "A sort of flat custard or pie. [Obs.] Tusser.",
    "FLAWTER": "To scrape o [Obs.] Johnson.",
    "FLAX":
        "A plant of the genus Linum, esp. the L. usitatissimum, whichhas a single, slender stalk, about a foot and a half high, with blueflowers. The fiber of the bark is used for making thread and cloth,called linen, cambric, lawn, lace, etc. Linseed oil is expressed fromthe seed.",
    "FLAX-PLANT":
        "A plant in new Zealand (Phormium tenax), allied to the liliesand aloes. The leaves are two inches wide and several feet long, andfurnish a fiber which is used for making ropes, mats, and coarsecloth.",
    "FLAXEN":
        "Made of flax; resembling flax or its fibers; of the color offlax; of a light soft straw color; fair and flowing, like flax ortow; as, flaxen thread; flaxen hair.",
    "FLAXSEED": "The seed of the flax; linseed.",
    "FLAXWEED": "See Toadflax.",
    "FLAXY": "Like flax; flaxen. Sir M. Sandys.",
    "FLAY":
        "To skin; to strip off the skin or surface of; as, to flay anox; to flay the green earth.With her nails She 'll flay thy wolfish visage. Shak.",
    "FLAYER": "One who strips off the skin.",
    "FLEA":
        "To flay. [Obs.]He will be fleaced first And horse collars made of's skin. J.Fletcher.",
    "FLEA-BEETLE":
        "A small beetle of the family Halticidæ, of many species. Theyhave strong posterior legs and leap like fleas. The turnip flea-beetle (Phyllotreta vittata) and that of the grapevine (Graptoderachalybea) are common injurious species.",
    "FLEA-LOUSE":
        "A jumping plant louse of the family Psyllidæ, of many species.That of the pear tree is Psylla pyri.",
    "FLEABANE":
        "One of various plants, supposed to have efficacy in drivingaway fleas. They belong, for the most part, to the genera Conyza,Erigeron, and Pulicaria.",
    "FLEAGH": "imp. of Fly.",
    "FLEAK":
        "A flake; a thread or twist. [Obs.]Little long fleaks or threads of hemp. Dr. H. More.",
    "FLEAKING":
        "A light covering of reeds, over which the main covering islaid, in thatching houses. [Prov. Eng.] Wright.",
    "FLEAM":
        "A sharp instrument used for opening veins, lancing gums, etc.;a kind of lancet. Fleam tooth, a tooth of a saw shaped like anisosceles triangle; a peg tooth. Knight.",
    "FLEAMY":
        "Bloody; clotted. [Obs. or Prov.]Foamy bubbling of a fleamy brain. Marston.",
    "FLEAR": "See Fleer.",
    "FLEAWORT":
        "An herb used in medicine (Plantago Psyllium), named from theshape of its seeds. Loudon.",
    "FLECHE":
        "A simple fieldwork, consisting of two faces forming a salientangle pointing outward and open at the gorge.",
    "FLECK": "A flake; also, a lock, as of wool. [Obs.] J. Martin.",
    "FLECKER": "To fleck. Johnson.",
    "FLECKLESS":
        "Without spot or blame. [R.]My consnience will not count me fleckless. Tennyson.",
    "FLECTIONAL":
        "Capable of, or pertaining to, flection or inflection.A flectional word is a phrase in the bud. Earle.",
    "FLECTOR": "A flexor.",
    "FLED": "imp. & p. p. of Flee.",
    "FLEDGE":
        "Feathered; furnished with feathers or wings; able to fly.Hfledge with wings. Milton.",
    "FLEDGELING": "A young bird just fledged.",
    "FLEE":
        "To run away, as from danger or evil; to avoid in an alarmed orcowardly manner; to hasten off; -- usually with from. This issometimes omitted, making the verb transitive.[He] cowardly fled, not having struck one stroke. Shak.Flee fornication. 1 Cor. vi. 18.So fled his enemies my warlike father. Shak.",
    "FLEECE":
        "The fine web of cotton or wool removed by the doffing knifefrom the cylinder of a carding machine. Fleece wool, wool shorn fromthe sheep.-- Golden fleece. See under Golden.",
    "FLEECELESS": "Without a fleece.",
    "FLEECER":
        "One who fleeces or strips unjustly, especially by trickery orfraund. Prynne.",
    "FLEECY":
        "Covered with, made of, or resembling, a fleece. \"Fleecyflocks.\" Prior.",
    "FLEEN": "Obs. pl. of Flea. Chaucer.",
    "FLEER": "One who flees. Ld. Berners.",
    "FLEERER": "One who fleers. Beau. & Fl.",
    "FLEERINGLY": "In a fleering manner.",
    "FLEET":
        "To slip on the whelps or the barrel of a capstan or windlass; -- said of a cable or hawser.",
    "FLEET-FOOT": "Swift of foot. Shak.",
    "FLEETEN":
        "Fleeted or skimmed milk. [Obs.] Fleeten face, a face of thecolor of fleeten, i. e., blanched; hence, a coward. \"You know whereyou are, you fleeten face.\" Beau. & Fl.",
    "FLEETING":
        "Passing swiftly away; not durable; transient; transitory; as,the fleeting hours or moments.",
    "FLEETINGLY": "In a fleeting manner; swiftly.",
    "FLEETINGS":
        "A mixture of buttermilk and boiling whey; curds. [prov. Eng.]Wright.",
    "FLEETLY": "In a fleet manner; rapidly.",
    "FLEETNESS":
        "Swiftness; rapidity; velocity; celerity; speed; as, thefleetness of a horse or of time.",
    "FLEIGH": "imp. of Fly. Chaucer.",
    "FLEME":
        "To banish; to drive out; to expel. [Obs.] \"Appetite flemethdiscretion.\" Chaucer.",
    "FLEMER": "One who, or that which, banishes or expels. [Obs.] Chaucer.",
    "FLEMING": "A native or inhabitant of Flanders.",
    "FLEMISH": "Pertaining to Flanders, or the Flemings.-- n.",
    "FLENCH": "Same as Flence.",
    "FLENSE":
        "To strip the blubber or skin from, as from a whale, seal, etc.the flensed carcass of a fur seal. U. S. Census (1880).",
    "FLESH": "To remove flesh, membrance, etc., from, as from hides.",
    "FLESHHOOD":
        "The state or condition of having a form of flesh; incarnation.[R.]Thou, who hast thyself Endured this fleshhood. Mrs. Browning.",
    "FLESHINESS":
        "The state of being fleshy; plumpness; corpulence; grossness.Milton.",
    "FLESHINGS": "Flesh-colored tights, worn by actors dancers. D. Jerrold.",
    "FLESHLESS": "Destitute of flesh; lean. Carlyle.",
    "FLESHLINESS":
        "The state of being fleshly; carnal passions and appetites.Spenser.",
    "FLESHLING": "A person devoted to fleshly things. [Obs.] Spenser.",
    "FLESHLY": "In a fleshly manner; carnally; lasciviously. [Obs.] Chaucer.",
    "FLESHMENT":
        "The act of fleshing, or the excitement attending a successfulbeginning. [R.] Shak.",
    "FLESHMONGER":
        "One who deals in flesh; hence, a pimp; a procurer; a pander.[R.] Shak.",
    "FLESHPOT": "A pot or vessel in which flesh is cooked; hence (pl.),",
    "FLESHQUAKE":
        "A quaking or trembling of the flesh; a quiver. [Obs.] B.Jonson.",
    "FLESHY":
        "Composed of firm pulp; succulent; as, the houseleek, cactus,and agave are fleshy plants.",
    "FLET": "Skimmed. [Obs.]",
    "FLETCH":
        "To feather, as an arrow. Bp. Warburton.[Congress] fletched their complaint, by adding: \"America loved hisbrother.\" Bancroft.",
    "FLETCHER":
        "One who fletches of feathers arrows; a manufacturer of bows andarrows. [Obs.] Mortimer.",
    "FLETE": "To float; to swim. [Obs.] \"Whether I sink or flete.\" Chaucer.",
    "FLETIFEROUS": "Producing tears. [Obs.] Blount.",
    "FLEUR-DE-LIS": "The iris. See Flower-de-luce.",
    "FLEURON":
        "A flower-shaped ornament, esp. one terminating an object orforming one of a series, as a knob of a cover to a dish, or a flower-shaped part in a necklace.",
    "FLEURY":
        "Finished at the ends with fleurs-de-lis; -- said esp. a crossso decorated.",
    "FLEW": "imp. of Fly.",
    "FLEWED": "Having large flews. Shak.",
    "FLEWS":
        "The pendulous or overhanging lateral parts of the upper lip ofdogs, especially prominent in hounds; -- called also chaps. SeeIllust. of Bloodhound.",
    "FLEX": "To bend; as, to flex the arm.",
    "FLEXANIMOUS": "Having power to change the mind. [Obs.] Howell.",
    "FLEXIBILITY":
        "The state or quality of being flexible; flexibleness; pliancy;pliability; as, the flexibility of strips of hemlock, hickory,whalebone or metal, or of rays of light. Sir I. Newton.All the flexibility of a veteran courtier. Macaulay.",
    "FLEXICOSTATE": "Having bent or curved ribs.",
    "FLEXILE":
        "Flexible; pliant; pliable; easily bent; plastic; tractable.Wordsworth.",
    "FLEXION":
        "Syntactical change of form of words, as by declension orconjugation; inflection.Express the syntactical relations by flexion. Sir W. Hamilton.",
    "FLEXOR":
        "A muscle which bends or flexes any part; as, the flexors of thearm or the hand; -- opposed to extensor.",
    "FLEXUOSE": "Flexuous.",
    "FLEXUOUS":
        "Having alternate curvatures in opposite directions; bent in azigzag manner.",
    "FLEXURAL":
        "Of, pertaining to, or resulting from, flexure; of the natureof, or characterized by, flexure; as, flexural elasticity.",
    "FLEXURE": "The last joint, or bend, of the wing of a bird.",
    "FLIBBERGIB":
        "A sycophant. [Obs. & Humorous.] \"Flatterers and flibbergibs.\"Latimer.",
    "FLIBBERTIGIBBET": "An imp. Shak.",
    "FLIBUSTIER": "A buccaneer; an American pirate. See Flibuster. [Obs.]",
    "FLICK":
        "To whip lightly or with a quick jerk; to flap; as, to flick ahorse; to flick the dirt from boots. Thackeray.",
    "FLICKER":
        "The golden-winged woodpecker (Colaptes aurutus); -- so calledfrom its spring note. Called also yellow-hammer, high-holder, pigeonwoodpecker, and yucca.The cackle of the flicker among the oaks. Thoureau.",
    "FLICKERINGLY": "In a flickering manner.",
    "FLICKERMOUSE": "See Flittermouse.",
    "FLIDGE": "Fledged; fledge. [Obs.] Holland.",
    "FLIER": "A fly. See Fly, n., 9, and 13 (b).",
    "FLIGHT-SHOT":
        "The distance to which an arrow or flight may be shot; bowshot,-- about the fifth of a mile. [Prov. Eng. & Scot.]Within a flight-shot it inthe valley. Evelyn.Half a flight-shot from the king's oak. Sir W. Scott.",
    "FLIGHTED": "Feathered; -- said of arrows.",
    "FLIGHTER":
        "A horizontal vane revolving over the surface of wort in acooler, to produce a circular current in the liquor. Knight.",
    "FLIGHTILY": "In a flighty manner.",
    "FLIGHTINESS":
        "The state or quality of being flighty.The flightness of her temper. Hawthorne.",
    "FLIMFLAM": "A freak; a trick; a lie. Beau. & Fl.",
    "FLIMSILY": "In a flimsy manner.",
    "FLIMSINESS": "The state or quality of being flimsy.",
    "FLIMSY":
        "Weak; feeble; limp; slight; vain; without strength or solidity;of loose and unsubstantial structure; without reason or plausibility;as, a flimsy argument, excuse, objection.Proud of a vast extent of flimsy lines. Pope.All the flimsy furniture of a country miss's brain. Sheridan.",
    "FLINCH":
        "To let the foot slip from a ball, when attempting to give atight croquet.",
    "FLINCHER": "One who flinches or fails.",
    "FLINCHINGLY": "In a flinching manner.",
    "FLINDERMOUSE": "A bat; a flittermouse.",
    "FLINDERS":
        "Small pieces or splinters; fragments.The tough ash spear, so stout and true, Into a thousand flindersflew. Sir W. Scott.",
    "FLINGDUST":
        "One who kicks up the dust; a streetwalker; a low manner. [Obs.]Beau. & Fl.",
    "FLINGER": "One who flings; one who jeers.",
    "FLINT":
        "A massive, somewhat impure variety of quartz, in color usuallyof a gray to brown or nearly black, breaking with a conchoidalfracture and sharp edge. It is very hard, and strikes fire withsteel.",
    "FLINT GLASS":
        "A soft, heavy, brilliant glass, consisting essentially of asilicate of lead and potassium. It is used for tableware, and foroptical instruments, as prisms, its density giving a high degree ofdispersive power; -- so called, because formerly the silica wasobtained from pulverized flints. Called also crystal glass. Cf.Glass.",
    "FLINT-HEARTED": "Hard-hearted. Shak.",
    "FLINTINESS":
        "The state or quality of being flinty; hardness; cruelty. Beau.& Fl.",
    "FLINTWARE":
        "A superior kind of earthenware into whose composition flintenters largely. Knight.",
    "FLINTWOOD":
        "An Australian name for the very hard wood of the Eucalyptuspiluralis.",
    "FLINTY":
        "Consisting of, composed of, abounding in, or resembling, flint;as, a flinty rock; flinty ground; a flinty heart. Flinty rockFlintystate, a siliceous slate; -- basanite is here included. See Basanite.",
    "FLIP":
        "A mixture of beer, spirit, etc., stirred and heated by a hotiron. Flip dog, an iron used, when heated, to warm flip.",
    "FLIP-FLAP": "The repeated stroke of something long and loose. Johnson.",
    "FLIPE":
        "To turn inside out, or with the leg part back over the foot, asa stocking in pulling off or for putting on. [Scot.]",
    "FLIPPANCY":
        "The state or quality of being flippant.This flippancy of language. Bp. Hurd.",
    "FLIPPANT": "A flippant person. [R.] Tennyson.",
    "FLIPPANTLY": "In a flippant manner.",
    "FLIPPANTNESS": "State or quality of being flippant.",
    "FLIPPER":
        "A broad flat limb used for swimming, as those of seals, seaturtles, whales, etc.",
    "FLIRT":
        "One who flirts; esp., a woman who acts with giddiness, or playsat courtship; a coquette; a pert girl.Several young flirts about town had a design to cast us out of thefashionable world. Addison.",
    "FLIRT-GILL":
        "A woman of light behavior; a gill-flirt. [Obs.] Shak.You heard him take me up like a flirt-gill. Beau. & Fl.",
    "FLIRTIGIG": "A wanton, pert girl. [Obs.]",
    "FLIRTINGLY": "In a flirting manner.",
    "FLISK":
        "To frisk; to skip; to caper. [Obs. Scot.] \"The flisking flies.\"Gosson.",
    "FLIT": "Nimble; quick; swift. [Obs.] See Fleet.",
    "FLITE": "To scold; to quarrel. [Prov. Eng.] Grose.",
    "FLITTER": "To flutter. [Obs.] Chaucer.",
