    "FLOBERT":
        "A small cartridge designed for target shooting; -- sometimescalled ball cap. Flobert rifle, a rifle adapted to the use offloberts.",
    "FLOCCILLATION":
        "A delirious picking of bedclothes by a sick person, as if topick off flocks of wool; carphology; -- an alarming symptom in acutediseases. Dunglison.",
    "FLOCCOSE": "Having tufts of soft hairs, which are often deciduous.",
    "FLOCCULAR": "Of or pertaining to the flocculus.",
    "FLOCCULATE": "To aggregate into small lumps.",
    "FLOCCULATION":
        "The process by which small particles of fine soils andsediments aggregate into larger lumps.",
    "FLOCCULENCE": "The state of being flocculent.",
    "FLOCCULENT": "Applied to the down of newly hatched or unfledged birds.",
    "FLOCCULUS":
        "A small lobe in the under surface of the cerebellum, near themiddle peduncle; the subpeduncular lobe.",
    "FLOCCUS":
        "A woolly filament sometimes occuring with the sporules ofcertain fungi.",
    "FLOCK":
        "To gather in companies or crowds.Friends daily flock. Dryden.Flocking fowl (Zoöl.), the greater scaup duck.",
    "FLOCKLING": "A lamb. [Obs.] Brome (1659).",
    "FLOCKLY": "In flocks; in crowds. [Obs.]",
    "FLOCKMEL":
        "In a flock; in a body. [Obs.]That flockmel on a day they to him went. Chaucer.",
    "FLOCKY": "Abounding with flocks; floccose.",
    "FLOE":
        "A low, flat mass of floating ice. Floe rat (Zoöl.), a seal(Phoca foetida).",
    "FLOG":
        "To beat or strike with a rod or whip; to whip; to lash; tochastise with repeated blows.",
    "FLOGGING":
        "from Flog, v. t. Flogging chisel (Mach.), a large cold chisel,used in chipping castings.-- Flogging hammer, a small sledge hammer used for striking aflogging chisel.",
    "FLON": "See Flo. [Obs.] Chaucer.",
    "FLONG": "imp. & p. p. of Fling.",
    "FLOODAGE": "Inundation. [R.] Carlyle.",
    "FLOODER": "One who floods anything.",
    "FLOODING":
        "The filling or covering with water or other fluid; overflow;inundation; the filling anything to excess.",
    "FLOOK": "A fluke of an anchor.",
    "FLOOKY": "Fluky.",
    "FLOOR":
        "That part of the bottom of a vessel on each side of the keelsonwhich is most nearly horizontal.",
    "FLOORAGE": "Floor space.",
    "FLOORER":
        "Anything that floors or upsets a person, as a blow that knockshim down; a conclusive answer or retort; a task that exceeds one'sabilities. [Colloq.]",
    "FLOORHEADS": "The upper extermities of the floor of a vessel.",
    "FLOORING":
        "A platform; the bottom of a room; a floor; pavement. See Floor,n. Addison.",
    "FLOORLESS": "Having no floor.",
    "FLOORWALKER":
        "One who walks about in a large retail store as an overseer anddirector. [U.S.]",
    "FLOP": "Act of flopping. [Colloq.] W. H. Russell.",
    "FLOPPY":
        "Having a tendency to flop or flap; as, a floppy hat brim. G.Eliot.",
    "FLOPWING": "The lapwing.",
    "FLORA": "The goddess of flowers and spring.",
    "FLORAL":
        "Containing, or belonging to, a flower; as, a floral bud; afloral leaf; floral characters. Martyn. Floral envelope (Bot.), thecalyx and corolla, one or the other of which (mostly the corolla) maybe wanting.",
    "FLORALLY": "In a floral manner.",
    "FLORAMOUR": "The plant love-lies-bleeding. [Obs.] Prior.",
    "FLORAN":
        "Tin ore scarcely perceptible in the stone; tin ore stamped veryfine. Pryce.",
    "FLOREAL":
        "The eight month of the French republican calendar. It beganApril 20, and ended May 19. See Vendémiare.",
    "FLOREN": "A cerain gold coin; a Florence. [Obs.] Chaucer.",
    "FLORENTINE":
        "Belonging or relating to Florence, in Italy. Florentine mosaic,a mosaic of hard or semiprecious stones, often so chosen and arrangedthat their natural colors represent leaves, flowers, and the like,inlaid in a background, usually of black or white marble.",
    "FLORESCENCE": "A bursting into flower; a blossoming. Martyn.",
    "FLORESCENT": "Expanding into flowers; blossoming.",
    "FLORET":
        "A little flower; one of the numerous little flowers whichcompose the head or anthodium in such flowers as the daisy, thistle,and dandelion. Gray.",
    "FLORIAGE": "Bloom; blossom. [Obs.] J. Scott.",
    "FLORIATED":
        "Having floral ornaments; as, floriated capitals of Gothicpillars.",
    "FLORICOMOUS": "Having the head adorned with flowers. [R.]",
    "FLORICULTURAL": "Pertaining to the cultivation of flowering plants.",
    "FLORICULTURE": "The cultivation of flowering plants.",
    "FLORICULTURIST": "One skilled in the cultivation of flowers; a florist.",
    "FLORID":
        "Flowery; ornamental; running in rapid melodic figures,divisions, or passages, as in variations; full of fioriture or littleornamentations.",
    "FLORIDEAE":
        "A subclass of algæ including all the red or purplish seaweeds;the Rhodospermeæ of many authors; -- so called from the rosy orflorid color of most of the species.",
    "FLORIDITY": "The quality of being florid; floridness. Floyer.",
    "FLORIDLY": "In a florid manner.",
    "FLORIDNESS": "The quality of being florid. Boyle.",
    "FLORIFEROUS": "Producing flowers. Blount.",
    "FLORIFICATION": "The act, process, or time of flowering; florescence.",
    "FLORIFORM": "Having the form of a flower; flower-shaped.",
    "FLORIKEN":
        "An Indian bustard (Otis aurita). The Bengal floriken isSypheotides Bengalensis. [Written also florikan, floriken, florican.]",
    "FLORILEGE": "The act of gathering flowers.",
    "FLORIMER": "See Floramour. [Obs.]",
    "FLORIN":
        "A silver coin of Florence, first struck in the twelfth century,and noted for its beauty. The name is given to different coins indifferent countries. The florin of England, first minted in 1849, isworth two shillings, or about 48 cents; the florin of theNetherlands, about 40 cents; of Austria, about 36 cents.",
    "FLOROON": "A border worked with flowers. Wright.",
    "FLORULENT": "Flowery; blossoming. [Obs.] Blount.",
    "FLOS-FERRI":
        "A variety of aragonite, occuring in delicate white coralloidalforms; -- common in beds of iron ore.",
    "FLOSCULAR": "Flosculous.",
    "FLOSCULARIAN":
        "One of a group of stalked rotifers, having ciliated tentaclesaround the lobed disk.",
    "FLOSCULE": "A floret.",
    "FLOSCULOUS": "Consisting of many gamopetalous florets.",
    "FLOSH": "A hopper-shaped box or Knight.",
    "FLOSS":
        "The slender styles of the pistillate flowers of maize; alsocalled silk.",
    "FLOSSIFICATION": "A flowering; florification. [R.] Craig.",
    "FLOSSY":
        "Pertaining to, made of, or resembling, floss; hence, light;downy.",
    "FLOTA": "A fleet; especially, a",
    "FLOTANT":
        "Represented as flying or streaming in the air; as, a bannerflotant.",
    "FLOTATION PROCESS":
        "A process of separating the substances contained in pulverizedore or the like by depositing the mixture on the  surface of aflowing liquid, the substances that are quickly wet readilyovercoming the surface tension of the liquid and sinking, the othersflowing off in a film or slime on the surface, though, perhaps,having a greater specific gravity than those that sink.",
    "FLOTE": "To fleet; to skim. [Obs.] Tusser.",
    "FLOTERY": "Wavy; flowing. [Obs.]With flotery beard. Chaucer.",
    "FLOTILLA": "A little fleet, or a fleet of small vessels.",
    "FLOTTEN": "Skimmed. [Obs.]",
    "FLOUNCE":
        "To throw the limbs and body one way and the other; to spring,turn, or twist with sudden effort or violence; to struggle, as ahorse in mire; to flounder; to throw one's self with a jerk or spasm,often as in displeasure.To flutter and flounce will do nothing but batter and bruise us.Barrow.With his broad fins and forky tail he laves The rising sirge, andflounces in the waves. Addison.",
    "FLOUNDER": "A flatfish of the family Pleuronectidæ, of many species.",
    "FLOUR":
        "The finely ground meal of wheat, or of any other grain;especially, the finer part of meal separated by bolting; hence, thefine and soft powder of any substance; as, flour of emery; flour ofmustard. Flour bolt, in milling, a gauze-covered, revolving,cylindrical frame or reel, for sifting the flour from the refusecontained in the meal yielded by the stones.-- Flour box a tin box for scattering flour; a dredging box.-- Flour dredge or dredger, a flour box.-- Flour dresser, a mashine for sorting and distributing flouraccording to grades of fineness.-- Flour mill, a mill for grinding and sifting flour.",
    "FLOURED":
        "Finely granulated; -- said of quicksilver which has beengranulated by agitation during the amalgamation process. Raymond.",
    "FLOURISHER": "One who flourishes.",
    "FLOURISHINGLY": ", adv. In a flourishing manner; ostentatiously.",
    "FLOURY": "Of or resembling flour; mealy; covered with flour. Dickens.",
    "FLOUT":
        "To mock or insult; to treat with contempt.Phillida flouts me. Walton.Three gaudy standarts lout the pale blue sky. Byron.",
    "FLOUTER": "One who flouts; a mocker.",
    "FLOUTINGLY":
        "With flouting; insultingly; as, to treat a lover floutingly.",
    "FLOW": "imp. sing. of Fly, v. i. Chaucer.",
    "FLOWAGE":
        "An overflowing with water; also, the water which thusoverflows.",
    "FLOWEN": "imp. pl. of Fly, v. i. Chaucer.",
    "FLOWER":
        "That part of a plant destined to produce seed, and henceincluding one or both of the sexual organs; an organ or combinationof the organs of reproduction, whether inclosed by a circle of foliarparts or not. A complete flower consists of two essential parts, thestamens and the pistil, and two floral envelopes, the corolla andcallyx. In mosses the flowers consist of a few special leavessurrounding or subtending organs called archegonia. See Blossom, andCorolla.",
    "FLOWER STATE":
        "  Florida; -- a nickname, alluding to sense of L. floridus,from florida flowery. See Florid.",
    "FLOWER-DE-LUCE":
        "A genus of perennial herbs (Iris) with swordlike leaves andlarge three-petaled flowers often of very gay colors, but probablywhite in the plant first chosen for the royal French emblem.",
    "FLOWER-FENCE":
        "A tropical leguminous bush (Poinciana, or Cæsalpinia,pulcherrima) with prickly branches, and showy yellow or red flowers;-- so named from its having been sometimes used for hedges in theWest Indies. Baird.",
    "FLOWER-GENTLE": "A species of amaranth (Amarantus melancholicus).",
    "FLOWERAGE":
        "State of flowers; flowers, collectively or in general.Tennyson.",
    "FLOWERER":
        "A plant which flowers or blossoms.Many hybrids are profuse and persistent flowerers. Darwin.",
    "FLOWERET": "A small flower; a floret. Shak.",
    "FLOWERFUL": "Abounding with flowers. Craig.",
    "FLOWERINESS": "The state of being flowery.",
    "FLOWERING":
        "Having conspicuous flowers; -- used as an epithet with manynames of plants; as, flowering ash; flowering dogwood; floweringalmond, etc. Flowering fern, a genus of showy ferns (Osmunda), withconspicuous bivalvular sporangia. They usually grow in wet places.-- Flowering plants, plants which have stamens and pistils, andproduce true seeds; phenogamous plants; -- distinguished fromflowerless plants.-- Flowering rush, a European rushlike plant (Butomus umbellatus),with an umbel of rosy blossoms.",
    "FLOWERLESS":
        "Having no flowers. Flowerless plants, plants which have no trueflowers, and produce no seeds; cryptigamous plants.",
    "FLOWERLESSNESS": "State of being without flowers.",
    "FLOWERPOT":
        "A vessel, commonly or earthenware, for earth in which plantsare grown.",
    "FLOWERY-KIRTLED":
        "Dressed with garlands of flowers. [Poetic & Rare] Milton.",
    "FLOWING":
        "That flows or for flowing (in various sense of the verb);gliding along smoothly; copious. Flowing battery (Elec.), a batterywhich is kept constant by the flowing of the exciting liquid throughthe cell or cells. Knight.-- Flowing furnace, a furnace from which molten metal, can be drawn,as through a tap hole; a foundry cupola.-- Flowing sheet (Naut.), a sheet when eased off, or loosened to thewind, as when the wind is abaft the beam. Totten.",
    "FLOWINGLY": "In a flowing manner.",
    "FLOWINGNESS": "Flowing tendency or quality; fluency. [R.] W. Nichols.",
    "FLOWK": "See 1st Fluke.",
    "FLOWN":
        "p. p. of Fly; -- often used with the auxiliary verb to be; as,the birds are flown.",
    "FLOXED SILK": "See Floss silk, under Floss.",
    "FLOYTE": "A variant of Flute. [Obs.]",
    "FLUATE": "A fluoride. [Obs.]",
    "FLUAVIL":
        "A hydrocarbon extracted from gutta-percha, as a yellow,resinous substance; -- called also fluanil.",
    "FLUCAN":
        "Soft clayey matter in the vein, or surrounding it. [Writtenalso flookan, flukan, and fluccan.]",
    "FLUCTIFEROUS": "Tending to produce waves. Blount.",
    "FLUCTISONOUS": "Sounding like waves.",
    "FLUCTUABILITY": "The capacity or ability to fluctuate. [R.] H. Walpole.",
    "FLUCTUANT": "showing undulation or fluctuation; as, a fluctuant tumor.",
    "FLUCTUATE":
        "To cause to move as a wave; to put in motion. [R.]And fluctuate all the still perfume. Tennyson.",
    "FLUCTUATION":
        "The motion or undulation of a fluid collected in a natural orartifical cavity, which is felt when it is subjected to pressure orpercussion. Dunglison.",
    "FLUE":
        "An inclosed passage way for establishing and directing acurrent of air, gases, etc.; an air passage; esp.:(a) A compartment or division of a chimney for conveying flame andsmoke to the outer air.(b) A passage way for conducting a current of fresh, foul, or heatedair from one place to another.(c) (Steam Boiler) A pipe or passage for conveying flame and hotgases through surrounding water in a boiler; -- distinguished from atube which holds water and is surrounded by fire. Small flues arecalled fire tubes or simply tubes. Flue boiler. See under Boiler.-- Flue bridge, the separating low wall between the flues and thelaboratory of a reverberatory furnace.-- Flue plate (Steam Boiler), a plate to which the ends of the fluesare fastened; -- called also flue sheet, tube sheet, and tube plate.-- Flue surface (Steam Boiler), the aggregate surface of fluesexposed to flame or the hot gases.",
    "FLUE PIPE":
        "A pipe, esp. an organ pipe, whose tone is produced by theimpinging of a current of air upon an edge, or lip, causing a wavemotion in the air within; a mouth pipe; -- distinguished from reedpipe. Flue pipes are either open or closed (stopped at the distantend). The flute and flageolet are open pipes; a bottle acts as aclosed pipe when one blows across the neck. The organ has both openand closed flue pipes, those of metal being usually round in section,and those of wood triangular or square.",
    "FLUENCE": "Fluency. [Obs.] Milton.",
    "FLUENCY":
        "The quality of being fluent; smoothness; readiness ofutterance; volubility.The art of expressing with fluency and perspicuity. Macaulay.",
    "FLUENT":
        "A variable quantity, considered as increasing or diminishing; -- called, in the modern calculus, the function or integral.",
    "FLUENTLY": "In a fluent manner.",
    "FLUENTNESS": "The quality of being fluent.",
    "FLUEWORK":
        "A general name for organ stops in which the sound is caused bywind passing through a flue or fissure and striking an edge above; --in distinction from reedwork.",
    "FLUEY": "Downy; fluffy. [R.]",
    "FLUFF": "Nap or down; flue; soft, downy feathers.",
    "FLUFFY":
        "Pertaining to, or resembling, fluff or nap; soft and downy.\"The carpets were fluffy.\" Thackeray.The present Barnacle . . . had a youthful aspect, and the fluffiestlittle whisker, perhaps, that ever was seen. Dickens.-- Fluff\"i*ness, n.",
    "FLUGELMAN": "Same as Fugleman.",
    "FLUID":
        "Having particles which easily move and change their relativeposition without a separation of the mass, and which easily yield topressure; capable of flowing; liquid or gaseous.",
    "FLUIDAL":
        "Pertaining to a fluid, or to its flowing motion. Fluidalstructure (Geol.), the structure characteristic of certain volcanicrocks in which the arrangement of the minute crystals shows the linesof flow of thew molten material before solidification; -- also calledfluxion structure.",
    "FLUIDITY":
        "The quality of being fluid or capable of flowing; a liquid,aëriform. or gaseous state; -- opposed to solidity.It was this want of organization, this looseness and fluidity of thenew movement, that made it penetrate through every class of society.J. R. Green.",
    "FLUIDIZE": "To render fluid.",
    "FLUIDNESS": "The state of being flluid; fluidity.",
    "FLUIDOUNCE": "See Fluid ounce, under Fluid.",
    "FLUIDRACHM": "See Fluid dram, under Fluid. Pharm. of the U. S.",
    "FLUKAN": "Flucan.",
    "FLUKE":
        "One of the lobes of a whale's tail, so called from theresemblance to the fluke of an anchor.",
    "FLUKEWORM": "Same as 1st Fluke, 2.",
    "FLUKY": "Formed like, or having, a fluke.",
    "FLUME":
        "A stream; especially, a passage channel, or conduit for thewater that drives a mill wheel; or an artifical channel of water forhydraulic or placer mining; also, a chute for conveying logs orlumber down a declivity.",
    "FLUMINOUS": "Pertaining to rivers; abounding in streama.",
    "FLUNG": "imp. & p. p. of Fling.",
    "FLUNK":
        "To fail, as on a lesson; to back out, as from an undertaking,through fear.",
    "FLUNKYDOM": "The place or region of flunkies. C. Kingsley.",
    "FLUNLYISM":
        "The quality or characteristics of a flunky; readiness to cringeto those who are superior in wealth or position; toadyism. Thackeray.",
    "FLUO-":
        "A combining form indicating fluorine as an ingredient; as influosilicate, fluobenzene.",
    "FLUOBORATE": "A salt of fluoboric acid; a fluoboride.",
    "FLUOBORIC":
        "Pertaining to, derived from, or consisting of, fluorine andboron. Fluoridic acid (Chem.), a double fluoride, consistingessentially of a solution of boron fluoride, in hydrofluoric acid. Ithas strong acid properties, and is the type of the borofluorides.Called also borofluoric acid.",
    "FLUOBORIDE": "See Borofluoride.",
    "FLUOHYDRIC": "See Hydrofluoric.",
    "FLUOPHOSPHATE": "A double salt of fluoric and phosphoric acids.",
    "FLUOR": "See Fluorite.",
    "FLUOR ALBUS": "The whites; leucorrhæa.",
    "FLUOR SPAR": "See Fluorite.",
    "FLUORANTHENE": "A white crystalline hydrocarbon C",
    "FLUORATED":
        "Combined with fluorine; subjected to the action of fluoride.[R.]",
    "FLUORENE":
        "A colorless, crystalline hydrocarbon, C13H10 having a beautifulviolet fluorescence; whence its name. It occurs in the higher boilingproducts of coal tar, and is obtained artificially.",
    "FLUORESCEIN":
        "A yellowish red, crystalline substance, C20H12O5, produced byheating together phthalic anhydride and resorcin; -- so called, fromthe very brilliant yellowish green fluorescence of its alkalinesolutions. It has acid properties, and its salts of the alkalies areknown to the trade under the name of uranin.",
    "FLUORESCENCE":
        "That property which some transparent bodies have of producingat their surface, or within their substance, light different in colorfrom the mass of the material, as when green crystals of fluor sparafford blue reflections. It is due not to the difference in the colorof a distinct surface layer, but to the power which the substance hasof modifying the light incident upon it. The light emitted byfluorescent substances is in general of lower refrangibility than theincident light. Stockes.",
    "FLUORESCENT": "Having the property of fluorescence.",
    "FLUORESCIN":
        "A colorless, amorphous substance which is produced by thereduction of fluoresceïn, and from which the latter may be formed byoxidation.",
    "FLUORIC": "Pertaining to, obtained from, or containing, fluorine.",
    "FLUORIDE":
        "A binary compound of fluorine with another element or radical.Calcium fluoride (Min.), fluorite, CaF2. See Fluorite.",
    "FLUORINE":
        "A non-metallic, gaseous element, strongly acid or negative, orassociated with chlorine, bromine, and iodine, in the halogen groupof which it is the first member. It always occurs combined, is veryactive chemically, and possesses such an avidity for most elements,and silicon especially, that it can neither be prepared nor kept inglass vessels. If set free it immediately attacks the containingmaterial, so that it was not isolated until 1886. It is a pungent,corrosive, colorless gas. Symbol F. Atomic weight 19.",
    "FLUORITE":
        "Calcium fluoride, a mineral of many different colors, white,yellow, purple, green, red, etc., often very beautiful, crystallizingcommonly in cubes with perfect octahedral cleavage; also massive. Itis used as a flux. Some varieties are used for ornamental vessels.Also called fluor spar, or simply fluor.",
    "FLUOROID":
        "A tetrahexahedron; -- so called because it is a common form offluorite.",
    "FLUOROSCOPE": "An instrument for observing or exhibiting fluorescence.",
    "FLUOROSCOPY":
        "Examination of an object, as the human body, by exposing it tothe X rays and observing the shadow cast upon a fluorescent screen;cryptoscopy.",
    "FLUOROUS": "Pertaining to fluor.",
    "FLUOSILICATE":
        "A double fluoride of silicon and some other (usually basic)element or radical, regarded as a salt of fluosilicic acid; -- calledalso silicofluoride.",
    "FLUOSILICIC":
        "Composed of, or derived from, silicon and fluorine. Fluosilicicacid, a double fluoride of hydrogen and silicon, H2F6Si, obtained insolution in water as a sour fuming liquid, and regarded as the typeof the fluosilicates; -- called also silicofluoric acid, andhydrofluosilicic acid.",
    "FLURRIED": "Agitated; excited.-- Flur\"ried*ly adv.",
    "FLURRY":
        "To put in a state of agitation; to excite or alarm. H.Swinburne.",
    "FLURT": "A flirt. [Obs.] Quarles.",
    "FLUSH": "A hand of cards of the same suit.",
    "FLUSHBOARD": "Same as Flashboard.",
    "FLUSHER": "The red-backed shrike. See Flasher.",
    "FLUSHING": "A surface formed of floating threads.",
    "FLUSHINGLY": "In a flushing manner.",
    "FLUSHNESS": "The state of being flush; abundance.",
    "FLUSTER":
        "To make hot and rosy, as with drinking; to heat; hence, tothrow into agitation and confusion; to confuse; to muddle.His habit or flustering himself daily with claret. Macaulay.",
    "FLUSTERATION":
        "The act of flustering, or the state of being flustered;fluster. [Colloq.]",
    "FLUSTRATE": "To fluster. [Colloq.] Spectator.",
    "FLUSTRATION":
        "The act of flustrating; confusion; flurry. [Colloq.]Richardson.",
    "FLUTE":
        "A channel of curved section; -- usually applied to one of avertical series of such channels used to decorate columns andpilasters in classical architecture. See Illust. under Base, n.",
    "FLUTE A BEC":
        "A beak flute, an older form of the flute, played with amouthpiece resembling a beak, and held like a flageolet.",
    "FLUTEMOUTH":
        "A fish of the genus Aulostoma, having a much elongated tubularsnout.",
    "FLUTING":
        "Decoration by means of flutes or channels; a flute, or flutescollectively; as, the fluting of a column or pilaster; the fluting ofa lady's ruffle. Fluting iron, a laundry iron for fluting ruffles; --called also Italian iron, or gaufering iron. Knight.-- Fluting lathe, a machine for forming spiral flutes, as onbalusters, table legs, etc.",
    "FLUTIST": "A performer on the flute; a flautist. Busby.",
    "FLUTTERER": "One who, or that which, flutters.",
    "FLUTTERINGLY": "In a fluttering manner.",
    "FLUTY": "Soft and clear in tone, like a flute.",
    "FLUVIAL":
        "Belonging to rivers; growing or living in streams or ponds; as,a fluvial plant.",
    "FLUVIALIST":
        "One who exlpains geological phenomena by the action of streams.[R.]",
    "FLUVIATIC": "Belonging to rivers or streams; fluviatile. Johnson.",
    "FLUVIATILE":
        "Belonging to rivers or streams; existing in or about rivers;produced by river action; fluvial; as, fluviatile starta, plants.Lyell.",
    "FLUVIO-MARINE":
        "Formed by the joint action of a river and the sea, as depositsat the mouths of rivers.",
    "FLUVIOGRAPH":
        "An instrument for measuring and recording automatically therise and fall of a river.",
    "FLUVIOMETER":
        "An instrument for measuring the height of water in a river; ariver gauge.",
    "FLUX":
        "Any substance or mixture used to promote the fusion of metalsor minerals, as alkalies, borax, lime, fluorite.",
    "FLUXATION": "The act of fluxing.",
    "FLUXIBILITY": "The quality of being fluxible. Hammond.",
    "FLUXIBLE":
