        "Done or produced with force or great labor, or by extraordinaryexertion; hurried; strained; produced by unnatural effort orpressure; as, a forced style; a forced laugh. Forced draught. Seeunder Draught.-- Forced march (Mil.), a march of one or more days made with allpossible speed.-- For\"ced*ly, adv.-- For\"ced*ness, n.",
    "FORCEFUL":
        "Full of or processing force; exerting force; mighty.-- Force\"ful*ly, adv.Against the steed he threw His forceful spear. Dryden.",
    "FORCELESS":
        "Having little or no force; feeble.These forceless flowers like sturdy trees support me. Shak.",
    "FORCEMEAT":
        "Meat chopped fine and highly seasoned, either served up alone,or used as a stuffing. [Written also forced meat.]",
    "FORCEMENT":
        "The act of forcing; compulsion. [Obs.]It was imposed upon us by constraint; And will you count suchforcement treachery J. Webster.",
    "FORCEPS":
        "The caudal forceps-shaped appendage of earwigs and some otherinsects. See Earwig. Dressing forceps. See under Dressing.",
    "FORCIBLE-FEEBLE":
        "Seemingly vigorous, but really weak or insipid.He [Prof. Ayton] would purge his book of much offensive matter, if hestruck out epithets which are in the bad taste of the forcible-feebleschool. N. Brit. Review.",
    "FORCIBLENESS": "The quality of being forcible.",
    "FORCIBLY": "In a forcible manner.",
    "FORCING":
        "The art of raising plants, flowers, and fruits at an earlierseason than the natural one, as in a hitbed or by the use ofartificial heat. Forcing bed or pit, a plant bed having an underlayer of fermenting manure, the fermentation yielding bottom heat forforcing plants; a hotbed.-- Forcing engine, a fire engine.-- Forcing fit (Mech.), a tight fit, as of one part into a hole inanother part, which makes it necessary to use considerable force inputting the two parts together.-- Forcing house, a greenhouse for the forcing of plants, fruittrees, etc.-- Forcing machine, a powerful press for putting together orseparating two parts that are fitted tightly one into another, as forforcing a crank on a shaft, or for drawing off a car wheel from theaxle.-- Forcing pump. See Force pump (b).",
    "FORCIPAL":
        "Forked or branched like a pair of forceps; constructed so as toopen and shut like a pair of forceps. Sir T. Browne.",
    "FORCIPATION": "Torture by pinching with forceps or pinchers. Bacon.",
    "FORCITE":
        "A gelatin dynamite in which the dope is composed largely ofsodium nitrate.",
    "FORCUT": "To cut completely; to cut off. [Obs.] Chaucer.",
    "FORD":
        "To pass or cross, as a river or other water, by wading; to wadethrough.His last section, which is no deep one, remains only to be forted.Milton.",
    "FORDABLE": "Capable of being forded.-- Ford\"a*ble*ness, n.",
    "FORDLESS": "Without a ford.A deep and fordless river. Mallock.",
    "FORDONE": "Undone; ruined. [Obs.] Spenser.",
    "FORDRIVE": "To drive about; to drive here and there. [Obs.] Rom. of R.",
    "FORDRUNKEN": "Utterly drunk; very drunk. [Obs.] Chaucer.",
    "FORDRY": "Entirely dry; withered. [Obs.] \"A tree fordry.\" Chaucer.",
    "FORDWINE": "To dwindle away; to disappear. [Obs.] Rom of R.",
    "FORE":
        "Journey; way; method of proceeding. [Obs.] \"Follow him and hisfore.\" Chaucer.",
    "FORE TOOTH": "One of the teeth in the forepart of the mouth; an incisor.",
    "FORE-NIGHT": "The evening between twilight and bedtime. [Scot.]",
    "FORE-TOPGALLANT":
        "Designating the mast, sail, yard, etc., above the topmast; as,the fore-topgallant sail. See Sail.",
    "FORE-TOPMAST":
        "The mast erected at the head of the foremast, and at the headof which stands the fore-topgallant mast. See Ship.",
    "FORE-TOPSAIL": "See Sail.",
    "FOREADMONISH":
        "To admonish beforehand, or before the act or event. Bp. Hall.",
    "FOREADVISE":
        "To advise or counsel before the time of action, or before theevent. Shak.",
    "FOREALLEGE": "To allege or cite before. Fotherby.",
    "FOREAPPOINT": "To set, order, or appoint, beforehand. Sherwood.",
    "FOREAPPOINTMENT": "Previous appointment; preordinantion. Sherwood.",
    "FOREARM":
        "To arm or prepare for attack or resistance before the time ofneed. South.",
    "FOREBEAM": "The breast beam of a loom.",
    "FOREBEAR": "An ancestor. See Forbear.",
    "FOREBODE":
        "To fortell; to presage; to augur.If I forebode aright. Hawthorne.",
    "FOREBODEMENT": "The act of foreboding; the thing foreboded.",
    "FOREBODER": "One who forebodes.",
    "FOREBODING": "Presage of coming ill; expectation of misfortune.",
    "FOREBODINGLY": "In a foreboding manner.",
    "FOREBRACE":
        "A rope applied to the fore yardarm, to change the position ofthe foresail.",
    "FOREBRAIN":
        "The anterior of the three principal divisions of the brain,including the prosencephalon and thalamencephalon. Sometimesrestricted to the prosencephalon only. See Brain.",
    "FOREBY": "Near; hard by; along; past. See Forby. Spenser.",
    "FORECAST":
        "To contrive or plan beforehand.If it happen as I did forecast. Milton.",
    "FORECASTER": "One who forecast. Johnson.",
    "FORECHOSEN": "Chosen beforehand.",
    "FORECITED": "Cited or quoted before or above. Arbuthnot.",
    "FORECLOSE":
        "To shut up or out; to preclude; to stop; to prevent; to bar; toexclude.The embargo with Spain foreclosed this trade. Carew.To foreclose a mortgager (Law), to cut him off by a judgment of courtfrom the power of redeeming the mortgaged premises, termed his equityof redemption.-- To foreclose a mortgage, (not technically correct, but often usedto signify) the obtaining a judgment for the payment of an overduemortgage, and the exposure of the mortgaged property to sale to meetthe mortgage debt. Wharton.",
    "FORECLOSURE":
        "The act or process of foreclosing; a proceeding which bars orextinguishes a mortgager's right of redeeming a mortgaged estate.",
    "FORECONCEIVE": "To preconceive; to imagine beforehand. [Obs.] Bacon.",
    "FOREDATE": "To date before the true time; to antendate.",
    "FOREDECK": "The fore part of a deck, or of a ship.",
    "FOREDEEM":
        "To recognize or judge in advance; to forebode. [Obs.] Udall.Laugh at your misery, as foredeeming you An idle meteor. J. Webster.",
    "FOREDESIGN": "To plan beforehand; to intend previously. Cheyne.",
    "FOREDETERMINE": "To determine or decree beforehand. Bp. Hopkins.",
    "FOREDISPOSE":
        "To bestow beforehand. [R.]King James had by promise foredisposed the place on the Bishop ofMeath. Fuller.",
    "FOREDOOM":
        "To doom beforehand; to predestinate.Thou art foredomed to view the Stygian state. Dryden.",
    "FOREFATHER":
        "One who precedes another in the line of genealogy in anydegree, but usually in a remote degree; an ancestor.Respecting your forefathers, you would have been taught to respectyourselves. Burke.Forefathers' Day, the anniversary of the day (December 21) on whichthe Pilgrim Fathers landed at Plymouth, Massachusetts (1620). Onaccount of a mistake in reckoning the change from Old Style to NewStyle, it has generally been celebrated on the 22d.",
    "FOREFEEL":
        "To feel beforehand; to have a presentiment of. [Obs.]As when, with unwieldy waves, the great sea forefeels winds. Chapman.",
    "FOREFENCE": "Defense in front. [Obs.]",
    "FOREFEND":
        "To hinder; to fend off; to avert; to prevent the approach of;to forbid or prohibit. See Forfend.God forefend it should ever be recorded in our history. Landor.It would be a far better work . . . to forefend the cruelty. I.Taylor.",
    "FOREFINGER": "The finger next to the thumb; the index.",
    "FOREFLOW": "To flow before. [Obs.]",
    "FOREFOOT":
        "A piece of timber which terminates the keel at the fore end,connecting it with the lower end of the stem.",
    "FOREFRONT":
        "Foremost part or place.Set ye Uriah in the forefront of the hottest battle. 2 Sam. xi. 15.Socrates, Plato, Aristotle, standing in the forefront for all time,the masters of those who know. J. C. Shairp.",
    "FOREGAME": "A first game; first plan. [Obs.] Whitlock.",
    "FOREGANGER":
        "A short rope grafted on a harpoon, to which a longer linTotten.",
    "FOREGATHER": "Same as Forgather.",
    "FOREGIFT": "A premium paid by",
    "FOREGLEAM":
        "An antecedent or premonitory gleam; a dawning light.The foregleams of wisdom. Whittier.",
    "FOREGO":
        "To go before; to precede; -- used especially in the present andpast participles.Pleasing remembrance of a thought foregone. Wordsworth.For which the very mother's face forewent The mother's specialpatience. Mrs. Browning.Foregone conclusion, one which has preceded argument or examination;one predetermined.",
    "FOREGOER": "One who forbears to enjoy.",
    "FOREGROUND":
        "On a painting, and sometimes in a bas-relief, mosaic picture,or the like, that part of the scene represented, which is nearest tothe spectator, and therefore occupies the lowest part of the work ofart itself. Cf. Distance, n., 6.",
    "FOREGUESS": "To conjecture. [Obs.]",
    "FOREGUT":
        "The anterior part of the alimentary canal, from the mouth tothe intestine, o",
    "FOREHAND":
        "Done beforehand; anticipative.And so extenuate the forehand sin. Shak.",
    "FOREHEAR": "To hear beforehand.",
    "FOREHEARTH":
        "The forward extension of the hearth of a blast furnace underthe tymp.",
    "FOREHEND": "See Forhend. [Obs.]",
    "FOREHEW": "To hew or cut in front. [Obs.] Sackville.",
    "FOREHOLD": "The forward part of the hold of a ship.",
    "FOREHOLDING":
        "Ominous foreboding; superstitious prognostication. [Obs.]L'Estrange.",
    "FOREHOOK":
        "A piece of timber placed across the stem, to unite the bows andstrengthen the fore part of the ship; a breast hook.",
    "FOREIGNER":
        "A person belonging to or owning allegiance to a foreigncountry; one not native in the country or jurisdiction underconsideration, or not naturalized there; an alien; a stranger.Joy is such a foreigner, So mere a stranger to my thoughts. Denham.Nor could the majesty of the English crown appear in a greaterluster, either to foreigners or subjects. Swift.",
    "FOREIGNISM":
        "Anything peculiar to a foreign language or people; a foreignidiom or custom.It is a pity to see the technicalities of the so-called liberalprofessions distigured by foreignisms. Fitzed. Hall.",
    "FOREIGNNESS":
        "The quality of being foreign; remoteness; want of relation orappropriateness.Let not the foreignness of the subject hinder you from endeavoring toset me right. Locke.A foreignness of complexion. G. Eliot.",
    "FOREIN": "Foreign. [Obs.] Chaucer.",
    "FOREJUDGE":
        "To judge beforehand, or before hearing the facts and proof; toprejudge.",
    "FOREJUDGER":
        "A judgment by which one is deprived or put of a right or thingin question.",
    "FOREJUDGMENT": "Prejudgment. [Obs.] Spenser.",
    "FOREKNOW":
        "To have previous knowledge of; to know beforehand.Who would the miseries of man foreknow Dryden.",
    "FOREKNOWABLE": "That may be foreknown. Dr. H. More.",
    "FOREKNOWER": "One who foreknows.",
    "FOREKNOWINGLY":
        "With foreknowledge.He who . . . foreknowingly loses his life. Jer. Taylor.",
    "FOREKNOWLEDGE":
        "Knowledge of a thing before it happens, or of whatever is tohappen; prescience.If I foreknew, Foreknowledge had no influence on their fault. Milton.",
    "FOREL": "A kind of parchment for book covers. See Forrill.",
    "FORELAND":
        "A piece of ground between the wall of a place and the moat.Farrow.",
    "FORELEADER": "One who leads others by his example; aguide.",
    "FORELEND":
        "See Forlend. [Obs.]As if that life to losse they had forelent. Spenser.",
    "FORELET": "See Forlet. [Obs.] Holland.",
    "FORELIE":
        "To lie in front of. [Obs.]Which forelay Athwart her snowy breast. Spenser.",
    "FORELIFT": "To lift up in front. [Obs.]",
    "FORELOCK":
        "A cotter or split pin, as in a slot in a bolt, to preventretraction; a linchpin; a pin fastening the cap-square of a gun.Forelock bolt, a bolt retained by a key, gib, or cotter passingthrough a slot.-- Forelock hook (Rope Making), a winch or whirl by which a bunch ofthree yarns is twisted into a standard. Knight.-- To take time, or occasion, by the forelock, to make prompt use ofanything; not to let slip an opportunity.Time is painted with a lock before and bald behind, signifyingthereby that we must take time by the forelock; for when it is oncepast, there is no recalling it. Swift.On occasion's forelock watchful wait. Milton.",
    "FORELOOK": "To look beforehand or forward. [Obs.] Spenser.",
    "FOREMAN":
        "The first or chief man; as:(a) The chief man of a jury, who acts as their speaker.(b) The chief of a set of hands employed in a shop, or on works ofany kind, who superintends the rest; an overseer.",
    "FOREMAST":
        "The mast nearest the bow. Foremast hand or man (Naut.), acommon sailor; also, a man stationed to attend to the gear of theforemast.",
    "FOREMEANT": "Intended beforehand; premeditated. [Obs.] Spenser.",
    "FOREMENTIONED":
        "Mentioned before; already cited; aforementioned. Addison.",
    "FOREMILK":
        "The milk secreted just before, or directly after, the birth ofa child or of the young of an animal; colostrum.",
    "FOREMOST":
        "First in time or place; most advanced; chief in rank ordignity; as, the foremost troops of an army.THat struck the foremost man of all this world. Shak.",
    "FOREMOSTLY":
        "In the foremost place or order; among the foremost. J. Webster.",
    "FOREMOTHER": "A female ancestor.",
    "FORENAME":
        "A name that precedes the family name or surname; a first name.Selden.",
    "FORENAMED": "Named before; aforenamed.",
    "FORENDIHAZ": "See Legislature.",
    "FORENENST":
        "Over against; opposite to. [Now dialectic]The land forenenst the Greekish shore. Fairfax.",
    "FORENOON": "The early part of the day, from morning to meridian, or noon.",
    "FORENOTICE":
        "Notice or information of an event before it happens;forewarning. [R.] Rymer.",
    "FORENSAL": "Forensic. [R.]",
    "FORENSIC":
        "Belonging to courts of judicature or to public discussion anddebate; used in legal proceedings, or in public discussions;argumentative; rhetorical; as, forensic eloquence or disputes.Forensic medicine, medical jurisprudence; medicine in its relationsto law.",
    "FORENSICAL": "Forensic. Berkley.",
    "FOREORDAIN":
        "To ordain or appoint beforehand; to preordain; to predestinate;to predetermine. Hooker.",
    "FOREORDINATE": "To foreordain.",
    "FOREORDINATION":
        "Previous ordination or appointment; predetermination;predestination.",
    "FOREPAST": "Bygone. [Obs.] Shak.",
    "FOREPRIZE": "To prize or rate beforehand. [Obs.] Hooker.",
    "FOREPROMISED": "Promised beforehand; preëngaged. Bp. Hall.",
    "FOREQUOTED":
        "Cited before; quoted in a foregoing part of the treatise oressay.",
    "FORERAN": "imp. of Forerun.",
    "FORERANK": "The first rank; the front.",
    "FOREREACH":
        "To advance or gain upon; -- said of a vessel that gains uponanother when sailing closehauled.",
    "FOREREAD":
        "To tell beforehand; to signify by tokens; to predestine. [Obs.]Spenser.",
    "FORERECITED":
        "Named or recited before. \"The forerecited practices.\" Shak.",
    "FOREREMEMBERED": "Called to mind previously. Bp. Montagu.",
    "FORERIGHT":
        "Ready; directly forward; going before. [Obs.] \"A forerightwind.\" Chapman.",
    "FORERUNNER": "A piece of rag terminating the log line.",
    "FORESAID": "Mentioned before; aforesaid.",
    "FORESAY":
        "To foretell. [Obs.]Her danger nigh that sudden change foresaid. Fairfax.",
    "FORESEE": "To have or exercise foresight. [Obs.]",
    "FORESEEN":
        ", or (strictly) p. p. Provided; in case that; on conditionthat. [Obs.]One manner of meat is most sure to every complexion, foreseen that itbe alway most commonly in conformity of qualities, with the personthat eateth. Sir T. Elyot.",
    "FORESEER": "One who foresees or foreknows.",
    "FORESEIZE": "To seize beforehand.",
    "FORESHADOW": "To shadow or typi Dryden.",
    "FORESHEW": "See Foreshow.",
    "FORESHIP": "The fore part of a ship. [Obs.]",
    "FORESHORTEN":
        "To represent on a plane surface, as if extended in a directiontoward the spectator or nearly so; to shorten by drawing inperspective.",
    "FORESHORTENING": "Representation in a foreshortened mode or way.",
    "FORESHOT":
        "In distillation of low wines, the first portion of spirit thatcomes over, being a fluid abounding in fusel oil. Knight.",
    "FORESHOW":
        "To show or exhibit beforehand; to give foreknowledge of; toprognosticate; to foretell.Your looks foreshow You have a gentle heart. Shak.Next, like Aurora, Spenser rose, Whose purple blush the dayforeshows. Denham.",
    "FORESHOWER": "One who predicts.",
    "FORESIGHT":
        "Any sight or reading of the leveling staff, except thebacksight; any sight or bearing taken by a compass or theodolite in aforward direction.",
    "FORESIGHTED": "Sagacious; prudent; provident for the future. Bartram.",
    "FORESIGHTFUL": "Foresighted. [Obs.]",
    "FORESIGNIFY": "To signify beforehand; to foreshow; to typify. Milton.",
    "FORESKIN":
        "The fold of skin which covers the glans of the penis; theprepuce.",
    "FORESKIRT":
        "The front skirt of a garment, in distinction from the train.Honor's train Is longer than his foreskirt. Shak.",
    "FORESLACK": "See Forslack.",
    "FORESLEEVE": "The sleeve below the elbow.",
    "FORESLOW":
        "To make slow; to hinder; to obstruct. [Obs.] See Forslow, v. t.No stream, no wood, no mountain could foreslow Their hasty pace.Fairfax.",
    "FORESPEAK": "See Forspeak.",
    "FORESPEAKING": "A prediction; also, a preface. [Obs.] Camden. Huloet.",
    "FORESPEECH": "A preface. [Obs.] Sherwood.",
    "FORESPENT": "Already spent; gone by; past. [Obs.] Shak.",
    "FORESPURRER": "One who rides before; a harbinger. [Obs.] Shak.",
    "FOREST":
        "A large extent or precinct of country, generally waste andwoody, belonging to the sovereign, set apart for the keeping of gamefor his use, not inclosed, but distinguished by certain limits, andprotected by certain laws, courts, and officers of its own. Burrill.",
    "FORESTAFF":
        "An instrument formerly used at sea for taking the altitudes ofheavenly bodies, now superseded by the sextant; -- called also cross-staff. Brande & C.",
    "FORESTAL": "Of or pertaining to forests; as, forestal rights.",
    "FORESTALL":
        "To obstruct or stop up, as a way; to stop the passage of onhighway; to intercept on the road, as goods on the way to market. Toforestall the market, to buy or contract for merchandise or provisionon its way to market, with the intention of selling it again at ahigher price; to dissuade persons from bringing their goods orprovisions there; or to persuade them to enhance the price whenthere. This was an offense at law in England until 1844. Burrill.",
    "FORESTALLER":
        "One who forestalls; esp., one who forestalls the market. Locke.",
    "FORESTAY":
        "A large, strong rope, reaching from the foremast head to thebowsprit, to support the mast. See Illust. under Ship.",
    "FORESTER":
        "A lepidopterous insect belonging to Alypia and allied genera;as, the eight-spotted forester (A. octomaculata), which in the larvalstate is injurious to the grapevine.",
    "FORESTICK": "Front stick of a hearth fire.",
    "FORESTRY":
        "The art of forming or of cultivating forests; the management ofgrowing timber.",
    "FORETASTE": "A taste beforehand; enjoyment in advance; anticipation.",
    "FORETASTER": "One who tastes beforehand, or before another.",
    "FORETEACH": "To teach beforehand. [Obs.]",
    "FORETELL":
        "To predict; to tell before occurence; to prophesy; to foreshow.Deeds then undone my faithful tongue foretold. Pope.Prodigies, foretelling the future eminence and luster of hischaracter. C. Middleton.",
    "FORETELLER": "One who predicts. Boyle.",
    "FORETHINK": "To contrive beforehand. [Obs.]",
    "FORETHOUGHT":
        "Thought of, or planned, beforehand; aforethought; prepense;hence, deliberate. \"Forethought malice.\" Bacon.",
    "FORETHOUGHTFUL": "Having forethought. [R.]",
    "FORETIME":
        "The past; the time before the present. \"A very dim foretime.\"J. C. Shairp.",
    "FORETOKEN": "Prognostic; previous omen. Sir P. Sidney.",
    "FORETOP": "The platform at the head of the foremast.",
    "FOREVOUCHED":
        "Formerly vouched or avowed; affirmed in advance. [R.] Shak.",
    "FOREWARD":
        "The van; the front. [Obs.]My foreward shall be drawn out all in length, Consisting equally ofhorse and foot. Shak.",
    "FOREWARN":
        "To warn beforehand; to give previous warning, admonition,information, or notice to; to caution in advance.We were forewarned of your coming. Shak.",
    "FOREWASTE": "See Forewaste. Gascoigne.",
    "FOREWEND": "To go before. [Obs.] Spenser.",
    "FOREWISH": "To wish beforehand.",
    "FOREWITE": "To foreknow. [Obs.] [Written also forwete.] Chaucer.",
    "FOREWOMAN":
        "A woman who is chief; a woman who has charge of the work orworkers in a shop or other place; a head woman. Tatler. W. Besant.",
    "FOREWORD": "A preface. Furnvall.",
    "FOREWORN":
        "Worn out; wasted; used up. [Archaic]Old foreworn stories almost forgotten. Brydges.",
    "FOREWOT": ", 1st & 3d pers. sing. of Forewite. [Obs.] Chaucer.",
    "FOREYARD": "The lowermost yard on the foremast.",
    "FORFALTURE": "Forfeiture. [Obs.]",
    "FORFEIT":
        "Lost or alienated for an offense or crime; liable to penalseizure.Thy wealth being forfeit to the state. Shak.To tread the forfeit paradise. Emerson.",
    "FORFEITABLE":
        "Liable to be forfeited; subject to forfeiture.For the future, uses shall be subject to the statutes of mortmain,and forfeitable, like the lands themselves. Blackstone.",
    "FORFEITER": "One who incurs a penalty of forfeiture.",
    "FORFEND":
        "To prohibit; to forbid; to avert. [Archaic]Which peril heaven forefend! Shak.",
    "FORFERED":
        "Excessively alarmed; in great fear. [Obs.] \"Forfered of hisdeath.\" Chaucer.",
    "FORFETE":
        "To incur a penalty; to transgress. [Obs.]And all this suffered our Lord Jesus Christ that never forfeted.Chaucer.",
    "FORFEX": "A pair of shears. Pope.",
    "FORFICATE": "Deeply forked, as the tail of certain birds.",
    "FORFICULA": "A genus of insects including the earwigs. See Earwig, 1.",
    "FORGATHER":
        "To convene; to gossip; to meet accidentally. [Scot.] Jamieson.Within that circle he forgathered with many a fool. Wilson.",
    "FORGAVE": "imp. of Forgive.",
    "FORGE":
        "To move heavily and slowly, as a ship after the sails arefurled; to work one's way, as one ship in outsailing another; -- usedespecially in the phrase to forge ahead. Totten.And off she [a ship] forged without a shock. De Quincey.",
    "FORGEMAN": "A skilled smith, who has a hammerer to assist him.",
    "FORGER": "One who forges, makes, of forms; a fabricator; a falsifier.",
    "FORGET-ME-NOT":
        "A small herb, of the genus Myosotis (M. palustris, incespitosa,etc.), bearing a beautiful blue flower, and extensively consideredthe emblem of fidelity.",
    "FORGETFULLY": "In a forgetful manner.",
    "FORGETIVE": "Inventive; productive; capable. [Obs.] Shak.",
    "FORGETTABLE": "Liable to be, or that may be, forgotten. Carlyle.",
    "FORGETTER": "One who forgets; a heedless person. Johnson.",
    "FORGETTINGLY": "By forgetting.",
    "FORGING":
        "A piece of forged work in metal; -- a general name for a pieceof hammered iron or steel.There are very few yards in the world at which such forgings could beturned out. London Times.",
    "FORGIVABLE": "Capable of being forgiven; pardonable; venial. Sherwood.",
    "FORGIVER": "One who forgives. Johnson.",
    "FORGIVING":
        "Disposed to forgive; inclined to overlook offenses; mild;merciful; compassionate; placable; as, a forgiving temper.-- For*giv\"ing*ly, adv.-- For*giv\"ing*ness, n. J. C. Shairp.",
    "FORGO":
        "To pass by; to leave. See 1st Forego.For sith [since] I shall forgoon my liberty At your request. Chaucer.And four [days] since Florimell the court forwent. Spenser.",
    "FORGOT": "imp. & p. p. of Forget.",
    "FORGOTTEN": "p. p. of Forget.",
    "FORHALL": "To harass; to torment; to distress. [Obs.] Spenser.",
    "FORHEND": "To seize upon. [Obs.]",
    "FORINSECAL": "Foreign; alien. [Obs.] Bp. Burnet.",
    "FORISFAMILIATE":
        "Literally, to put out of a family; hence, to portion off, so asto exclude further claim of inheritance; to emancipate (as a with hisown consent) from paternal authority. Blackstone.",
    "FORISFAMILIATION": "The act of forisfamiliating.",
    "FORK":
        "To raise, or pitch with a fork, as hay; to dig or turn overwith a fork, as the soil.Forking the sheaves on the high-laden cart. Prof. Wilson.To fork over or out, to hand or pay over, as money. [Slang] G. Eliot.",
    "FORK-TAILED":
        "Having the outer tail feathers longer than the median ones;swallow-tailed; -- said of many birds. Fork-tailed flycatcher(Zoöl.), a tropical American flycatcher (Milvulus tyrannus).-- Fork-tailed gull (Zoöl.), a gull of the genus Xema, of twospecies, esp. X. Sabinii of the Arctic Ocean.-- Fork-tailed kite (Zoöl.), a graceful American kite (Elanoidesforficatus); -- called also swallow-tailed kite.",
    "FORKERVE": "See Forcarve, v. t.",
    "FORKINESS": "The quality or state or dividing in a forklike manner.",
    "FORKLESS": "Having no fork.",
    "FORKY":
        "Opening into two or more parts or shoots; forked; furcated.\"Forky tongues.\" Pope.",
    "FORLAFT": "p. p. of Forleave. Chaucer.",
    "FORLAY":
        "To lie in wait for; to ambush.An ambushed thief forlays a traveler. Dryden.",
    "FORLEAVE": "To leave off wholly. [Obs.] Chaucer.",
    "FORLEND": "To give up wholly. [Obs.]",
    "FORLESE": "To lose utterly. [Obs.] haucer.",
    "FORLET":
        "To give up; to leave; to abandon. [Obs.] \"To forlet sin.\"Chaucer.",
    "FORLIE": "See Forlie.",
    "FORLORE":
