    "FRACTIOUS":
        "Apt to break out into a passion; apt to scold; cross; snappish;ugly; unruly; as, a fractious man; a fractious horse.",
    "FRACTURAL": "Pertaining to, or consequent on, a fracture. [R.]",
    "FRACTURE": "The breaking of a bone.",
    "FRAENULUM": "A frænum.",
    "FRAGILE":
        "Easily broken; brittle; frail; delicate; easily destroyed.The state of ivy is tough, and not fragile. Bacon.",
    "FRAGMENT":
        "A part broken off; a small, detached portion; an imperfectpart; as, a fragment of an ancient writing.Gather up the fragments that remain. John vi. 12.",
    "FRAGMENTAL":
        "Consisting of the pulverized or fragmentary material of rock,as conglomerate, shale, etc.",
    "FRAGMENTARILY": "In a fragmentary manner; piecemeal.",
    "FRAGMENTARINESS":
        "The quality or property of being in fragnebts, or brokenpieces, incompleteness; want of continuity. G. Eliot.",
    "FRAGMENTARY": "Composed of the fragments of other rocks.",
    "FRAGMENTED": "Broken into fragments.",
    "FRAGMENTIST":
        "A writer of fragments; as, the fragmentist of Wolfenbüttel.[R.]",
    "FRAGOR": "A strong or sweet scent. [Obs. & Illegitimate.] Sir T. Herbert.",
    "FRAGRANT":
        "[fragrans. -antis, p.pr. of fragrare to emit a smell offragrance: cf. OF. fragrant. Affecting the olfactory nervesagreeably; sweet of smell; odorous; having or emitting an agreeableperfume.Fragrant the fertile earth After soft showers. Milton.",
    "FRAIGHT": "Same as Fraught. [Obs.] Spenser.",
    "FRAIL":
        "A basket made of rushes, used chiefly for containing figs andraisins.",
    "FRAILLY": "Weakly; infirmly.",
    "FRAILNESS": "Frailty.",
    "FRAISCHEUR": "Freshness; coolness. [R.] Dryden.",
    "FRAISE":
        "A large and thick pancake, with slices of bacon in it. [Obs.]Johnson.",
    "FRAISED": "Fortified with a fraise.",
    "FRAKEN": "A freckle. [Obs.]A few fraknes in his face. Chaucer.",
    "FRAMABLE": "Capable of being framed.",
    "FRAMBAESIA": "The yaws. See Yaws.",
    "FRAME":
        "To construct by fitting and uniting the several parts of theskeleton of any structure; specifically, in woodwork, to put togetherby cutting parts of one member to fit parts of another. See Dovetail,Halve, v. t., Miter, Tenon, Tooth, Tusk, Scarf, and Splice.",
    "FRAME-UP":
        "A conspiracy or plot, esp. for a malicious or evil purpose, asto incriminate a person on false evidence. [Slang]",
    "FRAMER":
        "One who frames; as, the framer of a building; the framers ofthe Constitution.",
    "FRAMING":
        "A framework, or a sy Framing chisel (Carp.), a heavy chiselwith a socket shank for making mortises.",
    "FRANC":
        "A silver coin of France, and since 1795 the unit of the Frenchmonetary system. It has been adopted by Belgium and Swizerland. It isequivalent to about nineteen cents, or ten pence, and is divided into100 centimes.",
    "FRANC-TIREUR":
        "A French partisan soldier, or one belonging to a corps ofdetached light troops engaged in forays, skirmishes, scouting, etc.",
    "FRANCHISE":
        "A particular privilege conferred by grant from a sovereign or agovernment, and vested in individuals; an imunity or exemption fromordinary jurisdiction; a constitutional or statutory right orprivilege, esp. the right to vote.Election by universal suffrage, as modified by the Constitution, isthe one crowning franchise of the American people. W. H. Seward.",
    "FRANCHISEMENT": "Release; deliverance; freedom. Spenser.",
    "FRANCIC": "Pertaining to the Franks, or their language; Frankish.",
    "FRANCISCAN":
        "Belonging to the Order of St. Francis of the Franciscans.Franciscan Brothers, pious laymen who devote themselves to usefulworks, such as manual labor schools, and other educationalinstitutions; -- called also Brothers of the Third Order of St.Francis.-- Franciscan Nuns, nuns who follow the rule of t. Francis, esp.those of the Second Order of St. Francis, -- called also Poor Claresor Minoresses.-- Franciscan Tertiaries, the Third Order of St. Francis.",
    "FRANCOLIN":
        "A spurred partidge of the genus Francolinus and allied genera,of Asia and Africa. The common species (F. vulgaris) was formerlycommon in southern Europe, but is now nearly restricted to Asia.",
    "FRANCOLITE": "A variety of apatite from Wheal Franco in Devonshire.",
    "FRANGENT": "Causing fracture; breaking. [R.] H. Walpole.",
    "FRANGIBILITY": "The state or quality of being frangible. Fox.",
    "FRANGIBLE": "Capable of being broken; brittle; fragile; easily broken.",
    "FRANGIPANE":
        "A perfume derived from, or imitating the odor of, the flower ofthe red jasmine, a West Indian tree of the genus Plumeria.",
    "FRANGULIN":
        "A yellow crystalline dyestuff, regarded as a glucoside,extracted from a species (Rhamnus Frangula) of the buckthorn; --called also rhamnoxanthin.",
    "FRANION":
        "A paramour; a loose woman; also, a gay, idle fellow. [Obs.]Spenser.",
    "FRANK": "A pigsty. [Obs.]",
    "FRANK-CHASE":
        "The liberty or franchise of having a chase; free chase.Burrill.",
    "FRANK-FEE":
        "A species of tenure in fee simple, being the opposite ofancient demesne, or copyhold. Burrill.",
    "FRANK-LAW":
        "The liberty of being sworn in courts, as a juror or witness;one of the ancient privileges of a freeman; free and common law; --an obsolete expression signifying substantially the same as theAmerican expression civil rights. Abbot.",
    "FRANK-MARRIAGE":
        "A certain tenure in tail special; an estate of inheritancegiven to a man his wife (the wife being of the blood of the donor),and descendible to the heirs of their two bodies begotten. [Obs.]Blackstone.",
    "FRANKALMOIGNE":
        "A tenure by which a religious corporation holds lands given tothem and their successors forever, usually on condition of prayingfor the soul of the donor and his heirs; -- called also tenure byfree alms. Burrill.",
    "FRANKFORT BLACK":
        ". A black pigment used in copperplate printing, prepared byburning vine twigs, the lees of wine, etc. McElrath.",
    "FRANKINCENSE":
        "A fragrant, aromatic resin, or gum resin, burned as an incensein religious rites or for medicinal fumigation. The best kinds nowcome from East Indian trees, of the genus Boswellia; a commoner sort,from the Norway spruce (Abies excelsa) and other coniferous trees.The frankincense of the ancient Jews is still unidentified.",
    "FRANKING":
        "A method of forming a joint at the intersection of window-sashbars, by cutting away only enough wood to show a miter.",
    "FRANKISH": "Like, or pertaining to, the Franks.",
    "FRANKLIN":
        "An English freeholder, or substantial householder. [Obs.]Chaucer.The franklin, a small landholder of those days. Sir J. Stephen.",
    "FRANKLIN STOVE":
        ". A kind of open stove introduced by Benjamin Franklin, thepeculiar feature of which was that a current of heated air wasdirectly supplied to the room from an air box; -- now applied toother varieties of open stoves.",
    "FRANKLINIC":
        "Of or pertaining to Benjamin Franklin. Franklinic electricity,electricity produced by friction; called also statical electricity.",
    "FRANKLINITE": "A kind of mineral of the spinel group.",
    "FRANKLY":
        "In a frank manner; freely.Very frankly he confessed his treasons. Shak.",
    "FRANKNESS":
        "The quality of being frank; candor; openess; ingenuousness;fairness; liberality.",
    "FRANTIC":
        "Mad; raving; furious; violent; wild and disorderly; distracted.Die, frantic wretch, for this accursed deed! Shak.Torrents of frantic abuse. Macaulay.-- Fran\"tic*al*ly, adv.-- Fran\"tic*ly, adv. Shak.-- Fran\"tic*ness, n. Johnson.",
    "FRAP":
        "To draw together; to bind with a view to secure and strengthen,as a vessel by passing cables around it; to tighten; as a tackle bydrawing the lines together. Tottem.",
    "FRAPE": "A crowd, a rabble. [Obs.] ares.",
    "FRAPLER":
        "A blusterer; a rowdy. [Obs.]Unpolished, a frapler, and base. B. Jonson.",
    "FRAPPE": "Iced; frozen; artificially cooled; as, wine frappé. -- n.",
    "FRAPPING": "A lashing binding a thing tightly or binding things together.",
    "FRATER":
        "A monk; also, a frater house. [R.] Shipley. Frater house, anapartament in a convent used as an eating room; a refectory; --called also a fratery.",
    "FRATERNAL":
        "Pf, pertaining to, or involving, brethren; becoming tobrothers; brotherly; as, fraternal affection; a fraternal embrace.-- Fra*ter\"nal*ly, adv.An abhorred, a cursed, a fraternal war. Milton.Fraternal love and friendship. Addison.",
    "FRATERNATE": "To fraternize; to hold fellowship. Jefferson.",
    "FRATERNIZATION":
        "The act of fraternizing or uniting as brothers.I hope that no French fraternization . . . could so change the heartsof Englishmen. Burke.",
    "FRATERNIZE":
        "To associate or hold fellowship as brothers, or as men of likeoccupation or character; to have brotherly feelings.",
    "FRATERNIZER": "One who fraternizes. Burke.",
    "FRATERY": "A frater house. See under Frater.",
    "FRATRAGE": "A sharing among brothers, or brothers' kin. [Obs.] Crabb.",
    "FRATRICIDAL":
        "Of or pertaining to fratricide; of the nature of fratricide.",
    "FRATRICIDE": "One who murders or kills his own brother.",
    "FRAU":
        "In Germany, a woman; a married woman; a wife; -- as a title,equivalent to Mrs., Madam.",
    "FRAUD":
        "An intentional perversion of truth for the purpose of obtainingsome valuable thing or promise from another.",
    "FRAUDFUL":
        "Full of fraud, deceit, or treachery; trickish; treacherous;fraudulent; -- applied to persons or things. I. Taylor.-- Fraud\"ful*ly, adv.",
    "FRAUDLESS":
        "Free from fraud.-- Fraud\"less*ly, adv.-- Fraud\"less*ness, n.",
    "FRAUDULENTLY": "In a fraudulent manner.",
    "FRAUGHT": "A freight; a cargo. [Obs.] Shak.",
    "FRAUGHTAGE": "Freight; loading; cargo. [Obs.] Shak.",
    "FRAUGHTING":
        "Constituting the freight or cargo. [Obs.] \"The fraughting soulswithin her.\" Shak.",
    "FRAULEIN":
        "In Germany, a young lady; an unmarried woman; -- as a title,equivalent to Miss.",
    "FRAUNHOFER LINES":
        "The lines of the spectrun; especially and properly, the darklines of the solar spectrum, so called because first accuratelyobserved and interpreted by Fraunhofer, a German physicist.",
    "FRAXIN":
        "A colorless crystalline substance, regarded as a glucoside, andfound in the bark of the ash (Fraxinus) and along with esculin in thebark of the horse-chestnut. It shows a delicate fluorescence inalkaline solutions; -- called also paviin.",
    "FRAXINUS":
        "A genus of deciduous forest trees, found in the north temperatezone, and including the true ash trees.",
    "FRAY": "Affray; broil; contest; combat.Who began this bloody fray Shak.",
    "FRAYING": "The skin which a deer frays from his horns. B. Jonson.",
    "FRAZZLE":
        "To fray; to wear or pull into tatters or tag ends; to tatter; --used literally and figuratively. [Prov. Eng. & U. S.]",
    "FREAK":
        "To variegate; to checker; to streak. [R.]Freaked with many a mingled hue. Thomson.",
    "FREAKING": "Freakish. [Obs.] Pepys.",
    "FREAKISH":
        "Apt to change the mind suddenly; whimsical; capricious.It may be a question whether the wife or the woman was the morefreakish of the two. L'Estrange.Freakish when well, and fretful when she's sick. Pope.-- Freak\"ish*ly, adv.-- Freak\"ish*ness, n.",
    "FRECK":
        "To checker; to diversify. [R. & Poet.]The painted windows, frecking gloom with glow. Lowell.",
    "FRECKLE":
        "To spinkle or mark with freckle or small discolored spots; tospot.",
    "FRECKLED":
        "Marked with freckles; spotted. \"The freckled trout.\" Dryden.The freckled cowslip, burnet, and green clover. Shak.",
    "FRECKLEDNESS": "The state of being freckled.",
    "FRECKLY":
        "Full of or marked with freckles; sprinkled with spots;freckled.",
    "FRED":
        "Peace; -- a word used in composition, especially in propernames; as, Alfred; Frederic.",
    "FREDSTOLE": "See Fridstol. Fuller.",
    "FREE":
        "Certain or honorable; the opposite of base; as, free service;free socage. Burrill.",
    "FREE COINAGE":
        "In the fullest sense, the conversion of bullion (of anyspecified metal) into legal-tender coins for any person who choosesto bring it to the mint; in a modified sense, such coinage when doneat a fixed charge proportionate to the cost of the operation.",
    "FREE SILVER":
        "The free coinage of silver; often, specif., the free coinage ofsilver at a fixed ratio with gold, as at the ratio of 16 to 1, whichratio for some time represented nearly or exactly the ratio of themarket values of gold and silver respectively.",
    "FREE-DENIZEN": "To make free. [R.]",
    "FREE-HAND":
        "Done by the hand, without support, or the guidance ofinstruments; as, free-hand drawing. See under Drawing.",
    "FREE-HANDED": "Open-handed; liberal.",
    "FREE-HEARTED":
        "Open; frank; unreserved; liberal; generous; as, free-heartedmirth.-- Free\"-heart`ed*ly, adv.-- Free\"-heart`ed*ness, n.",
    "FREE-LIVER":
        "One who gratifies his appetites without stint; one given toindulgence in eating and drinking.",
    "FREE-LIVING": "Unrestrained indulgence of the appetites.",
    "FREE-LOVE":
        "The doctrine or practice of consorting with the opposite sex,at pleasure, without marriage.",
    "FREE-LOVER": "One who believes in or practices free-love.",
    "FREE-MARTIN": "An imperfect female calf, twinborn with a male.",
    "FREE-MILLING":
        "Yielding free gold or silver; -- said of certain ores which canbe reduced by crushing and amalgamation, without roasting or otherchemical treatment. Raymond.",
    "FREE-MINDED": "Not perplexed; having a mind free from care. Bacon.",
    "FREE-SOIL":
        "Pertaining to, or advocating, the non-extension of slavery; --esp. applied to a party which was active during the period 1846-1856.[U.S.] -- Free\"soil`er, n. [U.S.] -- Free\"-soil`ism, n. [U.S.]",
    "FREE-SPOKEN":
        "Accustomed to speak without reserve. Bacon.-- Free\"-spo`ken-ness, n.",
    "FREE-SWIMMING":
        "Swimming in the open sea; -- said of certain marine animals.",
    "FREE-TONGUED": "Speaking without reserve. Bp. Hall.",
    "FREEBOOTER":
        "One who plunders or pillages without the authority of nationalwarfare; a member of a predatory band; a pillager; a buccaneer; a searobber. Bacon.",
    "FREEBOOTERY":
        "The act, practice, or gains of a freebooter; freebooting.Booth.",
    "FREEBOOTING": "Robbery; plunder; a pillaging.",
    "FREEBOOTY": "Freebootery. [Obs.]",
    "FREEBORN": "Born free; not born in vasssalage; inheriting freedom.",
    "FREEDMAN": "A man who has been a slave, and has been set free.",
    "FREEDSTOOL": "See Fridstol.",
    "FREEHOLD":
        "An estate in real property, of inheritance (in fee simple orfee tail) or for life; or the tenure by which such estate is held.Kent. Burrill. To abate into a freehold. See under Abate.",
    "FREEHOLDER": "The possessor of a freehold.",
    "FREELTE": "Frailty. [Obs.] Chaucer.",
    "FREELY":
        "In a free manner; without restraint or compulsion; abundantly;gratuitously.Of every tree of the garden thou mayst freely eat. Gen. ii. 16.Freely ye have received, freely give. Matt. x. 8.Freely they stood who stood, and fell who fell. Milton.Freely we serve Because we freely love. Milton.",
    "FREEMASON":
        "One of an ancient and secret association or fraternity, said tohave been at first composed of masons or builders in stone, but nowconsisting of persons who are united for social enjoyment and mutualassistance.",
    "FREEMASONIC":
        "Pertaining to, or resembling, the institutions or the practicesof freemasons; as, a freemasonic signal.",
    "FREEMASONRY": "The institutions or the practices of freemasons.",
    "FREENESS":
        "The state or quality of being free; freedom; liberty; openness;liberality; gratuitousness.",
    "FREER": "One who frees, or sets free.",
    "FREESTONE":
        "A stone composed of sand or grit; -- so called because it iseasily cut or wrought.",
    "FREETHINKER":
        "One who speculates or forms opinions independently of theauthority of others; esp., in the sphere or religion, one who formsopinions independently of the authority of revelation or of thechurch; an unbeliever; -- a term assumed by deists and skeptics inthe eighteenth century.Atheist is an old-fashioned word: I'm a freethinker, child. Addison.",
    "FREETHINKING": "Undue boldness of speculation; unbelief. Berkeley.-- a.",
    "FREEWHEEL":
        "A clutch fitted in the rear hub of a cycle, which engages therear sprocket with the rear wheel when the pedals are rotatedforwards, but permits the rear wheel to run on free from the rearsprocket when the pedals are stopped or rotated backwards.Freewheelcycles are usually fitted with hub brakes or rim brakes,operated by back pedaling.",
    "FREEWILL":
        "Of or pertaining to free will; voluntary; spontaneous; as, afreewill offering. Frewill Baptists. See under Baptist.",
    "FREEZABLE": "Capable of being frozen.",
    "FREEZE": "A frieze. [Obs.]",
    "FREEZER":
        "One who, or that which, cools or freezes, as a refrigerator, orthe tub and can used in the process of freezing ice cream.",
    "FREEZING":
        "Tending to freeze; for freezing; hence, cold or distant inmanner.-- Frrez\"ing*ly, adv. Freezing machine. See Ice machine, under Ice.-- Freezing mixture, a mixture (of salt and snow or of chemicalsalts) for producing intense cold.-- Freezing point, that degree of a thermometer at which a fluidbegins to freeze; -- applied particularly to water, whose freezingpoint is at 32º Fahr., and at 0º Centigrade.",
    "FREIESLEBENITE":
        "A sulphide of antimony, lead, and silver, occuring inmonoclinic crystals.",
    "FREIGHT":
        "Employed in the transportation of freight; having to do withfreight; as, a freight car. Freight agent, a person employed by atransportation company to receive, forward, or deliver goods.-- Freight car. See under Car.-- Freight train, a railroad train made up of freight cars; --called in England goods train.",
    "FREIGHTLESS": "Destitute of freight.",
    "FREIHERR": "In Germany and Austria, a baron.",
    "FRELTE": "Frailty. [Obs.] Chaucer.",
    "FREMESCENT":
        "Becoming murmurous, roaring. \"Fremescent clangor.\" Carlyle. --Fre*mes\"cence (#), n.",
    "FREMITUS": "Palpable vibration or thrill; as, the rhonchial fremitus.",
    "FREN": "A stranger. [Obs.] Spenser.",
    "FRENCH":
        "Of or pertaining to France or its inhabitants. French bean(Bot.), the common kidney bean (Phaseolus vulgaris).-- French berry (Bot.), the berry of a species of buckthorn (Rhamnuscatharticus), which affords a saffron, green or purple pigment.-- French casement (Arch.) See French window, under Window.-- French chalk (Min.), a variety of granular talc; -- used fordrawing lines on cloth, etc. See under Chalk.-- French cowslip (Bot.) The Primula Auricula. See Bear's-ear.-- French fake (Naut.), a mode of coiling a rope by running itbackward and forward in parallel bends, so that it may run freely.-- French honeysuckle (Bot.) a plant of the genus Hedysarum (H.coronarium); -- called also garland honeysuckle.-- French horn, a metallic wind instrument, consisting of a longtube twisted into circular folds and gradually expanding from themouthpiece to the end at which the sound issues; -- called in Francecor de chasse.-- French leave, an informal, hasty, or secret departure; esp., theleaving a place without paying one's debts.-- French pie Etym: [French (here used in sense of \"foreign\") + piea magpie (in allusion to its black and white color)] (Zoöl.), theEuropean great spotted woodpecker (Dryobstes major); -- called alsowood pie.-- French polish. (a) A preparation for the surface of woodwork,consisting of gums dissolved in alcohol, either shellac alone, orshellac with other gums added. (b) The glossy surface produced by theapplication of the above.-- French purple, a dyestuff obtained from lichens and used forcoloring woolen and silken fabrics, without the aid of mordants. Ure.-- French red rouge.-- French rice, amelcorn.-- French roof (Arch.), a modified form of mansard roof having anearly flat deck for the upper slope.-- French tub, a dyer's mixture of protochloride of tin and logwood;-- called also plum tub. Ure.-- French window. See under Window.",
    "FRENCHIFY":
        "To make French; to infect or imbue with the manners or tastesof the French; to Gallicize. Burke.",
    "FRENCHISM":
        "A French mode or characteristic; an idiom peculiar to theFrench language. Earle.",
    "FRENCHMAN": "A native or one of the people of France.",
    "FRENETIC": "Distracted; mad; frantic; phrenetic. Milton.",
    "FRENETICAL": "Frenetic; frantic; frenzied.-- Frenet\"ic*al*ly, adv.",
    "FRENUM": "A cheek stripe of color.",
    "FRENZICAL": "Frantic. [Obs.] Orrery.",
    "FRENZIED":
        "Affected with frenzy; frantic; maddened.-- Fren\"zied-ly, adv.The people frenzied by centuries of oppression. Buckle.Up starting with a frenzied look. Sir W Scott.",
    "FRENZY":
        "Any violent agitation of the mind approaching to distraction;violent and temporary derangement of the mental faculties; madness;rage.All else is towering frenzy and distraction. Addison.The poet's eye in a fine frenzy rolling. Shak.",
    "FREQUENTABLE": "Accessible. [R.] Sidney.",
    "FREQUENTAGE": "The practice or habit of frequenting. [R.] Southey.",
    "FREQUENTATION":
        "The act or habit of frequenting or visiting often; resort.Chesterfield.",
    "FREQUENTATIVE":
        "Serving to express the frequent repetition of an action; as, afrequentative verb.-- n.",
    "FREQUENTER":
        "One who frequents; one who often visits, or resorts tocustomarily.",
    "FREQUENTLY":
        "At frequent or short intervals; many times; often; repeatedly;commonly.",
    "FREQUENTNESS": "The quality of being frequent.",
    "FRERE": "A friar. Chaucer.",
    "FRESCADE": "A cool walk; shady place. [R.] Maunder.",
    "FRESCO": "To paint in fresco, as walls.",
    "FRESH": "To refresh; to freshen. [Obs.] Rom. of R.",
    "FRESH-NEW": "Unpracticed. [Obs.] Shak.",
    "FRESH-WATER":
        "A lantern having a lamp surrounded by a hollow cylindricalFresnel lens.",
    "FRESHEN":
        "To relieve, as a rope, by change of place where friction wearsit; or to renew, as the material used to prevent chafing; as, tofreshen a hawse. Totten. To freshen ballast (Naut.), to shift Orrestore it.-- To freshen the hawse, to pay out a little more cable, so as tobring the chafe on another part.-- To freshen the way, to increase the speed of a vessel. Ham. Nav.Encyc.",
    "FRESHLY":
        "In a fresh manner; vigorously; newly, recently; brightly;briskly; coolly; as, freshly gathered; freshly painted; the windblows freshly.Looks he as freshly as he did Shak.",
    "FRESHMAN":
        "novice; one in the rudiments of knowledge; especially, astudent during his fist year in a college or university.He drank his glass and cracked his joke, And freshmen wondered as hespoke. Goldsmith.Freshman class, the lowest of the four classes in an Americancollege. [ U. S.]",
    "FRESHMANSHIP": "The state of being a freshman.",
    "FRESHMENT": "Refreshment. [Obs.]",
    "FRESHNESS":
        "The state of being fresh.The Scots had the advantage both for number and freshness of men.Hayward.And breathe the freshness of the open air. Dryden.Her cheeks their freshness lose and wonted grace. Granville.",
    "FRESNEL LENS": "See under Lens.",
    "FRET": "See 1st Frith.",
    "FRETFUL":
        "Disposed to fret; ill-humored; peevish; angry; in a state ofvexation; as, a fretful temper.-- Fret\"ful-ly, adv.-- Fret\"ful-ness, n.",
    "FRETT": "The worn side of the bank of a river. See 4th Fret, n., 4.",
    "FRETTED":
        "Interlaced one with another; -- said of charges and ordinaries.",
    "FRETTEN":
        "Rubbed; marked; as, pock-fretten, marked with the smallpox.[Obs.] Wright.",
    "FRETTER": "One who, or that which, frets.",
    "FRETTY": "Adorned with fretwork.",
    "FRETUM": "A strait, or arm of the sea.",
    "FRETWORK":
        "Work adorned with frets; ornamental openwork or work in relief,esp. when elaborate and minute in its parts. Heuce, any minute playof light andshade, dark and light, or the like.Banqueting on the turf in the fretwork of shade and sunshine.Macaulay.",
    "FREYA":
        "The daughter of Njörd, aud goddess of love and beauty; theScandinavian Venus; -- in Teutonic myths confounded with Frigga, butin Scandinavian, distinct. [Written also Frea, Fraying, and Ereyja.]",
    "FRIABIIITY": "The quality of being friable; friableness. Locke.",
    "FRIABLE":
        "[friabilis, fr. friare to rub, break, or crumble into smallpieces, cf. fricare to rub, E. fray. cf. F. friable.) Easilycrumbled, pulverized, or reduced to powder. \"Friable ground.\" Evelyn.\"Soft and friable texture.\" Paley.-- Fri'a-ble-ness, n.",
    "FRIAR":
        "A brother or member of any religious order, but especially ofone of the four mendicant orders, viz: (a) Minors, Gray Friars, orFranciscans. (b) Augustines. (c) Dominicans or Black Friars. (d)White Friars or Carmelites. See these names in the Vocabulary.",
    "FRIARLY": "Like a friar; inexperienced. Bacon.",
    "FRIARY":
        "Like a friar; pertaining to friars or to a convent. [Obs.]Camden.",
    "FRIATION": "The act of breaking up or pulverizing.",
    "FRIBBLE": "Frivolous; trifling; sily.",
    "FRIBBLER": "A trifler; a fribble.",
    "FRIBBLING": "Frivolous; trining; toolishly captious.",
    "FRICACE":
        "A ragout or fricassee of veal; a fancy dish of veal or of bonedturkey, served as an entrée, -- called also fricandel. A. J. Cooley.",
    "FRICASSEE":
        "A dish made of fowls, veal, or other meat of small animals cutinto pieces, and stewed in a gravy.",
    "FRICATION": "Friction. [Obs.] Bacon.",
    "FRICATIVE":
        "Produced by the friction or rustling of the breath, intonatedor unintonated, through a narrow opening between two of the mouthorgans; uttered through a close approach, but not with a completeclosure, of the organs of articulation, and hence capable of beingcontinued or prolonged; -- said of certain consonantal sounds, as f,v, s, z, etc.-- n.",
    "FRICATRICE": "A lewd woman; a harlot. [Obs.] B. Jonson.",
    "FRICKLE": "A bushel basket. [Obs.]",
    "FRICTION":
