    "FUGITIVELY": "In a fugitive manner.",
    "FUGITIVENESS":
        "The quality or condition of being fugitive; evanescence;volatility; fugacity; instability.",
    "FUGLE":
        "To maneuver; to move hither and thither. [Colloq.]Wooden arms with elbow joints jerking and fugling in the air.Carlyle.",
    "FUGLEMAN":
        "A soldier especially expert and well drilled, who takes hisplace in front of a military company, as a guide for the others intheir exercises; a file leader. He originally stood in front of theright wing. [Written also flugelman.]",
    "FUGUE":
        "A polyphonic composition, developed from a given theme orthemes, according to strict contrapuntal rules. The theme is firstgiven out by one voice or part, and then, while that pursues its way,it is repeated by another at the interval of a fifth or fourth, andso on, until all the parts have answered one by one, continuing theirseveral melodies and interweaving them in one complex progressivewhole, in which the theme is often lost and reappears.All parts of the scheme are eternally chasing each other, like theparts of a fugue. Jer. Taylor.",
    "FUGUIST": "A musician who composes or performs fugues. Busby.",
    "FULBE": "Same as Fulahs.",
    "FULCIBLE": "Capable of being propped up. [Obs.] Cockeram.",
    "FULCIMENT": "A prop; a fulcrum. [Obs.] Bp. Wilkins.",
    "FULCRA": "See Fulcrum.",
    "FULCRATE": "Propped; supported by accessory organs. [R.] Gray.",
    "FULCRUM":
        "That by which a lever is sustained, or about which it turns inlifting or moving a body.",
    "FULFILLER": "One who fulfills. South.",
    "FULGENCY": "Brightness; splendor; glitter; effulgence. Bailey.",
    "FULGENT":
        "Exquisitely bright; shining; dazzling; effulgent.Other Thracians . . . fulgent morions wore. Glower.",
    "FULGENTLY": "Dazzlingly; glitteringly.",
    "FULGID": "Shining; glittering; dazzling. [R.] Pope.",
    "FULGIDITY": "Splendor; resplendence; effulgence. [R.] Bailey.",
    "FULGOR": "Dazzling brightness; splendor. [R.] Sir T. Browne.",
    "FULGURANT": "Lightening. [R.] Dr. H. More.",
    "FULGURATA":
        "A spectro-electric tube in which the decomposition of a liquidby the passage of an electric spark is observed. Knight.",
    "FULGURATE": "To flash as lightning. [R.]",
    "FULGURATING":
        "Resembling lightning; -- used to describe intense lancinatingpainsaccompanying locomotor ataxy.",
    "FULGURATION":
        "The sudden brightening of a fused globule of gold or silver,when the last film of the oxide of lead or copper leaves its surface;-- also called blick.A phenomenon called, by the old chemists, fulguration. Ure.",
    "FULGURITE":
        "A vitrified sand tube produced by the striking of lightning onsand; a lightning tube; also, the portion of rock surface fused by alightning discharge.",
    "FULGURY": "Lightning. [Obs.]",
    "FULHAM": "A false die. [Cant] [Written also fullam.] Shak.",
    "FULIGINOSITY":
        "The condition or quality of being fuliginous; sootiness; matterdeposited by smoke. [R.]",
    "FULIGINOUSLY": "In a smoky manner.",
    "FULIMART": "Same as Foumart.",
    "FULL":
        "Complete measure; utmost extent; the highest state or degree.The swan's-down feather, That stands upon the swell at full of tide.Shak.Full of the moon, the time of full moon.",
    "FULL HOUSE":
        "A hand containing three of a kind and a pair, as three kingsand two tens. It ranks above a flush and below four of a kind.",
    "FULL-BLOOMED": "Like a perfect blossom. \"Full-bloomed lips.\" Crashaw.",
    "FULL-BOTTOMED": "Of great capacity below the water line.",
    "FULL-BUTT":
        "With direct and violentop position; with sudden collision.[Colloq.] L'Estrange.",
    "FULL-DRIVE": "With full speed. [Colloq.]",
    "FULL-FORMED":
        "Full in form or shape; rounded out with flesh.The full-formed maids of Afric. Thomson.",
    "FULL-GROWN":
        "Having reached the limits of growth; mature. \"Full-grownwings.\" Lowell.",
    "FULL-HEARTED": "Full of courage or confidence. Shak.",
    "FULL-HOT": "Very fiery. Shak.",
    "FULL-MANNED": "Completely furnished wiith men, as a ship.",
    "FULL-ORBED":
        "Having the orb or disk complete or fully illuminated; like thefull moon.",
    "FULL-SAILED":
        "Having all its sails set,; hence, without restriction orreservation. Massinger.",
    "FULLAGE":
        "The money or price paid for fulling or cleansing cloth.Johnson.",
    "FULLAM": "A false die. See Fulham.",
    "FULLER":
        "One whose occupation is to full cloth. Fuller's earth, avariety of clay, used in scouring and cleansing cloth, to imbibegrease.-- Fuller's herb (Bot.), the soapwort (Saponaria officinalis),formerly used to remove stains from cloth.-- Fuller's thistle or weed (Bot.), the teasel (Dipsacus fullonum)whose burs are used by fullers in dressing cloth. See Teasel.",
    "FULLERY":
        "The place or the works where the fulling of cloth is carriedon.",
    "FULLING":
        "The process of cleansing, shrinking, and thickening cloth bymoisture, heat, and pressure. Fulling mill, a mill for fulling clothas by means of pesties or stampers, which alternately fall into andrise from troughs where the cloth is placed with hot water andfuller's earth, or other cleansing materials.",
    "FULLMART": "See Foumart. B. Jonson.",
    "FULLNESS":
        "The state of being full, or of abounding; abundance;completeness. [Written also fulness.]\"In thy presence is fullness of joy.\" Ps. xvi. 11.",
    "FULLONICAL": "Pertaining to a fuller of cloth. [Obs.] Blount.",
    "FULLY":
        "In a full manner or degree; completely; entirely; without lackor defect; adequately; satisfactorily; as, to be fully persuaded ofthe truth of a proposition. Fully committed (Law), committed toprison for trial, in distinction from being detained for examination.",
    "FULMAR":
        "One of several species of sea birds, of the familyprocellariidæ, allied to the albatrosses and petrels. Among the well-known species are the arctic fulmar (Fulmarus glacialis) (called alsofulmar petrel, malduck, and mollemock), and the giant fulmar(Ossifraga gigantea).",
    "FULMINANT": "Thundering; fulminating. [R.] Bailey.",
    "FULMINATORY": "Thundering; striking terror. Cotgrave.",
    "FULMINE": "To thunder. [Obs.] Spenser. Milton.",
    "FULMINEOUS": "Of, or concerning thunder.",
    "FULMINIC":
        "Pertaining to fulmination; detonating; specifically (Chem.),pertaining to, derived from, or denoting, an acid, so called; as,fulminic acid. Fulminic acid (Chem.), a complex acid, H2C2N2O2,isomeric with cyanic and cyanuric acids, and not known in the freestate, but forming a large class of highly explosive salts, thefulminates. Of these, mercuric fulminate, the most common, is used,mixed with niter, to fill percussion caps, charge cartridges, etc.-- Fulminic acid is made by the action of nitric acid on alcohol.",
    "FULMINURIC":
        "Pertaining to fulminic and cyanuric acids, and designating anacid so called. Fulminuric acid (Chem.), a white, crystalline,explosive subatance, H3C3N3O3, forming well known salts, and obtainedfrom the fulnunates. It is isomeric with cyanuric acid, and hence isalso called isocyanuric acid.",
    "FULNESS": "See Fullness.",
    "FULSAMIC": "Fulsome. [Obs.]",
    "FULVID": "Fulvous. [R.] Dr. H. More.",
    "FULVOUS": "Tawny; dull yellow, with a mixture of gray and brown. Lindley.",
    "FUM":
        "To play upon a fiddle. [Obs.]Follow me, and fum as you go. B. Jonson.",
    "FUMACIOUS": "Smoky; hence, fond of smoking; addicted to smoking tobacco.",
    "FUMAGE":
        "Hearth money.Fumage, or fuage, vulgarly called smoke farthings. Blackstone.",
    "FUMARATE": "A salt of fumaric acid.",
    "FUMARIC":
        "Pertaining to, or derived from, fumitory (Fumaria officinalis).Fumaric acid (Chem.), a widely occurring organic acid, exttractedfrom fumitory as a white crystallline substance, C2H2(CO2H)2, andproduced artificially in many ways, as by the distillation of malicacid; boletic acid. It is found also in the lichen, Iceland moss, andhence was also called lichenic acid.",
    "FUMARINE":
        "An alkaloid extracted from fumitory, as a white crystallinesubstance.",
    "FUMAROLE":
        "A hole or spot in a volcanic or other region, from which fumesissue.",
    "FUMATORIUM":
        "An air-tight compartment in which vapor may be generated todestroy germs or insects; esp., the apparatus used to destroy SanJosé scale on nursery stock, with hydrocyanic acid vapor.",
    "FUMATORY": "See Fumitory. [Obs.]",
    "FUMBLE":
        "To handle or manage awkwardly; to crowd or tumble together.Shak.",
    "FUMBLER": "One who fumbles.",
    "FUMBLINGLY": "In the manner of one who fumbles.",
    "FUMED OAK":
        "Oak given a weathered appearance by exposure in an air-tightcompartment to fumes of ammonia from uncorked cans, being first givena coat of filler.",
    "FUMELESS": "Free from fumes.",
    "FUMERELL": "See Femerell.",
    "FUMET": "The dung of deer. B. Jonson.",
    "FUMETERE": "Fumitory. [Obs.]",
    "FUMID": "Smoky; vaporous. Sir T. Broune.",
    "FUMIFEROUS": "Producing smoke.",
    "FUMIFUGIST": "One who, or that which, drives away smoke or fumes.",
    "FUMIFY": "To subject to the action of smoke. [Obs.] Sir T. Browne.",
    "FUMIGANT": "Fuming. [R.]",
    "FUMIGATOR":
        "One who, or that which, fumigates; an apparattus forfumigating.",
    "FUMIGATORY": "Having the quality of purifying by smoke. [R.]",
    "FUMILY": "Smokily; with fume.",
    "FUMING":
        "Producing fumes, or vapors. Cadet's fuming liquid (Chem.),alkarsin.-- Fuming liquor of Libsvius (Old Chem.), stannic chloride; thechloride of tin, SnCl4, forming a colorless, mobile liquid whichfumes in the air. Mixed with water it solidifies to the so-calledbutter of tin.-- Fuming sulphuric acid. (Chem.) Same as Disulphuric acid, uderDisulphuric.",
    "FUMINGLY":
        "In a fuming manner; angrily. \"They answer fumingly.\" Hooker.",
    "FUMISH": "Smoky; hot; choleric.",
    "FUMISHNESS": "Choler; fretfulness; passion.",
    "FUMITER": "Fumitory. [Obs.]",
    "FUMITORY":
        "The common uame of several species of the genus Fumaria, annualherbs of the Old World, with finely dissected leaves and smallflowers in dense racemes or spikes. F. officinalis is a commonspecies, and was formerly used as an antiscorbutic. Climbing fumitory(Bot.), the Alleghany vine (Adlumia cirrhosa); a biennial climbingplant with elegant feathery leaves and large clusters of pretty whiteor pinkish flowers looking like grains of rice.",
    "FUMMEL": "A hinny.",
    "FUMOSITY": "The fumes of drink. [Obs.] Chaucer.",
    "FUMY": "Producing fumes; fumous. \"Drowned in fumy wine.\" H. Brooke.",
    "FUN":
        "Sport; merriment; frolicsome amusement. \"Oddity, frolic, andfun.\" Goldsmith. To make fan of, to hold up to, or turn into,ridicule.",
    "FUNAMBULATE": "To walk or to dance on a rope.",
    "FUNAMBULATION": "Ropedancing.",
    "FUNAMBULIST": "A ropewalker or ropedancer.",
    "FUNCTION":
        "The appropriate action of any special organ or part of ananimal or vegetable organism; as, the function of the heart or thelimbs; the function of leaves, sap, roots, etc.; life is the sum ofthe functions of the various organs and parts of the body.",
    "FUNCTIONAL":
        "Pertaining to the function of an organ or part, or to thefunctions in general. Functional disease (Med.), a disease of whichthe symptoms cannot be referred to any appreciable lesion or changeof structure; the derangement of an organ arising from a cause, oftenunknown, external to itself opposed to organic disease, in which theorgan itself is affected.",
    "FUNCTIONALIZE": "To assign to some function or office. [R.]",
    "FUNCTIONALLY":
        "In a functional manner; as regards normal or appropriateactivity.The organ is said to be functionally disordered. Lawrence.",
    "FUNCTIONARY":
        "One charged with the performance of a function or office; as, apublic functionary; secular functionaries.",
    "FUNCTIONLESS":
        "Destitute of function, or of an appropriate organ. Darwin.",
    "FUND":
        "The stock of a national debt; public securities; evidences(stocks or bonds) of money lent to government, for which interest ispaid at prescribed intervals; -- called also public funds.",
    "FUNDABLE":
        "Capable of being funded, or converted into a fund; convertibleinto bonds.",
    "FUNDAMENTAL":
        "Pertaining to the foundation or basis; serving for thefoundation. Hence: Essential, as an element, principle, or law;important; original; elementary; as, a fundamental truth; afundamental axiom.The fundamental reasons of this war. Shak.Some fundamental antithesis in nature. Whewell.Fundamental bass (Mus.), the root note of a chord; a bass formed ofthe roots or fundamental tones of the chords.-- Fundamental chord (Mus.), a chord, the lowest tone of which isits root.-- Fundamental colors, red, green, and violet-blue. See Primarycolors, under Color.",
    "FUNDAMENTALLY":
        "Primarily; originally; essentially; radically; at thefoundation; in origin or constituents. \"Fundamentally defective.\"Burke.",
    "FUNDHOLDER": "One who has money invested in the public funds. J. S. Mill.",
    "FUNDLESS": "Destitute of funds.",
    "FUNDUS":
        "The bottom or base of any hollow organ; as, the fundus of thebladder; the fundus of the eye.",
    "FUNEBRIAL":
        "Pertaining to a funeral or funerals; funeral; funereal. [Obs.][Written also funebral.] Sir T. Browne.",
    "FUNEBRIOUS": "Funebrial. [Obs.]",
    "FUNERAL":
        "Per. taining to a funeral; used at the interment of the dead;as, funeral rites, honors, or ceremonies. Shak. Funeral pile, astructure of combustible material, upon which a dead body is placedto be reduced to ashes, as part of a funeral rite; a pyre.-- Fu\"ner*al*ly, adv. [Obs.] Sir T. Browne.",
    "FUNERATE": "To bury with funeral rites. [Obs.] Cockeram.",
    "FUNERATION": "The act of burying with funeral rites. [Obs.] Knatchbull.",
    "FUNEREAL":
        "Suiting a funeral; pertaining to burial; solemn. Hence: Dark;dismal; mournful. Jer. Taylor.What seem to us but sad funereal tapers May be heaven's distantlamps. Longfellow.-- Fu*ne\"re*al*ly, adv.",
    "FUNEST":
        "Lamentable; doleful. [R.] \"Funest and direful deaths.\"Coleridge.A forerunner of something very funest. Evelyn.",
    "FUNGAL": "Of or pertaining to fungi.",
    "FUNGATE": "A salt of fungic acid. [Formerly written also fungiate.]",
    "FUNGE": "A blockhead; a dolt; a fool. [Obs.] Burton.",
    "FUNGI": "See Fungus.",
    "FUNGI IMPERFECTI":
        "A heterogenous group of fungi of which the complete lifehistory is not known. Some undoubtedly represent the conidium stagesof various Ascomycetes. The group is divided into the ordersSphæropsidales, Melanconiales, and Moniliales.",
    "FUNGIA":
        "A genus of simple, stony corals; -- so called because they areusually flat and circular, with radiating plates, like the gills of amushroom. Some of them are eighteen inches in diameter.",
    "FUNGIAN":
        "Of or pertaining to the Fungidæ, a family of stony corals.-- n.",
    "FUNGIBLES":
        "Things which may be furnished or restored in kind, asdistinguished from specific things; -- called also fungible things.Burrill.",
    "FUNGIC": "Pertaining to, or obtained from, mushrooms; as, fungic acid.",
    "FUNGICIDE": "Anything that kills fungi.-- Fun`gi*ci\"dal, n.",
    "FUNGIFORM":
        "Shaped like a fungus or mushroom. Fungiform papillæ (Anat.),numerous small, rounded eminences on the upper surface of the tongue.",
    "FUNGILLIFORM": "Shaped like a small fungus.",
    "FUNGIN":
        "A name formerly given to cellulose found in certain fungi andmushrooms.",
    "FUNGITE": "A fossil coral resembling Fungia.",
    "FUNGIVOROUS": "Eating fungi; -- said of certain insects and snails.",
    "FUNGOID": "Like a fungus; fungous; spongy.",
    "FUNGOLOGIST": "A mycologist.",
    "FUNGOLOGY": "Mycology.",
    "FUNGOSITY":
        "The quality of that which is fungous; fungous excrescence.Dunglison.",
    "FUNGUS":
        "Any one of the Fungi, a large and very complex group ofthallophytes of low organization, -- the molds, mildews, rusts,smuts, mushrooms, toadstools, puff balls, and the allies of each.",
    "FUNIC": "Funicular.",
    "FUNICLE": "The little stalk that attaches a seed to the placenta.",
    "FUNICULAR":
        "Pertaining to a funiculus; made up of, or resembling, afuniculus, or funiculi; as, a funicular ligament. Funicular action(Mech.), the force or action exerted by a rope in drawing togetherthe supports to which its ends are Fastened, when acted upon byforces applied in a direction transverse to the rope, as in thearcher's bow.-- Funicular curve. Same as Catenary.-- Funicular machine (Mech.), an apparatus for illustrating certainprinciples in statics, consisting of a cord or chain attached at oneend to a fixed point, and having the other passed over a pulley andsustaining a weight, while one or more other weights are suspendedfrom the cord at points between the fixed support and the pulley.-- Funicular polygon (Mech.), the polygonal figure assumed by a cordfastened at its extremities, and sustaining weights at differentpoints.",
    "FUNICULATE": "Forming a narrow ridge.",
    "FUNILIFORM":
        "Resembling a cord in toughness and flexibility, as the roots ofsome endogenous trees.",
    "FUNIS": "A cord; specifically, the umbilical cord or navel string.",
    "FUNK": "An offensive smell; a stench. [Low]",
    "FUNKY":
        "Pertaining to, or characterized by, great fear, or funking.[Colloq. Eng.]",
    "FUNNELFORM":
        "Having the form of a funnel, or tunnel; that is, expandinggradually from the bottom upward, as the corolla of some flowers;infundibuliform.",
    "FUNNY":
        "Droll; comical; amusing; laughable. Funny bone. See crazy bone,under Crazy.",
    "FUR":
        "Articles of clothing made of fur; as, a set of furs for a lady(a collar, tippet, or cape, muff, etc.).Wrapped up in my furs. Lady M. W. Montagu.",
    "FURACIOUS": "Given to theft; thievish. [Obs.]",
    "FURACITY": "Addictedness to theft; thievishness. [Obs.]",
    "FURBELOW": "A plaited or gathered flounce on a woman's garment.",
    "FURBISH":
        "To rub or scour to brightness; to clean; to burnish; as, tofurbish a sword or spear. Shak.Furbish new the name of John a Gaunt. Shak.",
    "FURBISHABLE": "Capable of being furbished.",
    "FURBISHER":
        "One who furbishes; esp., a sword cutler, who finishes swordblades and similar weapons.",
    "FURCATION": "A branching like a. fork.",
    "FURCIFEROUS":
        "Rascally; scandalous. [R.] \"Furciferous knaves.\" De Quincey.",
    "FURCULA": "A forked process; the wishbone or furculum.",
    "FURCULAR": "Shaped like a fork; furcate.",
    "FURCULUM":
        "The wishbone or merrythought of birds, formed by the unitedclavicles.",
    "FURDLE": "To draw up into a bundle; to roll up. [Ods.]",
    "FURFUR": "Scurf; dandruff.",
    "FURFURACEOUS": "Made of bran; like bran; scurfy.",
    "FURFURAN":
        "A colorless, oily substance, C4H4O, obtained by distillingcertain organic substances, as pine wood, salts of pyromucic acid,etc.; -- called also tetraphenol.",
    "FURFURATION": "Falling of scurf from the head; desquamation.",
    "FURFURINE":
        "A white, crystalline base, obtained indirectly from furfurol.",
    "FURFUROL":
        "A colorless oily liquid, C4H3O.CHO, of a pleasant odor,obtained by the distillation of bran, sugar, etc., and regarded as analdehyde derivative of furfuran; -- called also furfural.",
    "FURFUROUS":
        "Made of bran; furfuraceous. [R.] \"Furfurous bread.\" SydneySmith.",
    "FURIAL": "Furious; raging; tormenting. [Obs.] Chaucer.",
    "FURIBUNDAL": "Full of rage. [Obs.] G. Harvey.",
    "FURIES": "See Fury, 3.",
    "FURILE":
        "A yellow, crystalline substance, (C4H3O)2.C2O2, obtained by theoxidation of furoin. [Written also furil.]",
    "FURILIC": "Pertaining to, or derived from, furile; as, furilic acid.",
    "FURIOSO": "With great force or vigor; vehemently.",
    "FURL":
        "To draw up or gather into close compass; to wrap or roll, as asail, close to the yard, stay, or mast, or, as a flag, close to oraround its staff, securing it there by a gasket or line. Totten.",
    "FURLONG":
        "A measure of length; the eighth part of a mile; forty rods; twohundred and twenty yards.",
    "FURLOUGH":
        "Leave of abserice; especially, leave given to an offcer orsoldier to be absent from service for a certain time; also, thedocument granting leave of absence.",
    "FURNIMENT": "Furniture. [Obs.] Spenser.",
    "FURNISH":
        "That which is furnished as a specimen; a sample; a supply.[Obs.] Greene.",
    "FURNISHER": "One who supplies or fits out.",
    "FURNISHMENT":
        "The act of furnishing, or of supplying furniture; also,furniture. [Obs.] Daniel.",
    "FURNITURE":
        "A mixed or compound stop in an organ; -- sometimes calledmixture.",
    "FUROIN": "A colorless, crystalline substance, C10H8O4, from furfurol.",
    "FURORE": "Excitement; commotion; enthusiasm.",
    "FURRIER": "A dealer in furs; one who makes or sells fur goods.",
    "FURRING": "Double planking of a ship's side.",
    "FURROWY": "Furrowed. [R.] Tennyson.",
    "FURTHER":
        "To a greater distance; in addition; moreover. See Farther.Carries us, I know not how much further, into familiar company. M.Arnold.They sdvanced us far as Eleusis and Thria; but no further. Jowett(Thucyd. ).Further off, not so near; apart by a greater distance.",
    "FURTHERANCE":
        "The act of furthering or helping forward; promotion;advancement; progress.I know that I shall abide and continue with you all for yourfurthersnce and joy of faith. Phil. i. 25.Built of furtherance and pursuing, Not of spent deeds, but of doing.Emerson.",
    "FURTHERER": "One who furthers. or helps to advance; a promoter. Shak.",
    "FURTHERMORE":
        "or conj. Moreover; besides; in addition to what has been said.",
    "FURTHERMOST": "Most remote; furthest.",
    "FURTHERSOME":
        "Tending to further, advance, or promote; helpful; advantageous.[R.]You will not find it furthersome. Carlyle.",
    "FURTHEST":
        "superl. Most remote; most in advance; farthest. See Further, a.",
    "FURTIVE":
        "Stolen; obtained or characterized by stealth; sly; secret;stealthy; as, a furtive look. Prior.A hasty and furtive ceremony. Hallam.",
    "FURTIVELY": "Stealthily by theft. Lover.",
    "FURUNCLE":
        "A superficial, inflammatory tumor, suppurating with a centralcore; a boil.",
    "FURUNCULAR":
        "Of or pertaining to a furuncle; marked by the presence offuruncles.",
    "FURY":
        "A thief. [Obs.]Have an eye to your plate, for there be furies. J. Fleteher.",
    "FURZE":
        "A thorny evergreen shrub (Ulex Europæus), with beautiful yellowflowers, very common upon the plains and hills of Great Britain; --called also gorse, and whin. The dwarf furze is Ulex nanus.",
    "FURZECHAT": "The whinchat; -- called also furzechuck.",
    "FURZELING":
        "An English warbler (Melizophilus provincialis); -- called alsofurze wren, and Dartford warbler.",
    "FURZEN": "Furzy; gorsy. [Obs.] Holland.",
    "FURZY":
        "bounding in, or overgrown with, furze; characterized by furze.Gay.",
    "FUSAROLE":
        "A molding generally placed under the echinus or quarter roundof capitals in the Doric, Ionic, and Corinthian orders ofarchitecture.",
    "FUSCATION": "A darkening; obscurity; obfuscation. [R.] Blount.",
    "FUSCIN":
        "A brown, nitrogenous pigment contained in the retinalepithelium; a variety of melanin.",
    "FUSCINE":
        "A dark-colored substance obtained from empyreumatic animal oil.[R.]",
    "FUSCOUS":
        "Brown or grayish black; darkish.Sad and fuscous colors, as black or brown, or deep purple and thelike. Burke.",
    "FUSE":
        "A tube or casing filled with combustible matter, by means ofwhich a charge of powder is ignited, as in blasting; -- called alsofuzee. See Fuze. Fuse hole, the hole in a shell prepared for thereception of the fuse. Farrow.",
    "FUSEE":
        "A small packet of explosive material with wire appendagesallowing it to be conveniently attached to a railroad track. It willexplode with a loud report when run over by a train, and is used toprovide a warning signal to the engineer.",
    "FUSELAGE":
        "An elongated body or frame of an aëroplane or flying machine;sometimes, erroneously, any kind of frame or body. Many aëroplaneshave no fuselage, properly so called.",
    "FUSIBILITY": "The quality of being fusible.",
    "FUSIBLE":
        "CapabIe of being melted or liquefied. Fusible metal, any alloyof different metals capable of being easily fused, especially analloy of five parts of bismuth, three of lead, and two of tin, whichmelts at a temperature below that of boiling water. Ure.-- Fusible plug (Steam Boiler), a piece of easily fusible alloy,placed in one of the sheets and intended to melt and blow off thesteam in case of low water.",
    "FUSIFORM":
        "Shaped like a spindle; tapering at each end; as, a fusiformroot; a fusiform cell.",
    "FUSIL": "A light kind of flintlock musket, formerly in use.",
    "FUSILE": "Same as Fusil, a.",
    "FUSILLADE": "A simultaneous discharge of firearms.",
    "FUSION": "The union, or binding together, of adjacent parts or tissues.",
    "FUSOME": "Handy; reat; handsome; notable. [Prov. Eng.] Halliwell.",
    "FUSS":
        "To be overbusy or unduly anxious about trifles; to make abustle or ado. Sir W. Scott.",
    "FUSSILY": "In a fussy manner. Byron.",
    "FUSSINESS": "The quality of being fussy.",
    "FUSSY":
